EULA_BODY="UMOWA LICENCYJNA UŻYTKOWNIKA OPROGRAMOWANIA THQ INC.\n\n1. PRZED ZAINSTALOWANIEM GRY NA SWOIM KOMPUTERZE PRZECZYTAJ UWAŻNIE WARUNKI TEJ UMOWY. JEST ONA ZGODNYM Z PRAWEM POROZUMIENIEM POMIĘDZY TOBĄ (OSOBA PRYWATNA LUB POJEDYNCZA JEDNOSTKA ZWANA „TOBĄ”), A THQ INC., JEJ LICENCJODAWCAMI I FIRMAMI FILIALNYMI (NAZYWANYMI PÓŹNIEJ „THQ”). UMOWA DOTYCZY OPROGRAMOWANIA NOSZĄCEGO NAZWĘ „SUPREME COMMANDER - W obliczu wroga”. W JEGO SKŁAD WCHODZI OPROGRAMOWANIE KOMPUTEROWE, INNE MEDIA, DRUKOWANE MATERIAŁY I/LUB ELEKTRONICZNA DOKUMENTACJA (WSZYSTKO PÓŹNIEJ NAZYWANE \"OPROGRAMOWANIEM\"). INSTALUJĄC, KOPIUJĄC LUB UŻYWAJĄC OPROGRAMOWANIA W INNY SPOSÓB (LUB OTWIERAJĄC OPAKOWANIE) DAJESZ DO ZROZUMIENIA, ŻE ZAPOZNAŁEŚ SIĘ Z WARUNKAMI UMOWY I ZGADZASZ SIĘ Z NIMI. OPROGRAMOWANIE JEST LICENCJONOWANE I SPRZEDAWANE TOBIE POD WARUNKIEM, ŻE BĘDZIESZ PRZESTRZEGAŁ PUNKTÓW ZAWARTYCH W UMOWIE. JEŚLI NIE ZGADZASZ SIĘ Z NIMI, NIE INSTALUJ PROGRAMU LUB USUŃ WSZYSTKIE PLIKI POWIĄZANE Z OPROGRAMOWANIEM Z TWOJEGO KOMPUTERA.\017\n\n2. Na podstawie niniejszej umowy możesz używać jednej kopii programu na terenie tego kraju, w którym zakupiłeś oprogramowanie. Wszystkie inne prawa wynikające z tej umowy należą do THQ. Możesz: (i) używać oprogramowania na swoim komputerze, który spełnia wymagania sprzętowe. Niemniej jednak program może być używany tylko na jednym (1) \nkomputerze; co więcej (ii) możesz instalować oprogramowanie u innych użytkowników na ich komputerach pod warunkiem, że zaakceptują oni niniejszą umowę. Nie możesz rozpowszechniać, dystrybuować, wypożyczać oprogramowania jak i dokumentacji.\017\n\n3. Akceptujesz, że kod źródłowy Oprogramowania jest tajny i wszelkie prawa do niego należą do THQ. Użytkownik nie może rekonstruować, dekompilować ani rozkładać programu - poza sytuacjami, na które wyraźnie zezwalają odpowiednie przepisy prawne, pomimo niniejszego ograniczenia. \017\n\n4. Własność: Oprogramowanie jest chronione prawami autorskimi, międzynarodowymi traktatami, a także prawami własności intelektualnej. Tytuł, wszystkie materiały wchodzące w skład oprogramowania (większość zdjęć, postaci, nazw postaci, lokacji, dialogów, obrazów, animacji, scenek wideo, muzyki, tekstów, apletów), a także załączone drukowane \nmateriały są własnością THQ i Licencjodawców. Ta Umowa nie zezwala na używanie żadnego z komponentów oprogramowania oddzielnie.\017\n\n5. Umowa zaczyna obowiązywać w momencie instalacji Oprogramowania i jest ważna do czasu uchylenia przez THQ lub złamania jednego z warunków niniejszej umowy. Wraz z jej rozwiązaniem zgadzasz się na zniszczenie bądź usunięcie wszystkich kopii Oprogramowania znajdujących się w Twoim posiadaniu.\017\n\n6. Nie możesz modyfikować Oprogramowania, łączyć go z innym produktem (za wyjątkiem przystosowania programu do funkcjonowania z systemem operacyjnym komputera, na którym jest on zainstalowany) lub tworzenia innych programów opartych na Oprogramowaniu.\017\n\n7. Oprogramowanie nie może być ściągane za pośrednictwem Internetu bądź importowane, bądź eksportowane z i do krajów (lub ich mieszkańców), na które zostało nałożone embargo lub do osób, które znajdują się na specjalnej liście Departamentu Skarbu Stanów Zjednoczonych Ameryki Północnej i Departamentu Handlu Stanów Zjednoczonych Ameryki Północnej. Jeśli nie spełniasz tych punktów lub nie jesteś tego pewien, to nie instaluj oprogramowania. Gdy żyjesz w kraju znajdującym się na listach, licencja Tobie nie przysługuje.\017\n\n8. Sam jesteś odpowiedzialny za to czy Ty i Twój komputer spełniacie powyższe warunki. Jesteś świadom i zgadzasz się używać na własne ryzyko oprogramowania i nośnika, na którym jest ono nagrane. Program jak i nośnik dostarczone są w stanie gotowym, BEZ \nŻADNEGO RODZAJU GWARANCJI. W MAKSYMALNYM ZAKRESIE DOPUSZCZALNYM PRZEZ PRAWO. FIRMA THQ I LICENCJODAWCY ODMAWIAJĄ GWARANCJI JAWNYCH I DOMNIEMANYCH, WŁĄCZAJĄC W TO MIĘDZY INNYMI JAKIEKOLWIEK GWARANCJE PRZYDATNOŚCI HANDLOWEJ LUB PRZYDATNOŚCI DO JAKIEGOKOLWIEK OKREŚLONEGO CELU, TYTUŁU LU