Experimental_Aeon_010_010="[{i Choir}]: Galaktyczny kolos używa znajdującego się w jego \"oku\" generatora energii, aby uwolnić zabójczy ładunek. Kiedy Kolos zostaje zniszczony, z jego piersi uwolniona zostaje niestabilna kula energii, która unicestwi wszystko, z czym się zetknie."
Experimental_Aeon_010_020="[{i Choir}]: Niech Galaktyczny kolos zgładzi waszych przeciwników."
Experimental_Aeon_020_010="[{i Choir}]: Potężny pancernik Burza uzbrojony jest w działo Oblivion, które uderza we wroga z wielkiego dystansu. Okręt posiada wewnętrzną Stocznię marynarki, może więc w razie potrzeby produkować jednostki morskie."
Experimental_Aeon_020_020="[{i Choir}]: Burza jest teraz w twoich rękach."
Experimental_Aeon_030_010="[{i Choir}]: Potężny latający spodek, CAR wyzwala kopułowe pole energetyczne, które pochłania wszystko, czego dotknie. CAR może również przechowywać jednostki powietrzne."
Experimental_Aeon_030_020="[{i Choir}]: CAR jest gotowy do odpalenia. Ku chwale Aeonów!"
Experimental_Cybran_010_010="[{i QAI}]: Przy pomocy tego Ciężkiego generatora lasera mikrofalowego, Pajęczy robot \"Władca małp\" może w ciągu sekundy zniszczyć niezliczoną ilość jednostek. Z powodu swoich rozmiarów miażdży też każdą jednostkę, która wpadnie mu pod nogi."
Experimental_Cybran_010_020="[{i Ops}]: Władca małp gotowy do bitwy."
Experimental_Cybran_010_030="[{i Ops}]: Pajęczy robot gotowy do ataku."
Experimental_Cybran_020_010="[{i QAI}]: Żniwiarz jest ciężko opancerzoną, latającą platformą. Wyposażony w Wyrzutnie ciężkich pocisków irydowych i Wyrzutnie ciężkich pocisków elektronowych może atakować jednostki na ziemne z wyniszczającą siłą. "
Experimental_Cybran_020_020="[{i Ops}]: Pański Żniwiarz jest gotowy do testu polowego, dowódco."
Experimental_Cybran_030_010="[{i QAI}]: Ze względu na swoją mobilność, Scathis może razić zaporowym ogniem artyleryjskim niemal każdy cel. Ma doskonały zasięg, a szybkostrzelność została znacznie zwiększona."
Experimental_Cybran_030_020="[{i Ops}]: Scathis już funkcjonuje."
Experimental_UEF_010_010="[{i EarthCom}]: Spaślak to przybrzeżny pancernik. Trójlufowe działa artyleryjskie mogą razić zaporowym ogniem artyleryjskim, a tylny luk zapewnia znakomitą ładowność dla posiłków."
Experimental_UEF_010_020="[{i EarthCom}]: Spaślak zakończył budowę."
Experimental_UEF_020_010="[{i EarthCom}]: Lotniskowiec Atlantyda jest filarem lotniczej części marynarki EarthCom. Przechowuje jednostki lotnicze i jest wyposażony w lekkie wsparcie przeciwlotnicze oraz luki torpedowe."
Experimental_UEF_020_020="[{i EarthCom}]: Atlantyda jest gotowa do wodowania."
Experimental_UEF_030_010="[{i EarthCom}]: Komory ogniowe Mavora zostały zmodyfikowane w ten sposób, aby mogły odpalać taktyczne pociski nuklearne na olbrzymie odległości. Jego zasięg nie może się równać z żadną inną bronią."
Experimental_UEF_030_020="[{i EarthCom}]: Mavor już działa."
FMV_VO_Opening_010_005="Capella, dwa lata później."
FMV_VO_Opening_010_010="Zbliża się wiele wrogich obiektów. Zabierz stąd ten statek."
FMV_VO_Opening_010_020="Silniki się uruchamiają. Potrzebuję jeszcze tylko kilku minut."
FMV_VO_Opening_010_025="Silniki główne uruchomione. Trajektoria lotu wprowadzona."
FMV_VO_Opening_010_030="Przeciwnicy na ekranie. 4 minuty do kontaktu. Tyle masz czasu."
FMV_VO_Opening_010_040="Zrozumiałem."
FMV_VO_Opening_010_050="Jestem pod silnym ostrzałem. Gdzie, do cholery, są moje posiłki?"
FMV_VO_Opening_010_060="Namierzam siły przeciwnika."
FMV_VO_Opening_010_070="Najwyższy czas, do cholery. Ustaw linie obronne na północ od nas."
FMV_VO_Opening_010_080="Nie myśl sobie, że będziesz mnie uczył sztuki wojennej, Clarke."
FMV_VO_Opening_010_090="Po prostu zrób to. Później możemy się kłócić."
FMV_VO_Opening_010_100="Uruchomiono główne silniki. Trajektoria lotu obliczona."
FMV_VO_Opening_010_110="Rozpocznij powrót; statek musi sam sobie poradzić."
FMV_VO_Opening_010_120="Powrót za 5, 4, 3, 2, 1."
FMV_VO_Opening_010_130="Statek został trafiony! Spada!"
FMV_VO_Opening_010_140="Wracaj, Clarke! Wracaj!"
FMV_VO_Opening_010_150="Dalej, bydlaku."
FMV_VO_Opening_010_160="Dalej, skurczybyku."
FMV_VO_Opening_010_170="Bydlaki."
FMV_VO_Opening_020_010="Seraphimowie wylali się ze szczeliny kwantowej, ich maszyny wojenne niosły śmierć i zniszczenie. Ziemia została podbita w trzy dni. Nikt nie ocalał."
FMV_VO_Opening_020_020="Musiałam się ukryć, ponieważ Seraphimowie uważali, że tylko jedna rasa może używać Drogi, moje nowe umiejętności poddały cały system ich wiary w wątpliwość. Seraphimowie chcieli zlikwidować całą rasę ludzką."
FMV_VO_Opening_020_030="Większość ludzi Aeonu, sądząc, że ich bogowie powrócili, powitała Seraphimów i przyłączyła się do ich kampanii zniszczenia. Jedynie Rhiza i kilku innych pozostało mi wiernych. Rozpoczęli wojnę partyzancką przeciwko Zakonowi i Seraphimom."
FMV_VO_Opening_020_040="Niezliczone światy kontrolowane przez UEF - i Cybran - zostały zniszczone. Przyparci do muru, stając w obliczu całkowitego zniszczenia, UEF i Cybranie zawarli kłopotliwe przymierze. Dołączyła do nich Rhiza wraz z innymi Lojalistami."
FMV_VO_Opening_020_050="Przez blisko trzy lata, Seraphimowie i ich sojusznicy z Aeonu ścigali ludzkość w całym kosmosie, mordując każdego, kto stanął na ich drodze."
FMV_VO_Opening_020_060="Nadszedł czas, aby się odegrać."
