MP_Taunt_0000="Twoi przywódcy są niczym więcej niż kłamcami. Nie wierz ich propagandzie."
MP_Taunt_0001="Jak wiele krwi Cybran jest na twoich rękach?"
MP_Taunt_0002="Chcę być wolny. Czy proszę o zbyt wiele?"
MP_Taunt_0003="Niedobrze mi na widok ciebie i całego twojego rodzaju. Niszczycie to, czego nie rozumiecie. "
MP_Taunt_0004="Chcieliśmy żyć w pokoju. Sami ściągnęliście na siebie tę wojnę."
MP_Taunt_0005="Pewnego dnia Cybranie będą kontrolować galaktykę."
MP_Taunt_0006="UEF rozpada się. Stary porządek umiera. Czas działa na waszą niekorzyść."
MP_Taunt_0007="UEF zniewoliłoby Cybran. Jak mógłbyś wspierać taki cel?"
MP_Taunt_0008="Przyjmij “Drogę” albo bądź zgładzony."
MP_Taunt_0009="Swoją nienawiścią niszczycie galaktykę."
MP_Taunt_0010="Odpowiesz za zbrodnie popełnione przez UEF."
MP_Taunt_0011="Jesteśmy zbawieniem galaktyki. Przyjmij nauki."
MP_Taunt_0012="“Droga” musi być przyjęta przez całą ludzkość!"
MP_Taunt_0013="Zabicie cię nie jest moim pragnieniem."
MP_Taunt_0014="Przyjmij “Drogę” i stań się Rycerzem Oświeconych"
MP_Taunt_0015="Księżniczka przepowiedziała moje zwycięstwo."
MP_Taunt_0016="Jesteś odrażający."
MP_Taunt_0017="Oczyszczę tę planetę z każdego Symbionta."
MP_Taunt_0018="Wasza wiara w technologię będzie waszą zgubą."
MP_Taunt_0019="Jesteśmy jedyną nadzieją ludzkości."
MP_Taunt_0020="Droga musi być przyjęta przez całą ludzkość!"
MP_Taunt_0021="Nie możesz mi dorównać!"
MP_Taunt_0022="Pewnego dnia odnajdę Brackmana... I będzie to koniec Cybran."
MP_Taunt_0023="Nie doceniłem cię. Więcej tego nie zrobię"
MP_Taunt_0024="Oświeceni idą po ciebie, imperialisto."
MP_Taunt_0025="Nie lękasz się, imperialisto? Powinieneś."
MP_Taunt_0026="Tyrania UEF upadnie."
MP_Taunt_0027="Uniform dowódcy będzie znakomitym całunem pogrzebowym."
MP_Taunt_0028="Aeonowie oczyszczą galaktykę z tych, którzy chcą zniszczyć ludzkość."
MP_Taunt_0029="Nie jest za późno, by zaakceptować “Drogę”."
MP_Taunt_0030="UEF zamordowało moją rodzinę. Zemszczę się."
MP_Taunt_0031="Nie możesz się równać z potęgą prawości."
MP_Taunt_0032="Czas umierać."
MP_Taunt_0033="Służę Księżniczce. Twoje zamiary zostaną ujawnione."
MP_Taunt_0034="Jesteś zniewagą ludzkości."
MP_Taunt_0035="Kiedy skończymy, Cybranie będą wytępieni."
MP_Taunt_0036="Płomienie naszej prawości oczyszczają galaktykę."
MP_Taunt_0037="Byłeś martwy już w momencie, gdy wszczepiłeś sobie w głowę ten chip."
MP_Taunt_0038="Nie będzie dla was litości."
MP_Taunt_0039="Nikt nad tobą nie zapłacze, Cybranie."
MP_Taunt_0040="My, Cybranie, zwyciężamy na wszystkich frontach! Nie możecie nas powstrzymać!"
MP_Taunt_0041="Wszystko, czego chcemy, to nasza wolność. Dlaczego tak trudno wam to zrozumieć?"
MP_Taunt_0042="Z przyjemnością zobaczę, jak umierasz"
MP_Taunt_0043="UEF jest niczym więcej niż tyranem w przebraniu."
MP_Taunt_0044="Grrrrrr."
MP_Taunt_0045="Do końca jeszcze daleko."
MP_Taunt_0046="Twoje zachowanie jest niemoralne."
MP_Taunt_0047="Dzisiaj zginiesz."
MP_Taunt_0048="Widzę, że Aeonowie postanowili dołączyć do zabawy."
MP_Taunt_0049="Bez tego działa UEF przestanie istnieć."
MP_Taunt_0050="Wasze imperium rozpada się."
MP_Taunt_0051="Nie możesz nas zatrzymać."
MP_Taunt_0052="Pożary wolności goreją w całej galaktyce. Zbierzecie teraz to, co zasialiście."
MP_Taunt_0053="Zapłacisz za atak na dr. Brackmana."
MP_Taunt_0054="To jest zbyt łatwe."
MP_Taunt_0055="Jesteś skończony."
MP_Taunt_0056="Widziałem “Drogę”. Wszystko, w co wierzycie jest kłamstwem."
MP_Taunt_0057="Wkrótce Aeonowie wytępią niewiernych z galaktyki. Nastanie pokój."
MP_Taunt_0058="Będzie musiał się pan bardziej postarać, kapitanie."
MP_Taunt_0059="Oświecenie Aeonów stanowi prawdę."
MP_Taunt_0060="Twój los jest przypieczętowany."
MP_Taunt_0061="Marxon oczyści galaktykę."
MP_Taunt_0062="Generał Clarke zdradziła cię. Jest niczym innym, jak podżegaczem wojennym i kłamcą."
MP_Taunt_0063="Czas to skończyć."
MP_Taunt_0064="Black Sun zabije miliony niewinnych. Czy potrafisz żyć z ich krwią na rękach?"
MP_Taunt_0065="Nigdy nie pokonacie Oświeconych."
MP_Taunt_0066="Awatar Wojny widział twoją porażkę."
MP_Taunt_0067="Każda dusza na ziemi będzie oczyszczona moją ręką."
MP_Taunt_0068="Wszyscy ujrzeli wasze kłamstwa i tajemnice."
MP_Taunt_0069="Poddaj się, a ofiaruje ci miłosierną śmierć."
MP_Taunt_0070="Imponujące."
MP_Taunt_0071="Dlaczego kontynuujesz ten bój?"
MP_Taunt_0072="Nie można zatrzymać Aeonów."
MP_Taunt_0073="Kiedy UEF polegnie, Cybranie będą następni."
MP_Taunt_0074="Jesteś odrażający."
MP_Taunt_0075="UEF nigdy nie użyje tej broni."
MP_Taunt_0076="Sam wytępię Cybran."
MP_Taunt_0077="Awatar Wojny domaga się, by Ziemia została oczyszczona."
MP_Taunt_0078="Ziemia jest nasza"
MP_Taunt_0079="Wkrótce zostaniecie wyplenieni."
MP_Taunt_0080="Nareszcie koniec jest w zasięgu ręki. "
MP_Taunt_0081="Nikt nie może nas powstrzymać!"
MP_Taunt_0082="Ziemia spłonie."
MP_Taunt_0083="Wkrótce Black Sun będzie nasze."
MP_Taunt_0084="Wszyscy Cybranie będą wolni w przeciągu godzin."
MP_Taunt_0085="UEF już nigdy nie odbierze nikomu wolności."
MP_Taunt_0086="Teraz to tylko kwesta czasu."
MP_Taunt_0087="Gdy będziemy kontrolować Black Sun, nikt już nigdy nie zagrozi Cybranom."
MP_Taunt_0088="Masz śmiałość postawić stopę na Orionis?"
MP_Taunt_0089="Nigdy nas nie powstrzymacie."
MP_Taunt_0090="Nie spocznę, dopóki nie zostaniecie zniszczeni."
MP_Taunt_0091="Cybranie to zaraza, która musi być wyleczona."
MP_Taunt_0092="Prowadzi mnie “Droga”."
MP_Taunt_0093="Twoja obecność urąga temu świętemu miejscu."
MP_Taunt_0094="Nie możesz mnie pokonać!"
MP_Taunt_0095="Twoje dni dobiegają końca."
MP_Taunt_0096="Jesteście niczym więcej, niż tylko szalonymi terrorystami."
MP_Taunt_0097="Czas zapłacić za zbrodnie przeciw ludzkości."
MP_Taunt_0098="Niedobrze mi na widok twój i całego twojego rodzaju."
MP_Taunt_0099="Tego dnia umrzesz."
MP_Taunt_0100="Nie można nas powstrzymać. Przywrócimy Imperium."
MP_Taunt_0101="Myślę, że mnie nie doceniasz."
MP_Taunt_0102="Nie możesz mnie pokonać!"
MP_Taunt_0103="UEF zaprowadzi porządek w galaktyce."
MP_Taunt_0104="Jesteś głupcem, że tu przybyłeś, Cybraninie."
MP_Taunt_0105="Stoi za mną potęga UEF!"
MP_Taunt_0106="Dr Brackman to szalony, stary łajdak. Podążacie za głupcem."
MP_Taunt_0107="To trudniejsze, niż można się było spodziewać."
MP_Taunt_0108="Wkrótce wszyscy wrogowie UEF zostaną zgładzeni."
MP_Taunt_0109="Cybranie, którzy rzeczywiście stają do walki?"
MP_Taunt_0110="Dotąd myślałem, że wszyscy Cybranie to tchórze."
MP_Taunt_0111="Nie zostawisz Pollux przy życiu, Cybraninie."
MP_Taunt_0112="UEF w końcu zakończy Wieczną Wojnę!"
MP_Taunt_0113="Stoi za mną potęga UEF!"
MP_Taunt_0114="Będę bronił tego zakładu za cenę własnego życia!"
MP_Taunt_0115="Black Sun zgładzi ciebie i każdego innego szaleńca."
MP_Taunt_0116="Ta wyspa stanie się twoim grobowcem."
MP_Taunt_0117="UEF zatriumfuje!"
MP_Taunt_0118="Nie ma możliwości złożenia broni! To walka do samego końca."
MP_Taunt_0119="UEF zjednoczy galaktykę... bez względu na cenę."
MP_Taunt_0120="Twoje szaleństwo będzie twoją zgubą."
MP_Taunt_0121="Nigdy nie oddam pokłonu Aeonom!"
MP_Taunt_0122="Nie spocznę, dopóki ostatni Symbiont nie zostanie wyzwolony spod waszego terroru."
MP_Taunt_0123="Ta planeta jest pod moją ochroną. Nigdy jej nie dostaniecie."
MP_Taunt_0124="Moja sztuczna inteligencja zawsze przewiduje wasz następny ruch."
MP_Taunt_0125="Tutejsi cywile są pod moją ochroną."
MP_Taunt_0126="To nie jest walka, w której możesz zwyciężyć."
MP_Taunt_0127="Twoje szczątki uświetnią uliczną paradę."
MP_Taunt_0128="Procyon będzie twoim grobowcem."
MP_Taunt_0129="Nigdy nie skłonimy się przed waszym szaleństwem."
MP_Taunt_0130="Wasz fanatyzm niesie zagładę galaktyce."
MP_Taunt_0131="Dziś umrzesz"
MP_Taunt_0132="Grrrrrr."
MP_Taunt_0133="“Droga” jest niczym więcej, niż bajką."
MP_Taunt_0134="Nie czeka was tu nic, prócz śmierci."
MP_Taunt_0135="Będziemy wolni!"
MP_Taunt_0136="Nigdy nie podbijecie Matar."
MP_Taunt_0137="UEF nigdy nie podda się Aeonom."
MP_Taunt_0138="Jesteś fanatykiem."
MP_Taunt_0139="Koniec się zbliża. Przegracie."
MP_Taunt_0140="UEF ocali od was galaktykę, fanatycy."
MP_Taunt_0141="Przywrócimy porządek w galaktyce."
MP_Taunt_0142="Nie wygracie tej walki."
MP_Taunt_0143="Dodam twoją głowę do swojej kolekcji trofeów."
MP_Taunt_0144="Dziś Wieczna Wojna dobiega końca."
MP_Taunt_0145="Black Sun będzie nasze!"
MP_Taunt_0146="Nigdy już nie skrzywdzicie żadnego Cybranina."
MP_Taunt_0147="Gdy Bramy zostaną zniszczone, Oświeceni będą skończeni."
MP_Taunt_0148="UEF ciemiężyło nas zbyt długo!"
MP_Taunt_0149="Wasza \"Droga\" nie może się równać z technologią Cybran."
MP_Taunt_0150="Nigdy mnie nie pokonasz."
MP_Taunt_0151="Wkrótce wszyscy Symbionci będą wolni."
MP_Taunt_0152="Awatar przyniesie galaktyce pokój."
MP_Taunt_0153="UEF jest bliskie porażki. Przyłączcie się do nas, a pokonamy ich wspólnie!"
MP_Taunt_0154="Księżniczka jest łagodna i słaba. Nie wie nic o prowadzeniu wojny."
MP_Taunt_0155="Zabicie innego Aeona napawa mnie goryczą, ale zrobię to, jeśli będę musiał."
MP_Taunt_0156="Awatar obiecał wspaniałe nagrody dla tych, którzy pójdą za nim."
MP_Taunt_0157="Awatar jest przyczyną, dla której armia UEF działa."
MP_Taunt_0158="Tylko Awatar Marxon może nas uchronić przed furią Black Sun."
MP_Taunt_0159="Powinieneś walczyć wraz ze mną, nie przeciwko mnie!"
MP_Taunt_0160="UEF jest nie do zatrzymania!"
MP_Taunt_0161="Nie pozwolę ci zgładzić tej planety."
MP_Taunt_0162="Armia Aeonów składa się z morderców i szaleńców."
MP_Taunt_0163="A więc to jest Oświecony. Jestem nieco zawiedziony."
MP_Taunt_0164="Myślę, że mnie nie doceniasz."
MP_Taunt_0165="Nigdy się wam nie poddam."
MP_Taunt_0166="UEF przywróci ład w galaktyce."
MP_Taunt_0167="Zapamiętaj moje słowa, Black Sun wystrzeli!"
MP_Taunt_0168="Wasz fanatyzm was nie ochroni."
MP_Taunt_0169="Aeonowie się podzielili. Jesteście słabi."
MP_Taunt_0170="Będę bronił Black Sun kosztem własnego życia."
MP_Taunt_0171="W tym dniu, Aeonowie będą zniszczeni."
MP_Taunt_0172="UEF zatriumfuje!"
MP_Taunt_0173="Kapitulacja jest waszym jedynym wyjściem."
MP_Taunt_0174="Ziemia nigdy nie ulegnie takim, jak wy!"
MP_Taunt_0175="Zapłacicie za zabicie pułkownika Arnolda!"
MP_Taunt_0176="UEF nigdy nie zaprzestanie wojny przeciwko Aeonom.."
MP_Taunt_0177="Zemsta będzie moja!"
MP_Taunt_0178="Nigdy nie przestanę cię ścigać, Aeonie!"
MP_Taunt_0179="Dawno temu porzuciłeś człowieczeństwo."
MP_Taunt_0180="Wkrótce Aeonowie zostaną wytępieni."
MP_Taunt_0181="Odpowiecie za swoje zbrodnie"
MP_Taunt_0182="Nie pozwolę ci uciec!"
MP_Taunt_0183="Księżniczka nie może się ze mną równać. Ty też nie."
MP_Taunt_0184="Toth błagała przed śmiercią. Była tchórzem do samego końca."
MP_Taunt_0185="Gdy zdobędę Ziemię, Księżniczka zginie z mojej ręki. Nie umknie mi drugi raz."
MP_Taunt_0186="To twoja ostatnia szansa na przyłączenie się do mnie."
MP_Taunt_0187="“Droga” jest bronią. I niczym bronią należy nią władać."
MP_Taunt_0188="Będę władał galaktyką."
MP_Taunt_0189="Serafin oznaczał dla nas przywództwo nad ludzkością."
MP_Taunt_0190="Z potęgą Black Sun podbiję galaktykę!"
