SCMP_001_Description="Wstępne skany planety ujawniły równo rozmieszczone wzgórza, co prowadziło do przypuszczeń, iż są to starożytne kopce nagrobne obcych. Kolejne badania podważyły tę teorię, choć wielu nadal wierzy, że dawne Imperium Ziemskie w istocie odnalazło obce pozostałości, usunęło je i sfałszowało skany, aby zatuszować sprawę."
SCMP_002_Description="Nie jest to naturalne jezioro, lecz raczej efekt działania gazów głębinowych, które przybrały ciekły stan przypominający wodę. Większość z gazów jest nieznana i wszystkie trzy frakcje pragną eksploatować ten obszar i odkryć jego tajemnice."
SCMP_003_Description="Dawno zmarły oficer Imperium - Drake - został niegdyś wysłany, by stłumić ruch secesjonistów, lecz na miejscu zastał zorganizowaną armię. Musiał wycofać się na przeciwny skraj wąwozu i dopiero tu był w stanie zgromadzić wystarczające siły, by przeprowadzić kontratak. Drake pokonał secesjonistów, a wąwóz od tego czasu nosi jego imię."
SCMP_004_Description="Zatopiony przez tysiąclecia krater został osuszony przez ruchy tektoniczne, odsłaniając złoża Masy potrzebne do dalszego prowadzenia Wiecznej Wojny. Na przestrzeni lat powstawały rzadkie lasy, chociaż były notorycznie niszczone przez szalejące w Kraterze walki. "
SCMP_005_Description="Będąca niegdyś rajem dla przemytników wyspa została nazwana po \"dżentelmenie\", który niegdyś robił tu interesy. Dziś wyspa gości innych dżentelmenów - Dowódców wszystkich trzech frakcji, którzy rywalizują ze sobą o kontrolę nad planetą."
SCMP_006_Description="Nazwany na cześć wczesnego odkrywcy, Krzyż Iana był świadkiem niezliczonych bitew. Stosunkowo otwarty teren i liczne złoża Masy zaowocowały kilkoma latami nieustających walk."
SCMP_007_Description="Niewielki pas zieleni otoczony przez lód i śnieg... Nikt nie wie, kto po raz pierwszy nazwał to miejsce Swobodnymi Dłońmi. Legenda głosi, że pierwotnie była to neutralna ziemia, którą mogli bez strachu odwiedzać żołnierze wszystkich frakcji. Dlatego wszyscy, którzy tu przebywali mieli \"swobodne dłonie\", co oznacza, że nikt nie nosił broni."
SCMP_008_Description="Przez lata trzy lodowce były eksploatowane przez Aeonów, którzy nadali im nazwę. Jednak wraz z kolejnymi bitwami Aeonowie zostali wyparci i lodowce będą należeć do tego, kto zdoła utrzymać nad nimi kontrolę."
SCMP_009_Description="Na przestrzeni lat stoczono dziesiątki bitew na Pazurze Setona. Cierpliwy poszukiwacz znalazłby szczątki tysięcy jednostek spoczywających pod ziemią i falami."
SCMP_010_Description="Niegdyś potężny przywódca Sung nazywał tę wyspę domem. Wybrał ją ze względu na niebywałe piękno i obfitość zasobów naturalnych. Sung tęsknił po tym, jak został wypędzony, teraz jednak zasoby czekają na tego, kto zdoła je zagarnąć."
SCMP_011_Description="Niegdyś był to mały kontynent, na którym UEF zbudowało bazę badawczą zajmującą się testami zaawansowanej broni. Gdy naukowcy stracili panowanie nad eksperymentalną bronią, eksplozja podzieliła kontynent, rozrywając go na kilka wysp. Teraz wszystkie trzy frakcje próbują dla własnych celów odnaleźć resztki tej broni."
SCMP_012_Description="W początkach osadnictwa wędrowcy, aby dotrzeć do cywilizacji, przechodzili przez łuk i zmierzali na północ. Dziś Przejście jest znacznie bardziej niebezpieczne z powodu nieustannych walk przetaczających się po pustyni."
SCMP_013_Description="Niekiedy dwaj dowódcy potrzebują ustronnego miejsca, by rozstrzygnąć własne porachunki. \"Zimowy pojedynek\" jest wariantem wybieranym, gdy bitwa staje się sprawą osobistą."
SCMP_014_Description="Stare marynarskie opowieści mówią o Trójkącie Bermudzkim, gdzie statki znikają bez śladu. O Medalionie Bermudzkim krąży ta sama fama, z wyjątkiem tego, że to dowódcy nigdy stamtąd nie wracają."
SCMP_015_Description="Nie ma wielu powodów, by odwiedzać Pola - wody niemal brak, a roślinność jest bardzo uboga. Jednak bogate złożą Masy sprawiają, że obszar ten jest naturalnym miejscem starć dowódców."
SCMP_016_Description="Pieska Rzeka jest znana z dwóch przyczyn. Po pierwsze jest ona źródłem naturalnych złóż, w szczególności złota. Drugim powodem jest fakt, iż jest ona idealnym miejscem dla pojedynków \"jeden na jednego\"."
SCMP_017_Description="Miejsce to jest pod każdym względem przeciętne. Jednakże znajduje się tam hub Bram, który umożliwia łatwy dostęp do znacznej części galaktyki. Z tego tylko powodu wielu dowódców walczyło do śmierci, aby tylko utrzymać to miejsce."
SCMP_018_Description="Kiedy region był zasiedlany, na wzgórzu wzniesiono wieże, aby móc obserwować okolicę. Zostało ono określone mianem Punktu Posterunkowego, a nazwa ta przetrwała ludzi, którzy ją nadali."
SCMP_019_Description="Wiele lat temu dowódca zwany Finn został zwyciężony i zmuszony do ucieczki. Później zwabił on swojego przeciwnika na małą wyspę i pokonał go. Od tego czasu wyspa nosi jego imię."
SCMP_020_Description="Nienaturalny, zatopiony obszar wśród zwykłych wód oceanu - wielu uważa, że Głębia została w nieznanym celu stworzona przez obcych. Plotka o obcej technologii - choć podważana przez badania naukowe - wystarczy, by wszystkie trzy frakcje zażarcie walczyły o panowanie nad tym obszarem."
SCMP_021_Description="Planeta Alfa 7, przez dawne Imperium Ziemskie określana jako \"niebezpieczna\", przez setki lat objęta była kwarantanną. Dopiero od niedawna frakcje zainteresowały się przyczyną takiego stanu rzeczy. Obcy, jakis rodzaj zarazy, a może wirus? Nikt tego nie wie,  ale stronnictwa zamierzają walczyć, aby poznać prawdę."
SCMP_022_Description="Będący jedynym przyjaznym miejscem na skutej lodem planecie, Azyl, nie wyróżnia się niczym szczególnym. Z wyjątkiem tego, że byłby doskonałym punktem wypadowym dla dalszych operacji, gdyby tylko zbudować tu Bramę."
SCMP_023_Description="Często walka o świat sprowadza się do jednej tylko bitwy. Wszystkie manewry, strategie i przygotowania prowadzą do jednej, ostatecznej potyczki. Zwycięstwo pod wąwozem Varga oznacza zwycięstwo na całej planecie."
SCMP_024_Description="Nikt nie wie, w jaki sposób został nadany kształt temu szczególnemu masywowi. Powstało wiele teorii, ale odpowiedź na to pytanie prawdopodobnie nigdy nie będzie znana."
SCMP_025_Description="Będąc jedynym skrawkiem lądu pośród bezkresu morza, Kolonia doświadczyła wojny bardziej, niż powinna. Choć już opustoszała, dowódcy wciąż rywalizują o panowanie nad Kolonią Saltrock."
SCMP_026_Description="Vya-3 była niegdyś enklawą wolną od wojny. Obłoki wdzierającego się wszędzie czerwonego pyłu i spalone płytki zatrzymywały pojazdy opancerzone nawet najpotężniejszych armii. Nowa technologia pozwala jednak jednostkom działać w tym nieprzyjaznym środowisku - walka powróciła na czerwone równiny."
SCMP_027_Description="Otoczona lawą Skaza jest czymś więcej, niż tylko stertą kamieni, których jeszcze nie strawił ogień. Pomimo niebezpiecznego otoczenia, dowódcy nie ustają w walkach, gdyż znajdujące się tu złoża mineralne są bardzo bogate."
SCMP_028_Description="Oaza niegdyś była miejscem słynącym z ekskluzywnych ośrodków wypoczynkowych i drogich uzdrowisk. Bawili się tu ważni i bogaci. Jachty żeglowały po wodzie, a prezydenta można było zobaczyć w towarzystwie finansjery. W końcu Aeonowie odnaleźli Oazę i zniszczyli ośrodki, wznosząc na ich miejscu świątynie. Teraz, wiele lat później, Wieczna Wojna znowu nawiedza Oazę."
SCMP_029_Description="Tajne."
SCMP_030_Description="Niegdyś było to miejsce testów jednostek marynarki UEF, jednak wiele lat temu planetę najechali Aeonowie. Teraz jest to obszar, o który ścierają się ściągający zewsząd dowódcy."
SCMP_031_Description="Cybranie myśleli, że mieli szczęście znaleźć tak czysty i bogaty w zasoby teren pod nowe osadnictwo. Aeonowie pojawili się jednak szybko, a zaraz potem przybyło UEF. Teraz kolonia będzie potrzebowała szczęścia, żeby wyjść cało z zawieruchy Wiecznej Wojny."
SCMP_032_Description="W innych czasach Puszcza mogłaby być rezerwatem naturalnym. Dzięki ciekom wodnym i gęstym lasom rozkwitło tu życie każdego rodzaju. Niestety, Puszcza została nieszczęśliwie wybrana na centrum Bram. W lasach rozbrzmiewają teraz wystrzały, a rzeki są tamowane przez kadłuby zniszczonych statków."
SCMP_033_Description="Biały Ogień był tajną bazą morską Aeonów. Aeonowie wybudowali setki statków, którymi zaatakowali niczego się niespodziewających przeciwników. Niemal przejęli planetę, jednak UEF zebrało siły, odparło atak i ostatecznie baza Biały Ogień została zniszczona. Teraz, wiele lat później, wojna wróciła w to miejsce i wszyscy są zdeterminowani, by zdobyć bazę dla siebie."
SCMP_034_Description="Rewolwerowcy odeszli, ale dowódcy szukający rozstrzygnięcia wiedzą, że znajdą je w Samo Południe."
SCMP_035_Description="Pierwsi odkrywcy, którzy zobaczyli to miejsce, myśleli, że znaleźli raj. Ciepła woda, chłodne bryzy i milami ciągnące się plaże były radosną odmianą od surowej galaktyki. Wieść o tym rozniosła się i wkrótce każdy chciał mieć mały kawałek Raju."
SCMP_036_Description="Kolonia górnicza w Przeklętej Skale szukała bogactw pod piaskami. Wieść o bogatych złożach mineralnych rozeszła się jednak szybko i wkrótce kolonia musiała walczyć o przetrwanie."
SCMP_037_Description="Gęsta, słona woda przylega i plami wszystko, z czym się zetknie. Jeśli nie znajdowałaby się w bliskości Strefy kwarantanny, nikt nie chciałby tu przybywać."
SCMP_038_Description="Niegdyś w tej okolicy grasowali bandyci, czatując przy wiodącej pomiędzy wzgórzami drodze. I choć nie ma ich już od dawna, to wąwóz wciąż jest ulubionym miejscem potyczek."
SCMP_039_Description="Niegdyś był to poligon marynarki UEF, używany do niszczenia testowych celów za pomocą najróżniejszych okrętów. Zakłady zostały dawno porzucone, jednak bogactwo w postaci wraków jednostek przyciąga tu dowódców każdej frakcji."
SCMP_040_Description="Pozbawiony jakiejkolwiek atmosfery, flory i fauny Rów jest ostatnim miejscem, które ktokolwiek chciałby odwiedzać. Warto jednak o nie walczyć, gdyż złoża minerałów są niespotykanie bogate."
