TRACKING_0000="Śledzenie"
TU01_TUB200_001_020="Przyciski myszy interfejsu dowodzenia wykorzystywane są do wybierania twoich jednostek i wydawania im rozkazów. Lewy przycisk używany jest do zaznaczenia jednej lub więcej jednostek. PPM wydaje wybranym jednostkom rozkazy, zmuszając je do działania."
TU01_TUB200_001_030="Aby wybrać jednostkę lub budynek, skieruj na nią kursor w twoim HUD i kliknij LPM. Aby zaznaczyć grupę jednostek, naciśnij i przytrzymaj LPM i narysuj kwadrat wokół żądanych jednostek; następnie HUD poda ilość i rodzaj jednostek zaznaczonych w ten sposób. Aby wybrać wszystkie jednostki danego typu znajdujące się w oknie głównego widoku gry, kliknij podwójnie jedną z jednostek. Zauważ, że podwójne kliknięcie na jednostkę zaznaczy wszystkie jednostki tego typu na scenie działań."
TU01_TUB200_001_040="Po wybraniu jednostek lub fabryk, kliknij PPM, by przydzielić im zadania. Rozkazy, które możesz wydawać zależą od typu jednostek i sytuacji. Najprostszym rozkazem jest ruch. Wybierz jednostkę, a następnie kliknij PPM w miejscu docelowym dla tej jednostki."
TU01_TUB200_001_050="Rozkazy, które wydajesz zależą od rodzaju jednostki oraz sytuacji. Jeżeli zaznaczysz jednostkę i wydasz rozkaz, klikając PPM na sojuszniczej jednostce, rozkazem domyślnym będzie komenda \"Wsparcie\". Domyślnym rozkazem wobec wrogiej jednostki będzie zaś \"Atak\"."
TU01_TUB200_001_055="Inżynierowie posiadają różne zdolności. Ich domyślne działanie (kliknięcie PPM) różni się od tego, jakie zauważymy u innych jednostek. Symbol kursora odzwierciedla akcję, która zostanie podjęta przez jednostkę po naciśnięciu PPM oraz pokazuje zasięg dowodzenia twojego HUD."
TU01_TUB200_001_060="Wszystkie możliwe działania, które twoje jednostki mogą podjąć, są również dostępne w interfejsie dowodzenia. Kliknij LPM, następnie kliknij LPM wybraną komendę, a na koniec kliknij znów LPM na celu komendy w zasięgu widoku HUD."
TU01_TUB200_001_070="Pamiętaj lekcję z Akademii: LPM oznacza wybór, PPM - działanie!"
TU01_TUB425_010_045="Na przykład, rozkazanie jednostce obrony powietrznej asystę twojej OJD dostarczy ci niezbędnej obrony przed samolotami. Pamiętaj, że klawisz \"Shift\" działa w połączeniu ze wszystkimi rozkazami, tworząc listę rozkazów. Jeżeli więc chcesz, by podczas ruchu jednostka naziemna unikała wrogiej obrony, przytrzymaj \"Shift\", wydając wiele dokładniejszych komend ruchu."
TU01_TUB450_010_035="Możesz dodać jednostki do listy klikając LPM na ikonę jednostki na liście budowania. W ten sam sposób możesz usuwać jednostki z listy budowania klikając PPM na ikonie jednostki czekającej w kolejce. Możesz również zaprzestać budowy wszystkich jednostek z listy za pomocą komendy \"Stop\"."
TU01_TUB450_010_055="Dzięki ikonom wyboru, otrzymasz dostęp do poszczególnych poziomów technologii. Ikony te znajdują się po lewej stronie interfejsu opcji budowy. Lista budowli może zawierać dowolne struktury wszystkich poziomów technologii. Inżynier T3 ma również dostęp do specjalnych budowli, których wykaz znajduje się tuż pod ikoną Tech 3."
TU01_TUB500_010_055="Po prawej stronie głównego widoku HUD, znajdują się ikony lokalizujące twojego Dowódcę, dostępnych Inżynierów oraz istotne jednostki. Kliknięcie PPM na ikonie spowoduje znalezienie jednostki, wyśrodkowanie na niej ekranu, umożliwiając tym samym nawigowanie nią."
TU01_TUB600_010_040="Poziom Tech 2 pozwala na uzyskanie potężnej siły ognia. Mobilna wyrzutnia rakiet oraz Ciężki czołg są bardzo skuteczne na zasięg przeciwko jednostkom lądowym oraz budynkom. Czołg amfibijny może poruszać się zarówno po wodzie, jak i lądzie, by zaatakować przeciwnika tam, gdzie najmniej się tego spodziewa."
TU01_TUB600_010_045="Mobilna artyleria przeciwlotnicza jest kluczem do obrony bazy przed zaawansowanymi jednostkami powietrznymi. Będzie również skutecznym wsparciem i osłoną twoich wojsk ekspedycyjnych. Natomiast, Mobilny generator tarczy ochronnej jest unikalną jednostką obrony, chroniącą bazę oraz siły uderzeniowe."
TU01_TUB600_010_050="Wraz z uzyskaniem poziomu Tech 3 pojawiają się dwa nowe i niezwykle potężne typy jednostek: Oblężniczy bot oraz Mobilna artyleria. Są to najpotężniejsze dostępne jednostki konwencjonalne. Oblężniczy bot porusza się z dużą szybkością i jest w stanie, podczas ruchu, prowadzić morderczy ostrzał rakietowy jakiejkolwiek jednostki naziemnej czy budynku. To prawdziwy pogromca jednostek dowodzenia. Artyleria, choć nie tak mobilna, może zaatakować wroga na daleki zasięg, zadając mu miażdżący cios. "
TU01_TUB800_010_020="Stocznia marynarki produkuje jednostki oparte na poziomie Tech 1, 2 oraz 3, posiadające dokładnie tak, jak jednostki lądowe i powietrzne, szeroki zakres możliwości. Stocznia marynarki poziomu Tech 1 może budować Fregaty oraz Łodzie podwodne. Fregata to szybka i wszechstronna jednostka marynarki posiadająca uzbrojenie, umożliwiające jej walkę z wrogimi okrętami, lądowymi jednostkami na wybrzeżu oraz myśliwcami."
TU01_TUB800_010_025="Idealną wręcz obroną okrętów flagowych bazy marynarki oraz morskich podejść bazy lądowej jest łódź podwodny. Łódź podwodny poziomu Tech 1 może polować na wszystkie cele nawodne oraz budowle podwodne."
TU01_TUB800_010_030="Wraz z poziomem Tech 2, Stocznia marynarki otrzymuje plany nowych, potężniejszych dodatków do floty. Niszczyciel posiada potężną siłę ognia przeciw okrętom oraz jednostkom i budynkom na wybrzeżu, jak również ma możliwości zwalczania okrętów podwodnych. Krążownik posiada natomiast haubicę o dużej sile rażenia przeciw statkom i atakowania wybrzeża oraz odpalane z morza pociski średniego zasięgu. "
TU01_TUB800_010_040="Poziom Tech 3 udostępnia jednostki, z którymi twój przeciwnik będzie miał ciężki orzech do zgryzienia. Zanurzeniowy okręt liniowy, to prawdziwa, pływająca wyspa śmierci. Ma haubice dalekiego zasięgu, wiele stanowisk przeciwlotniczych oraz wyrzutnie torped umieszczone na bokach. Łódź podwodna z rakietami strategicznymi pozwala wystrzelić z morza głowice nuklearne na jakikolwiek cel sceny działań zbrojnych."
TU02_TUE200_001_020="Bardzo ważne jest wspomaganie jednostki dowodzenia Inżynierami. Aby zwiększyć wydajność produkcji jednostek bojowych, musisz wykorzystać odpowiednią ilość Inżynierów i fabryk - im więcej, tym lepiej. Najprostszą formą wspomagania jest pomoc jednego Inżyniera drugiemu. Ten Inżynier posiada parę budynków na liście budowy. Można to sprawdzić wybierając go i przytrzymując \"Shift\"."
TU02_TUE200_001_025="Wydając rozkaz wspomagania Inżynierom, przyspieszysz ukończenie budowy struktur z listy. Im więcej Inżynierów pomaga, tym szybciej konstrukcja jest ukończona. Naciskając i przytrzymując \"Shift\", możesz zobaczyć, którzy Inżynierowie wspierają pierwszego Inżyniera. Przypisywanie dużej liczby Inżynierów do jednej listy budowli jest znakomitym ruchem strategicznym."
TU02_TUE200_001_030="W ten sposób, mamy fabrykę, posiadającą długą listę budowy potrzebnych jednostek bojowych. Wydając rozkaz wspomagania, te jednostki zostaną ukończone w znacznie krótszym czasie. Jeżeli więc komenda wspomagania wydana będzie wielu pobliskim Inżynierom, prędkość produkcji może zwiększyć się wielokrotnie. OJD posiada największy współczynnik zdolności wspomagania budowy."
TU02_TUE200_001_040="Jednostka, która właśnie się ulepsza, taka jak Ekstraktor masy T1, może być również wspomagana przez Inżynierów oraz OJD. Wszystkie rozkazy wydawane Inżynierom, są również dostępne twojej OJD."
TU02_TUE200_001_060="Im bardziej zaawansowany technologicznie jest twój Inżynier, tym większe ma możliwości budowania i wspomagania. (Inżynier T3 oferuje lepsze wspomaganie, niż ten T1.) Wraz ze wzrostem ekonomii, nie będzie dziwił więc fakt, że Inżynierowie T2 oraz T3 będą wspomagani przez większe grupy, by sprawniej wznosić struktury energetyczne i wydobywające masę."
TU02_TUE200_001_070="Pamiętaj, że Inżynierowie budujący oraz wspomagający zużywają nieustannie energię oraz masę. Jeżeli twoje zasoby będą na poziome czerwonym, możesz zatrzymać Inżynierów, by spowolnić proces utraty zasobów."
TU04_TUC100_010_020="Podstawą twojej machiny wojennej jest energia i masa. Bez odpowiedniego wzrostu zapasów obu tych surowców, twoje możliwości walki zbrojnej z wrogiem będą znacznie ograniczone. Energię możesz otrzymać wznosząc Generatory mocy. Możesz ją również uzyskać poprzez zbieranie naturalnych zasobów planety, wykorzystując Inżynierów oraz OJD."
TU04_TUC100_010_025="Zbieranie naturalnych zasobów energii może okazać się bardzo ważne w pierwszych fazach kampanii. Zbuduj Generatory mocy w bezpośrednim sąsiedztwie fabryk i innych ważnych budynków, aby zwiększyć tym samym ich szybkość produkcji. Wykorzystuj to, kiedy tylko możesz. "
TU04_TUC100_010_030="Możesz wydobywać masę z rdzenia planety, wydobywając ją w określonych punktach ekstrakcyjnych, podświetlonych w twoim HUD. OJD oraz Inżynierowie mogą również zbierać zasoby masy na powierzchni planety. W końcu, możesz również zbudować Kreatory masy T1 oraz T3. Pamiętaj jednak, że Kreatory masy, by funkcjonować, wymagają energii."
TU04_TUC100_010_040="Po wkroczeniu na nowy teren walk zbrojnych, dobrym pomysłem jest zbudowanie dwóch, do trzech Ekstraktorów masy dzięki OJD oraz tyle samo Generatorów mocy T1, zanim rozpoczniesz jakąkolwiek budowę fabryk."
TU04_TUC100_010_045="Kiedy tylko twoja fabryka będzie gotowa, zbuduj Inżynierów. Przynajmniej część z nich powinna być przydzielona do wspomagania pozyskiwania masy oraz energii dzięki budowie Generatorów mocy, Ekstraktorów i Kreatorów masy. We wczesnych etapach budowy bazy oraz sił zbrojnych, dobrym rozwiązaniem jest patrolowanie obszarów, w poszukiwaniu naturalnych złóż, przy użyciu Inżynierów. Może to w znacznym stopniu poprawić stan twojej gospodarki."
TU04_TUC100_010_050="Jednostki przechowujące energię i masę zwiększają możliwości twojej ekonomii i redukują straty związane z nadwyżką produkcji. Wznoszenie budynków magazynujących, przy nadwyżkach surowców, pomoże ci wówczas, gdy będziesz produkował mniej energii niż jej zużywasz. Tak długo, jak posiadasz zmagazynowaną energię oraz masę, twoje fabryki będą działały z pełną prędkością."
TU04_TUC115_010_020="Zbadajmy wskaźniki gospodarki i ogólne informacje odnoszące się do mapy w twoim HUD. W lewym i prawym rogu HUD znajdują się główne wskaźniki gospodarcze. Produkcja oraz konsumpcja masy znajduje się w lewym górnym rogu. Produkcja i zużycie energii znajduje się w prawym górnym rogu. Oba surowce posiadają podobne funkcje wyświetlania. Rozpoczniemy od wskaźników masy w lewym górnym rogu. "
TU04_TUC115_010_030="Znacznymi elementami wskaźników masy są: pasek posiadanej masy oraz wskaźnik masy zużywanej do produkcji. Kolor oraz stan tych wskaźników pokazuje Ci natychmiast wszystkie najważniejsze informacje. Jeżeli pasek posiadanej masy jest pełen, zbiorniki masy są pełne. Ilości składowanej w zbiornikach masy znajdują się poniżej paska pojemności. Jeżeli wskaźnik jest koloru zielonego, znaczy to, że produkujesz więcej masy, niż jej zużywasz."
TU04_TUC115_010_035="Optymalnym wskaźnikiem produkcji jest kolor zielony: pełne zbiorniki masy oraz wskaźnik produkcji. Przeciwieństwem jest kolor czerwony: niewystarczająca produkcja i brak masy w zbiornikach. Kolor żółty oznacza stan pośredni. W zależności od twoich ustawień HUD, kiedy osiągniesz stan krytyczny, pojawi się ostrzeżenie. "
TU04_TUC115_010_040="Mała liczba, wewnątrz wskaźnika produkcji daje więcej szczegółowych informacji: jak dużo produkujesz i ile zużywasz. Możesz kliknąć we wskaźnik produkcji i przestawić go z liczb całkowitych na tryb procentowy. Z drugiej strony twojego HUD, interfejs produkcji energii działa w ten sam sposób."
TU04_TUC115_010_045="Pośrodku twojego HUD znajduje się jeden wskaźnik procentowy, mówiący Ci o ogólnej wydajności twojej gospodarki, w porównaniu do jej maksymalnych możliwości: 100% oznacza, że budujesz jednostki tak szybko, jak to możliwe. Dbaj o to, by wskaźnik pokazywał więcej niż 50%, tak blisko 100%, jak to tylko możliwe."
TU04_TUC115_010_050="Na koniec przyjrzyjmy się podłożu gospodarki. Możesz uruchomić wykaz gospodarczy UI, dzięki przyciskom kontrolnym znajdującym się niedaleko minimapy. Kiedy wykaz gospodarczy jest aktywny, pokaże wszystkie produkowane jednostki oraz struktury i ich zużycie energii oraz masy. Zauważ, że OJD produkuje zarówno masę, jak i energię, podczas bezczynności; jednakże, kiedy buduje, drastycznie wzrasta zużycie obu surowców. Naucz się pojmowania zasad gospodarki dzięki interfejsowi użytkownika HUD."
TU04_TUC200_010_020="Istnieje wiele etapów, w których Dowódca może być wykorzystywany na polu bitwy. Najczęściej są to szybkie, decydujące starcia z wrogiem, które niekoniecznie wymagają dużych zasobów energii oraz masy. W zbliżającym się starciu, stopniowo rozbudowuj swoją gospodarkę."
TU04_TUC200_010_025="Technologie budowlane T1 oraz wczesne rozbudowywanie zaplecza gospodarczego zostały omówione. Podczas dalszego rozwoju gałęzi technologicznych T2, dobrze jest wspomóc pozyskiwanie surowców Generatorami mocy T2 oraz ulepszeniem Ekstraktorów do T2 lub nawet T3. Pamiętaj, by nie ulepszać wszystkich Ekstraktorów masy jednocześnie. Dobrym rozwiązaniem jest również wspomaganie ulepszeń Ekstraktorów masy Inżynierami."
TU04_TUC200_010_030="Posiadając technologię T1, dobrym pomysłem jest przydzielenie grupom Inżynierów nieustannego wznoszenia nowych Generatorów mocy oraz Kratorów masy. Jeśli zbudujesz dostatecznie dużą ilość Kreatorów, pamiętaj, że możesz zawsze zatrzymać ich działalność, by twoja produkcja energii nie została zachwiana."
TU04_TUC200_010_035="Podwójne kliknięcie na Kreator masy podczas strategicznego przybliżenia jest szybkim sposobem na zatrzymanie wszystkich Kreatorów masy. Dobrą techniką budowania zasobów energetycznych jest rozkazanie jednemu Inżynierowi budowania, zaś kilku pozostałym wspomagania go."
TU04_TUC200_010_050="Solidna gospodarka polega na nieustannym ulepszaniu produkcji masy oraz energii. Mając technologię T2, spokojnie ulepszaj Ekstraktory masy. Kreatory masy mogą być wykorzystane do wyrównania poziomu produkcji energii i masy."
TU04_TUC250_010_020="Ważne jest, by uniknąć stagnacji gospodarczej we wszystkich stadiach konfliktu, ale najbardziej w tych kluczowych. Wczesny zastój gospodarczy spowodowany jest najczęściej problemem zbyt małej produkcji masy oraz energii, podczas rozpoczęcia prac nad fabrykami oraz innymi konstrukcjami militarnymi."
TU04_TUC250_010_025="Kolejnym częstym problemem jest zbyt duża ilość Inżynierów budujących jedną konstrukcję przed uzyskaniem odpowiedniej infrastruktury energetycznej. Należy unikać równoczesnego ulepszania kilku Ekstraktorów masy."
TU04_TUC250_010_030="O zastojach gospodarczych dowiadujesz się, kiedy interfejs masy lub energii HUD pokazuje kolor czerwony, lub kiedy otrzymujesz ostrzeżenie, i/lub kiedy paski pojemności są małe, albo, co gorsza, równe zeru. Kolejnym ostrzeżeniem jest, spadająca poniżej 50%, ogólna wydajność budowy. Istnieje parę sposobów na przywrócenie sprawności gospodarczej. Jeżeli budujesz zbyt wiele konstrukcji równocześnie, wstrzymaj część Inżynierów."
TU04_TUC250_010_035="Ten przykład pokazuje, że mamy zbyt duże zużycie surowców podczas budowy, dlatego zatrzymamy część Inżynierów, a część zajmującą się projektem fabryki, przeniesiemy do budowy projektów energetycznych oraz ulepszeń Ekstraktorów masy. Ten natomiast przykład pokazuje, jak zabić gospodarkę, ulepszając równocześnie trzy Ekstraktory masy. Zatrzymamy więc ulepszanie dwóch z nich."
TU04_TUC250_010_040="W tym przypadku, produkcja naszej masy jest w porządku, ale poziom naszej energii jest krytyczny - to najwyższy czas, by zatrzymać działające Kreatory masy. Będzie można wznowić działalność Kreatorów, kiedy tylko poziom zasobów energetycznych wróci do normy."
TU04_TUC250_010_045="Kolejną strategią jest zatrzymywanie fabryk. Mamy tu potężną maszynę wojenną sześciu fabryk, opartych na technologii T1, ale fabryki wykazują nadprodukcję, zatem zatrzymamy część z nich, by skupić się na rozbudowie infrastruktury pozyskującej surowce. Pamiętaj, by wznowić działanie fabryk i produkcje jednostek, kiedy twoja gospodarka będzie znów w pełni sprawna."
TU05_TUA100_010_020="Twoja Fabryka lotnicza T1 może produkować lekkie transportery, zdolne do transportu Inżynierów, jednostek bojowych, a nawet OJD w dowolne miejsce sceny działań zbrojnych. Transporter T1 posiada sześć zestawów haków transportowych, które mogą załadować do 6 jednostek, w zależności od ich masy i rozmiaru. Choć transporter T1 jest lekko opancerzony i nie posiada broni pokładowej, jednostki bojowe, będą mogły prowadzić ogień z boków transportera, czyniąc go potężnym śmigłowcem bojowym."
TU05_TUA100_010_030="Transportery budowane są w twojej Fabryce lotniczej. Istnieje kilka sposobów na załadowanie transportu. Możesz wybrać pojedynczą jednostkę lub ich grupę, a następnie kliknąć przycisk załadowania na twoim HUD; kiedy kursor zamieni się w znak \"załadowania\", kliknij PPM, by wydać rozkaz."
TU05_TUA100_010_035="Jeżeli jednostki znajdują się w pobliżu transportera, ruszą na pozycje i wejdą na rampy transportowe. Jeżeli transporter jest poza zasięgiem, przemieści się on na pozycje, z których twoje jednostki będą mogły wejść na jego pokład. Jeżeli posiadasz więcej jednostek, niż mogłoby zmieścić się w pojedynczym transporterze, a posiadasz więcej niż jeden taki transporter, zaznacz jednostki do załadunku, a następnie kliknij \"Shift\" wraz z komendą załadunku. Wszystkie jednostki zostaną załadowane na pokłady."
TU05_TUA100_010_040="Aby rozładować transporter, wybierz go, a następnie, wykorzystując menu rozkazów dla jednostek, kliknij LPM na ikonę komendy rozładunku. Wykorzystaj klawisz \"Shift\", aby określić wiele wytycznych trasy ruchu i ostatecznego rozładunku. Funkcja ta pozwoli ominąć obronę wroga i przemieścić twoje transportery na miejsce rozładunku. Jeżeli wykorzystujesz transportery jako śmigłowce bojowe, po prostu wyślij je do boju, wykorzystując komendę ruchu albo patrolu. Patrolowanie obrzeży bazy wroga załadowanym transporterem spowoduje spore zniszczenia."
TU05_TUA200_010_020="Posiadając transportery, możesz wyznaczyć dwa punkty nieustannej trasy ruchu. Pozwoli to na bezustanny ruch transporterów pomiędzy tymi punktami. Aby ustalić punkty załadunku i rozładunku, zaznacz komendę przewozu w menu komend jednostki, a następnie zaznacz punkty docelowe."
TU05_TUA200_010_025="Transporter automatycznie ustawi marker przewozowy. Jeżeli transporter był już załadowany jednostkami, rozpocznie swój pierwszy lot, jeżeli nie, poczeka, aż zostaną do niego załadowane jednostki w miejscu markera przewozu i dopiero wtedy rozpocznie pierwszy lot."
TU05_TUA200_010_030="Aby jednostki zostały przewiezione, należy pamiętać, że muszą być one załadowane w miejscu położenia markera przewozowego, a nie załadowane do transportera, jako takiego. Komenda załadunku zastąpi poprzednią komendę ustalenia trasy przewozu. Transporter będzie kontynuował ich przenoszenie, do wszystkich punktów docelowych."
TU05_TUA200_010_050="Możesz automatycznie załadowywać na marker przewozowy jednostki wychodzące z fabryki. Aby to uczynić, po prostu wybierz fabrykę, a następnie kliknij PPM w miejscu markera, kiedy pojawi się na nim symbol załadunku. Możesz w ten sposób z łatwością wysyłać pełne transporty jednostek, podążających bezpośrednio na linie frontu."
TU05_TUA400_010_020="Na poziomach 2 i 3 możesz budować Generatory tarczy ochronnej, by chronić swoją bazę, OJD lub jakiekolwiek inne pozycje jednostek, które chcesz ufortyfikować. Różnicą pomiędzy generatorami T2 i T3 jest ich zasięg ochronny, siła obrony oraz szybkość zużywania zasobów energii. Generator tarczy ochronnej osłoni jednostki w promieniu swojego działania przed ogniem Z ZEWNĄTRZ. Nie daje on żadnej ochrony, gdy wrogie siły naziemne wejdą w promień jego działania."
TU05_TUA400_010_025="Z tego powodu, skuteczną strategią obrony bazy jest rozmieszczenie na jej terenie kilku nakładających się tarcz ochronnych. Jeżeli wróg przejdzie przez pierwszą barierę, kluczowe jednostki nadal pozostaną chronione. Ten przykład pokazuje OJD chronioną przez trzy nakładające się tarcze ochronne."
TU05_TUA400_010_030="Tarcze zużywają dużo energii. Kiedy rozpoczynasz budowę tarcz, musisz upewnić się, że posiadasz znaczy przyrost energetyczny. Jeżeli twoje wskaźniki są poniżej 100% lub pokazują niedostateczny poziom, twoje tarcze będą mniej efektywne, co jakiś czas wyłączając swoje pole ochronne."
TU05_TUA400_010_035="W tym przypadku, wykorzystaj zatrzymanie Generatorów mocy, by wyłączyć mniej znaczące pola, na rzecz tych, które są najważniejsze. Najlepiej zbudować Generatory mocy w stosunku 1:1 z Generatorami tarcz. Na każdą tarczę T2 potrzebujesz dwa generatory, zaś na każdą tarczę T3 aż trzy generatory. Musisz pamiętać również o tym, że tarcze nie chronią Cię przed atakami nuklearnymi. "
TU05_TUA500_010_020="Twoimi podstawowymi jednostkami szpiegowskimi są Lądowi i Powietrzni zwiadowcy, którzy posiadają zwiększony limit zasięgu widzenia oraz szybkości. Nieustanne zwiady tymi jednostkami są podstawowymi narzędziami w zbieraniu informacji o wrogu."
TU05_TUA500_010_025="Technologia T1 pozwala twoim Inżynierom rozstawianie stacjonarnych radarów na lądzie oraz stacji nasłuchowych na morzu, które pomagają w lokalizacji wrogich jednostek. Wielu Dowódców rozmieszcza radary na terenie całej sceny działań zbrojnych; wieże radarowe T1 nie są dużym wydatkiem. W bitwach morskich stacja echolokacyjna jest nieocenioną pomocą w namierzaniu i zwalczaniu wrogich okrętów podwodnych."
TU05_TUA500_010_030="Technologia T2 umożliwia rozmieszczenie radarów dalekiego zasięgu: działają one podobnie do radarów T1, jednak oferują znacznie dalszy zasięg. Wart wspomnienia jest fakt, że radary T1 i T2 mogą zostać oszukane lub zagłuszone przez antyradarowe jednostki stealth. Posiadając poziom technologiczny T2 możesz rozpocząć budowę stacji stealth, które będą zagłuszać lub odbijać sygnał wrogich radarów. "
TU05_TUA500_010_035="Wieże Stealth obejmują ochroną określony obszar i zużywają energię. Jeżeli chcesz oprzeć się na tajnych bazach, musisz polegać na technologii stealth oraz na złożonej sieci wywiadowczej. Zauważ, że stacje zagłuszające stealth mogą być niwelowane przez system radaru omni, który będzie omówiony później."
