Unit_Description_0004="Na tyle OJD Zamontowana zostaje Taktyczna wyrzutnia rakiet. Może ona zbudować i przechowywać dwie rakiety. Systemy antyrakietowe mogą je jednak zestrzelić."
Unit_Description_0005="To ulepszenie zainstalują dowódcy, którzy chcą zwiększyć możliwości budowlane swoich OJD. Zwiększy ono szybkość budowy."
Unit_Description_0006="Wyposażenie to znacznie zwiększa prędkość, z jaką OJD naprawia samą siebie. Jest to dobry wybór dla dowódców, którzy wykorzystują OJD do działań ofensywnych."
Unit_Description_0007="Zastępuje Zaawansowany zestaw inżynieryjny i rozszerza liczbę dostępnych dla dowódcy schematów. Zwiększa również prędkość budowy OJD"
Unit_Description_0008="Ulepszenie Miotacza Anty-materii, Ciężki miotacz anty-materii, kilkakrotnie zwiększa zniszczenia zadawane przez OJD."
Unit_Description_0009="Taktyczny pocisk atomowy krótkiego zasięgu ma mniejszy zasięg i pole rażenia niż pełnowymiarowy odpowiednik. Rakiety te mogą być zestrzelone przez Systemy obrony pociskami strategicznymi."
Unit_Description_0010="Osobisty teleport pozwala dowódcy niemal w jednej chwili teleportować się na odległość kilku mil. Osobisty teleporter wymaga znacznej ilości Energii do aktywacji."
Unit_Description_0011="Ulepszenie Osobistej tarczy, Pole generatora tarczy rozszerza obszar działania tarczy OJD pozwalając dowódcy chronić inne jednostki."
Unit_Description_0012="System alokacji zasobów wprowadza efektywne algorytmy, które zwiększają szybkość, z jaką OJD generuje zasoby."
Unit_Description_0013="Osobista tarcza tworzy osłonę wokół OJD. Osłona ta zaniknie po przyjęciu określonej liczby obrażeń i będzie musiała się naładować przed ponowną aktywacją."
Unit_Description_0014="Sonda inżynieryjna działa jak inżynier, wspomagając OJD we wszystkich budowach i naprawach."
Unit_Description_0015="Dodaje drugą Sondę inżynieryjną dla twojej OJD. Druga Sonda inżynieryjna może być zbudowana tylko, jeśli zainstalowana jest już pierwsza.."
Unit_Description_0016="Jednostka ta może nieustannie odbudowywać lub naprawiać inną jednostkę lub strukturę. Zastępcza OJD jest sprowadzana przez Bramę kwantową."
Unit_Description_0017="Sonda inżynieryjna działa jak inżynier, wspomagając OJD we wszystkich budowach i naprawach."
Unit_Description_0018="Aktywowana Osobista tarcza tworzy osłonę wokół OJD. Podobnie jak inne tarcze UEF Osobista tarcza zaniknie po przyjęciu określonej liczby obrażeń i będzie musiała się naładować przed ponowną aktywacją"
Unit_Description_0019="Ulepszenie Osobistej tarczy, Pole generatora tarczy rozszerza obszar chroniony przez tarczę OJD, pozwalając dowódcy ochraniać inne jednostki."
Unit_Description_0020="System Zakłócacza radarów sprawia, że OJD staje się niewykrywalna dla radarów. Zakłócacz radarów nie działa przeciwko czujnikom optycznym lub klasy Omni."
Unit_Description_0021="System alokacji zasobów wprowadza efektywne algorytmy, które zwiększają szybkość, z jaką OJD generuje zasoby."
Unit_Description_0022="To ulepszenie znacznie rozszerza zasięg standardowego, pokładowego systemu czujników OJD. To popularny wybór dla dowódców, którzy często działają poza główną bazą."
Unit_Description_0023="Wykorzystujące wzmocniony system wlotu powietrza, Zaawansowane ulepszenie chłodzenia, potrafi schłodzić każdą zamontowaną na OJD broń znacznie szybciej, niż zwykły system chłodzenia. Zwiększa to siłę ognia."
Unit_Description_0024="System materiałów wybuchowych wyposaża standardowe Ciężkie działo plazmowe OJD w efekt obszarowy."
Unit_Description_0025="Zwiadowca UEF jest szybkim, lekko opancerzonym pojazdem zwiadowczym wyposażonym w karabin maszynowy i niezrównany zestaw czujników."
Unit_Description_0026="Podstawowym zadaniem Mechanicznego marine jest wsparcie ogniem bezpośrednim. Ta lekko opancerzona jednostka naziemna odznacza się znakomitą szybkością i zwrotnością kosztem siły ognia i wytrzymałości."
Unit_Description_0027="Lobo jest wszechstronną, mobilną jednostką artyleryjską. Duży zasięg, wysoki łuk balistyczny i obszar rażenia czynią go idealnym do osłabiania mobilnych sił wroga. Jest jednak wrażliwy na ataki jednostek, które zdołają nawiązać walkę w krótkim dystansie."
Unit_Description_0028="Niewiarygodna szybkostrzelność oraz dobre możliwości śledzenia celu czynią ze Strzelca znakomity system obronny przeciwko wszystkim, prócz najszybszym celom powietrznym."
Unit_Description_0029="Podstawa ziemskich sił - Striker - łączy zogniskowaną siłę ognia i opancerzenie w solidną skorupę. Ostatnie modyfikacje projektu Strikera zaowocowały wyposażeniem go w standardowe Działo Gaussa."
Unit_Description_0030="Najcięższy czołg sił Ziemi - Filar - jest wyposażany w Podwójne działo Gaussa strzelające potężnymi ładunkami. Ciężko opancerzony Filar stał się wizytówką armii UEF. "
Unit_Description_0031="Chociaż czołg amfibijny UEF zadaje niewielkie szkody, to szybkostrzelność może poradzić sobie z nawet najgrubszym kadłubem. Poduszka powietrzna, w którą wyposażony jest czołg, pozwala gładko sunąć po nawet najgłębszych wodach."
Unit_Description_0032="Wyposażony w Taktyczne wyrzutnie rakiet Flapjack ma niemal dwukrotnie większy zasięg i siłę ognia niż Lobo. Posiada również cięższy pancerz i system stabilizujący, który pozwala mu strzelać bez przerywania ruchu."
Unit_Description_0033="Podniebny bokser jest doskonałym towarzyszem mobilnych jednostek opancerzonych i często jest wykorzystywany jako tymczasowy system obrony bazy, gdy Dowódca nie jest w stanie zbudować cięższego Działa przeciwlotniczego."
Unit_Description_0034="Niby-tarcza wykorzystuje najnowszą generację Pulsacyjnych generatorów tarcz. Zamontowana na podwoziu Niby-tarcza jest niezwykle użyteczna do ochrony poruszających się jednostek."
Unit_Description_0035="Nie licząc jednostek eksperymentalnych, Tytan jest największą i najsilniejszą jednostką w arsenale UEF. Jest wyposażony w dwa Ciężkie działa plazmowe, które zapewniają mu niezrównaną siłę ognia."
Unit_Description_0036="Ulubiona mobilna jednostka artyleryjska wielu dowódców - Burzyciel - strzela Pociskami anty-materii z zamontowanego dla tego celu Artyleryjskiego działa dalekiego zasięgu. Burzyciel nie może jednocześnie strzelać i pozostawać w ruchu."
Unit_Description_0037="Choć opancerzeniem i siłą ognia Spaślak odpowiada standardowemu Pancernikowi UEF, potrafi on przedostać się na zagrożone terytorium i nie tylko obronić się, ale również stworzyć \"w locie\" całą armię."
Unit_Description_0038="Standardowy latający zwiadowca sił UEF - Koliber - dysponuje zaawansowanym zestawem optycznym, który zapewnia mu znakomite pole widzenia, kosztem jednak uzbrojenia i opancerzenia."
Unit_Description_0039="Standardowy Myśliwiec przechwytujący UEF - Cyklon - jest szybkim, zwrotnym samolotem uzbrojonym w połączone Działa elektrodynamiczne."
Unit_Description_0040="Podstawa sił powietrznych UEF - Podpalacz - jest skutecznym bombowcem obszarowym, który jest użyteczny przeciwko wszystkim celom: mobilnym i stacjonarnym."
Unit_Description_0041="Podstawowy transporter UEF - Kurier - może zabrać na pokład do 6 jednostek i przenieść je w inne miejsce pola bitwy. Kurier jest jednak bardzo wrażliwy na ogień przeciwlotniczy i ataki Myśliwców przechwytujących."
Unit_Description_0042="Stinger jest uzbrojony w pojedynczy Riot Gun, który strzela z olbrzymią częstotliwością. Kleszcze transportowe pozwalają mu zabrać jeden lekki pojazd lub robota i przenieść go na pole bitwy."
Unit_Description_0043="Dwuogonowy samolot – Bocian - unosi ładunek torped Angler, które są znakomite przeciwko wszystkim jednostkom morskim."
Unit_Description_0044="Oparty na starożytnym projekcie Blackbird wyposażony jest w najnowocześniejszą elektronikę i aktywny system radarowy. Chociaż jest dość szybki, Blackbird nie posiada żadnego uzbrojenia i jest wrażliwy na ataki Myśliwców przechwytujących."
Unit_Description_0045="C14 jest ciężkozbrojnym transporterem żołnierzy. Gwiezdna winda może również przenosić czołgi, pojazdy i wszystkie inne jednostki kompatybilne z jego systemem szczęk transportowych."
Unit_Description_0046="Osa, następne stadium ewolucji technologii myśliwców UEF, uzbrojona jest w dwa systemy Szybkostrzelnego promienia pulsacyjnego. Promienie te został tak zaprojektowane, aby zadawać maksymalne zniszczenia lekko opancerzonym samolotom nieprzyjaciela."
Unit_Description_0047="Ambasador wyposażony jest w bombę atomową małej mocy oraz Działo elektrodynamiczne używane przeciwko jednostkom powietrznym."
Unit_Description_0048="Pałasz, ulepszenie Stingera, zawiera dwie Taktyczne wyrzutnie rakiet, strzelające pociskami przeciwpancernymi oraz przeciwlotnicze Działo elektrodynamiczne. To niezrównana platforma do walki naziemnej."
Unit_Description_0049="Fregata UEF została zaprojektowana tak, by służyć flocie zarówno wsparciem ogniowym, jaki i możliwościami oferowanymi przez radar i sonar. Thunderhead wyposażony jest również w pokładowy zakłócacz radarów."
Unit_Description_0050="Łódź podwodna Tygrysi rekin jest szybką, potężną jednostką do walki z innymi jednostkami morskimi. Wyposażona jest w dwa luki torpedowe i Działo plazmowe używane w stanie wynurzenia."
Unit_Description_0051="Gubernator to przede wszystkim platforma przeciwlotnicza. Zawiera system przeciwrakietowy, system rakietowy SAM, Podwójne działo Gaussa i Taktyczną wyrzutnię rakiet."
Unit_Description_0052="Valiant oferuje kombinację ognia bezpośredniego i uzbrojenie zwalczające łodzie podwodne. Jest wyposażony w luk torped Angler i wyrzutnię Smart Depth Charge, która może niszczyć wrogie torpedy."
Unit_Description_0053="Summit to potężny bombardier wybrzeży i narzędzie do zwalczania innych okrętów. Zawiera trzy Ciężkie trzylufowe działa Gaussa, cztery Działa elektromagnetyczne i dwa Przeciwrakietowe działa Phalanx."
Unit_Description_0054="As jest podwodną platformą rakietową. Jego podstawową bronią jest matryca Taktycznych rakiet dalekiego zasięgu. As może być wyposażony w pociski z głowicami atomowymi."
Unit_Description_0055="Dzięki możliwości zanurzenia Atlantyda może bezpiecznie transportować flotę powietrzną na wielkie dystanse. Może również spełniać zadanie Platformy lotniskowej."
Unit_Description_0056="Opis głównodowodzącego UEF"
Unit_Description_0057="Działo plazmowe DM-1 to podstawowa, naziemna struktura obronna większości kolonii i baz. Koszty budowy i eksploatacji są w pełni rekompensowane przez skuteczność tej wieżyczki w boju."
Unit_Description_0058="Podstawową obroną przeciwlotniczą UEF jest tania i skuteczna wieżyczka przeciwlotnicza. Jednostka ta może być zbudowana zarówno na lądzie, jak i na wodzie. Gdy wieżyczka wybudowana jest na wodzie, unosi się na platformie stabilizacyjnej."
Unit_Description_0059="DN-1, podstawowa przeciwmorska jednostka używana do obrony nabrzeży i zakładów, miota standardowymi torpedami Angler UEF, które są używane przez niemal wszystkie przeciwmorskie jednostki UEF. DN-1 może być zbudowane jedynie na wodzie."
Unit_Description_0060="Zbudowane z wapienia, nowoczesnej betonowej mieszaniny, segmenty murów jednocześnie ograniczają ruch wrogich jednostek i zapewniają pewną ochronę przed ogniem bezpośrednim."
Unit_Description_0061="Triada jest bardzo istotną jednostką defensywną o dużym potencjale. Dobry zasięgi i szybkostrzelność są zasługą trzech Ciężkich dział Gaussa. Dzięki temu Triada potrafi podziurawić każdą wrogą jednostkę, która znajdzie się w jej zasięgu."
Unit_Description_0062="Artyleryjskie działo przeciwlotnicze Wymiatacz jest potężniejsze nawet od Przeciwlotniczego działa elektromagnetycznego. To sztandarowa jednostka wśród sił przeciwlotniczych UEF. Filtr powietrza unosi się na pływającej platformie, jeśli jest zbudowany na wodzie."
Unit_Description_0063="Buzzkill posiada sześć wirujących luf, które wystrzeliwują 12000 pocisków na minutę. To oraz wyrafinowany system śledzenia celu sprawia, że Buzzkill niszczy rakiety ze zdumiewającą szybkością i celnością."
Unit_Description_0064="Miotające wiązkami czterech torped Angler Tsunami jest topową jednostką morskiej obrony UEF, używaną w najistotniejszych morskich i przybrzeżnych instalacjach. Tsunami może być wybudowane jedynie na wodzie."
Unit_Description_0065="Puls wykorzystuje ostatnie osiągnięcie militarnej technologii UEF- Generator tarczy pulsacyjnej. Generator ten może być ulepszony do poziomu Tech 3, który obejmuje ochroną większą połać terenu."
Unit_Description_0066="System SAM Łupieżcy jest niezrównanie skuteczny przeciwko lotnictwu nieprzyjaciela. Wyrzutnia SAM unosi się na pływającej platformie, jeśli jest zbudowana na wodzie."
Unit_Description_0067="Eliminator został opracowany w celu niszczenia nadlatujących rakiet strategicznych zanim te dosięgną celu. Aby Eliminator budował rakiety obronne, należy mu to zlecić."
Unit_Description_0068="HSD, ulepszenie Generatora tarczy do poziomu T3, wytwarza większą i potężniejszą osłonę, jednak za cenę zwiększonego kosztu działania."
Unit_Description_0069="Stała konstrukcja pozwala temu gniazdu artylerii osiągnąć większy zasięg w porównaniu do jej mobilnych odpowiedników. Jest znacznie skuteczniejsza przeciwko powolnym lub nieruchomym celom."
Unit_Description_0070="Aloha odpala Rakiety dalekiego zasięgu z zabójczą precyzją. Każda rakieta jest tworzona przez wyrzutnię, trzeba jej zatem uprzednio zlecić budowę pocisków."
Unit_Description_0071="Platforma lotniskowa (PL) poprzez tankowanie i naprawy jednostek zwiększa zasięg skuteczności lotnictwa."
Unit_Description_0072="Książę, największa standardowa jednostka artyleryjska w arsenale UEF, strzela tymi samymi pociskami anty-materii, co Burzyciel. Oferuje jednak znacznie większy zasięg."
Unit_Description_0073="Neandertal może zbudować i przechowywać do 5 rakiet atomowych w specjalnej, wzmocnionej komorze magazynowej. Konstrukcja pocisków musi być zlecona jednostce."
Unit_Description_0074="Brama kwantowa Tech 3 sprowadza na pole bitwy Dowódcę wsparcia."
Unit_Description_0075="Mavor, najbardziej zaawansowana broń strategiczna UEF, zapewnia dewastującą i chirurgicznie dokładną siłę ognia zdolną razić z olbrzymich odległości. Mavor daje artyleryjskie wsparcie na każdym terenie, bez względu na odległość od celu."
Unit_Description_0076="Inżynier jest jednostką wielozadaniową, zdolną do budowania, naprawiania i zbierania. Posiada cechy amfibijne i może sunąć po powierzchni wody, aby budować morskie zakłady."
Unit_Description_0077="Jest to ulepszona wersja Inżyniera T1, zdolna budować bardziej złożone struktury. Jest tworzona w Fabryce T2."
Unit_Description_0078="Jest to ulepszona wersja Inżyniera T2, zdolna budować najbardziej złożone struktury. Jest to jedyny Inżynier, który może konstruować jednostki Eksperymentalne. Inżynier T3 jest tworzony w Fabryce T3."
Unit_Description_0079="Fabryka jednostek naziemnych tworzy pierwsze mobilne jednostki konieczne do toczenia wojny. Fabryka jest przystosowana do produkcji tylko naziemnych jednostek. Fabryka może być ulepszona do poziomu T2 i wspierać inne fabryki."
Unit_Description_0080="Fabryka lotnicza tworzy pierwsze jednostki powietrzne konieczne do toczenia wojny. Fabryka jest przystosowana do produkcji tylko jednostek powietrznych. Fabryka może być ulepszona do poziomu T2 i wspierać inne fabryki."
Unit_Description_0081="Stocznia marynarki tworzy pierwsze jednostki wodne konieczne do toczenia wojny. Fabryka jest przystosowana do produkcji tylko jednostek wodnych. Fabryka może być ulepszona do poziomu T2 i wspierać inne fabryki."
Unit_Description_0082="Jest to ulepszenie Fabryki jednostek naziemnych T1. Fabryka ta może być ulepszona do poziomu T3, co daje jej dostęp do  zaawansowanych planów jednostek. Może ona również wspierać inne fabryki."
Unit_Description_0083="Jest to ulepszenie Fabryki lotniczej T1. Fabryka ta może być ulepszona do poziomu T3, co daje jej dostęp do  zaawansowanych planów jednostek. Może ona również wspierać inne fabryki."
Unit_Description_0084="Jest to ulepszenie Stoczni marynarki T1. Stocznia ta może być ulepszona do poziomu T3, co daje jej dostęp do  zaawansowanych planów jednostek. Może ona również wspierać inne stocznie."
Unit_Description_0085="Jest to ulepszenie Fabryki jednostek naziemnych T2. Fabryka ta nie może być dalej ulepszana. Może ona wspierać inne fabryki."
Unit_Description_0086="Jest to ulepszenie Fabryki lotniczej T2. Fabryka ta nie może być dalej ulepszana. Może ona wspierać inne fabryki."
Unit_Description_0087="Jest to ulepszenie Stoczni marynarki T2. Stocznia ta nie może być dalej ulepszana. Może ona wspierać inne stocznie."
Unit_Description_0088="Generator mocy jest tanim, solidnym i stabilnym źródłem Energii. Może on być podłączony do innych struktur, nieco redukując ich koszty działania."
Unit_Description_0089="Zawierające węglowodór naturalne złoża są dziś żywotnym źródłem Energii. EW - X1000 jest znacznie wydajniejszy, niż standardowy Generator mocy."
Unit_Description_0090="Akumulator energii zwiększa maksymalny limit Energii ekonomii dowódcy. Buduj je obok Generatorów, aby uzyskać premię."
Unit_Description_0091="Masa jest cennym surowcem w czasach Wiecznej Wojny i jest pozyskiwana za pomocą Ekstraktorów. Ekstraktor masy może być ulepszony do bardziej wydajnej wersji – Pompy masy."
Unit_Description_0092="Kreator masy jest pomysłowym systemem do zamieniania czystej Energii w gotową do użycia Masę. Koszty energii są bardzo duże, zatem użycie Kreatora ma sens tylko wtedy, gdy Masy jest bardzo mało lub nie ma jej wcale."
Unit_Description_0093="Zbiornik masy zwiększa maksymalny limit Masy ekonomii dowódcy. Buduj je obok Ekstraktorów i Kreatorów, aby uzyskać premię."
Unit_Description_0094="Koszt budowy Reaktora fuzyjnego, ulepszonej wersji Generatora mocy, jest wysoki. Wydajność działania struktur wybudowanych obok Reaktora fuzyjnego zostaje zwiększona."
Unit_Description_0095="Pompa masy może być utworzona z Ekstraktora masy lub wybudowana przez Inżyniera T2. Wersja ta jest bardziej kosztowna w utrzymaniu, jednak wydobycie Masy jest znacznie szybsze."
Unit_Description_0096="Łańcuch reaktorów fuzyjnych jest najlepszą dostępną formą zaopatrywania linii frontu w Energię. Wydajność działania struktur wybudowanych obok Łańcucha Reaktorów fuzyjnych zostaje zwiększona."
Unit_Description_0097="Pompa masy 3 może być utworzona z Pompy masy 2 lub wybudowana przez Inżyniera T3. Wersja ta jest bardziej kosztowna w utrzymaniu, jednak wydobycie Masy jest znacznie szybsze."
Unit_Description_0098="Zakład produkcji masy wytwarza znaczne jej ilości przy wygórowanym koszcie Energii. Taki zakład będzie mógł działać tylko w infrastrukturze o olbrzymich zapasach Energii."
Unit_Description_0099="Standardowa instalacja radarowa UEF jest dobrym sposobem monitorowania obszaru pod kątem obecności wroga. Lekka jej wersja posiada ograniczony zasięg i cienki pancerz, ale może być ulepszona."
Unit_Description_0100="Instalacja hydroakustyczna UEF jest bardzo podobna do radarowego odpowiednika. Służy i sprawdza się jako tani mechanizm detekcji o krótkim zasięgu. Pakiet sensorów SP1 może zostać ulepszony."
Unit_Description_0101="SA2 jest odpowiednikiem lekkiej stacji radarowej o dalekim zasięgu. Instalacja radarowa T2 może być ulepszona do Omnisensora T3."
Unit_Description_0102="SP2 jest odpowiednikiem lekkiej stacji hydroakustycznej, o dalekim zasięgu. Ta Instalacja hydroakustyczna Tech 2 może być stworzona z wersji Tech 1 i ulepszona do wariantu mobilnego."
Unit_Description_0103="Generator pola Stealth pokrywa swoim antyradarowym polem znaczny obszar. Pole to ukrywa przed radarem obecność wszystkich jednostek, ale nie chroni ich przed zasięgiem wzroku wroga."
Unit_Description_0104="SP3 jest mobilnym odpowiednikiem stacji hydroakustycznej dalekiego zasięgu. Oprócz doskonałego zasięgu fal hydroakustycznych i mobilności, SP3 wyposażony jest w zamontowaną na spodzie wieżyczkę torpedową."
Unit_Description_0105="Łańcuch omnisensorowy jest najdoskonalszym systemem zbierania informacji. Poza bardzo dużym zasięgiem, jego zaletą jest również to, że przełamuje pola Stealth i inne technologie kamuflujące."
Unit_Description_0106="System alokacji zasobów wprowadza efektywne algorytmy, które zwiększają szybkość, z jaką OJD generuje zasoby."
Unit_Description_0107="Osobisty generator kamuflażu pozwala OJD stać się niewidzialną dla Sensorów optycznych. Podobnie jak inne pola kamuflujące nie działa przeciwko radarom i jest przełamywane przez Omnisensory."
Unit_Description_0108="Ulepszenie Osobistego generatora kamuflażu, Osobisty generator pola Stealth, dodaje do istniejącego Generatora funkcje tworzenia pola Stealth. Sprawia ono, że OJD staje się niewidoczna dla wszystkich systemów z wyjątkiem Omnisensorów."
Unit_Description_0109="Osobisty teleporter kwantowy pozwala Dowódcy niemal w jednej chwili teleportować się na odległość kilku mil. Teleporter wymaga znacznej ilości Energii do aktywacji."
Unit_Description_0110="To ulepszenie zainstalują Dowódcy, którzy chcą zwiększyć możliwości budowlane swoich OJD. Zwiększy ono szybkość budowy."
Unit_Description_0111="Zastępuje Zaawansowany zestaw inżynieryjny i rozszerza liczbę dostępnych dla Dowódcy schematów. Zwiększa również prędkość budowy OJD"
Unit_Description_0112="Wykorzystujący ciekły azot Zaawansowane ulepszenie chłodzenia potrafi schłodzić każdą zamontowaną na OJD broń znacznie szybciej, niż zwykły system chłodzenia. Zwiększa to siłę ognia większości broni."
Unit_Description_0113="Generator lasera mikrofalowego pozwala OJD wygenerować wiązkę lasera, która razi wrogie jednostki."
Unit_Description_0114="Zamontowanie w OJD standardowego cybrańskiego luku torped nanotechnologicznych umożliwia Dowódcy skuteczniejszą walkę z wrogimi jednostkami morskimi."
Unit_Description_0115="Jednostka ta może nieustannie odbudowywać lub naprawiać inną jednostkę lub strukturę. Zastępcza OJD jest ścigany przez Bramę kwantową."
Unit_Description_0116="Popularnym wyborem wśród cybrańskich dowódców jest Osobisty generator kamuflażu, który pozwala ich OJD stać się niewidzialnymi dla Sensorów optycznych. Podobnie jak inne pola kamuflujące, nie działa przeciwko radarom i jest przełamywany przez Omnisensory."
Unit_Description_0117="Ładunek EMP skutecznie \"zamraża\" na kilka sekund okoliczne wrogie jednostki, zmuszając je do zresetowania komputerów pokładowych."
Unit_Description_0118="Konwerter ogniska przepuszcza wiązkę standardowego Pulsacyjnego lasera dezintegrującego przez ciąg specjalnych soczewek, co znacznie zwiększa spójność promienia i niemal podwaja jego moc."
Unit_Description_0119="System nanotechnologicznych pocisków wyposaża OJD w standardowe, cybrańskie Rakiety SAM Nanotechnologiczne. Nadaje to OJD znacznych możliwości przeciwlotniczych."
Unit_Description_0120="System alokacji zasobów wprowadza efektywne algorytmy, które zwiększają szybkość, z jaką OJD generuje zasoby."
Unit_Description_0121="Zestaw inżynieryjny zainstalują dowódcy, którzy chcą zwiększyć możliwości budowlane swoich OJD. Pozwoli on twojej OJD na szybsze wznoszenie większej ilości struktur."
Unit_Description_0122="Wyposażenie to znacznie zwiększa prędkość, z jaką OJD naprawia samą siebie. Jest to dobry wybór dla dowódców, którzy wykorzystują OJD do działań ofensywnych."
Unit_Description_0123="Ulepszenie Osobistego generatora kamuflażu, Osobisty generator pola Stealth, dodaje do istniejącego Generatora funkcje tworzenia pola Stealth. Sprawia ono, że OJD staje się niewidoczna dla wszystkich systemów z wyjątkiem Omnisensorów."
Unit_Description_0124="Szpieg nie nosi broni, by móc używać pola kamuflującego, co czyni go niewidocznym dla radarów, choć może zostać wykryty przez Omnisensory bądź dostrzeżony przez wrogą jednostkę."
Unit_Description_0125="Łowca to bot przeznaczony do szybkiego szturmu, zaprojektowany, by działać w grupie. Posiada raczej lekkie uzbrojenie i zadaje niewielkie obrażenia, ale relatywnie niski koszt produkcji powoduje, że szybko można stworzyć dużą liczbę tych jednostek i wystawić je do boju jako oddział wsparcia lub lżejszą grupę uderzeniową."
Unit_Description_0126="Z Ciężkim automatycznym działkiem laserowym zainstalowanym na każdym z ramion, Modliszka jest w stanie razić potężnym ogniem. Dodatkowo posiada też doczepiany Zestaw inżynieryjny, który może naprawiać uszkodzoną jednostkę."
Unit_Description_0127="Meduza wystrzeliwuje granaty z impulsem elektromagnetycznym, które są w stanie unieruchomić lżejsze jednostki i poważnie uszkodzić te cięższe."
Unit_Description_0128="Ciskacz to jednostka, która stosuje nowy System nano-strzelecki, wystrzeliwując maleńkie strzałki napędzane rakietowo. Lecą one z wielką prędkością i posiadają zdolność samonaprowadzania. Nano-strzałki mogą atakować cele naziemne."
Unit_Description_0129="Nosorożec to ulubiona jednostka wielu dowódców cybrańskich. Posiada ona Działo dwucząsteczkowe, które swą potężną siłą uderzeniową stawia ją w pierwszej linii ataku."
Unit_Description_0130="Gdy porusza się w wynurzeniu, Wagner do walki wykorzystuje ciężką wyrzutnię pocisków elektronowych. W zanurzeniu wyrzutnia pocisków zmienia się w wyrzutnię torped."
Unit_Description_0131="Żmija to ulepszona Meduza, która zamiast Granatów z impulsem elektromagnetycznym, wykorzystuje System pocisków Loa. Nadto Żmija ma lepsze opancerzenie i wygodniej się nią steruje."
Unit_Description_0132="Siewca Burz to jednostka, która na określonym, niedużym terenie wystrzeliwuje pociski tworzące burzę elektromagnetyczną. Powoduje ona uszkodzenie systemów elektronicznych wroga, równocześnie niszcząc jednostkę."
Unit_Description_0133="Gdy Mobilny system Stealth jest włączony, sygnał radaru zostaje zakłócony. W efekcie jednostki podłączone do Zakłócacza są niewidzialne dla radarów wroga. System ten jednak nie wpływa na sensory optyczne."
Unit_Description_0134="Lojalista to najcięższa, cybrańska konwencjonalna broń bezpośredniego ostrzału. Główne uzbrojenie tej jednostki to Pulsacyjny laser dezintegrujący, natomiast do walki z lżejszymi siłami wykorzystuje Ciężką wyrzutnię pocisków elektronowych."
Unit_Description_0135="Trebusz to jedno z największych dział w arsenale cybrańskim. Ażeby jednak móc z niej wystrzelić, działo musi stać nieruchomo."
Unit_Description_0136="Władca Małp to lądowy pojazd o wielkiej sile ognia. Potrzebuje ogromnych ilości energii, żeby móc korzystać z Ciężkiego generatora lasera mikrofalowego, który niszczy wszelkie jednostki znajdujące się na jego drodze."
Unit_Description_0137="Szybkostrzelne działo Scathis korzysta z systemu rozprowadzania ciepła, który pozwala wystrzeliwać najmocarniejsze pociski dostępne w arsenale frakcji. Jedynym ograniczeniem w kwestii liczby strzałów na minutę jest koszt energii."
Unit_Description_0138="Latający zwiadowca cybrański to starszy projekt jednostki o dość typowej funkcjonalności. Posiada duży promień pola widzenia, szybko się porusza, jest lekko opancerzony i nie posiada żadnej broni."
Unit_Description_0139="Szperacz to super-nowoczesny myśliwiec. Jego Automatyczne działo rezygnuje z siły ognia na poczet szybkostrzelności, dosłownie rozrywając swój cel setkami celnych strzałów."
Unit_Description_0140="Zeus ma większą siłę ognia, atakując bombami, które wybuchają tuż przed dotarciem do celu, przez co zasięg rażenia jest ogromny, a wybuch powoduje dodatkowo skażenie radioaktywne."
Unit_Description_0141="Jest to nieduża jednostka transportowa zaprojektowana, by przewozić niewielkie grupy botów i/lub czołgów. Jest bardzo szybka, ale nie posiada takiej ładowności, opancerzenia oraz uzbrojenia, jak jej cięższy odpowiednik."
Unit_Description_0142="Renegat to szybki helikopter szturmowy, którego głównym zadaniem jest wspieranie jednostek naziemnych. Podwójna wyrzutnia rakiet pozwala atakować cele naziemne."
Unit_Description_0143="Kormoran swoimi torpedami powoduje poważne uszkodzenia struktur i jednostek morskich wroga."
Unit_Description_0144="Zjawa korzysta ze skanera rezonansu dźwiękowego, który wypełnia lukę pomiędzy konwencjonalnym radarem i sonarem. Ponadto Zjawa potrafi latać w trybie Stealth."
Unit_Description_0145="Ważka transportuje niewielkie oddziały botów lub pojazdów. Pojedyncze automatyczne działko pozwala tej jednostce bronić się przed atakami z powietrza, a Działko wysyłające impulsy elektromagnetyczne jest w stanie na krótką chwilę unieruchomić jednostki wroga."
Unit_Description_0146="Bliźniak posiada System nanotechnologicznych pocisków, pozwalający wystrzeliwać serię małych pocisków, które pokrywając pewien teren działań maksymalizują prawdopodobieństwo trafienia w cel. Jednostka ta ma lepsze opancerzenie niż Szperacz, ale nadal uważa się ją za jednostkę lekką."
Unit_Description_0147="Upiór atakuje przy pomocy bomb protonowych, które najpierw dosyć mocno nadwerężają punkt uderzenia, po czym promieniują na zewnątrz. Dodatkowe wyposażenie Upiora to działko plot. zainstalowane z tyłu jednostki oraz tarcza Stealth. "
Unit_Description_0148="Rozpruwacz posiada wielką siłę ognia oraz zdolność do zajmowania przestrzeni powietrznej na pierwszej linii frontu. Ten śmigłowiec bojowy ugina się od uzbrojenia, którego jednym z elementów jest para Wyrzutni ciężkich pocisków irydowych."
Unit_Description_0149="Trójząb to ciężko uzbrojony mobilny radar oraz platforma sonarowa. Uzbrojony w Działko protonowe oraz Działo przeciwlotnicze, potrafi prowadzić ostrzał bezpośredni oraz daje wsparcie przeciwlotnicze."
Unit_Description_0150="Okruch to 4. pokolenie słynnych jednostek, służą one w całej galaktyce. Jest wyposażony w Wyrzutnię torped nanotechnologicznych oraz Ciężki laser zainstalowany na pokładzie okrętu, który wykorzystywany jest podczas operacji w wynurzeniu."
Unit_Description_0151="Krążownik cybrański może spełniać wiele ról, ale jego podstawowym zadaniem jest walka z lotnictwem oraz ostrzał rakietami krótkiego zasięgu. Posiada także zdolność do naprawy samolotów oraz może służyć jako tankowiec."
Unit_Description_0152="Podwójne działo protonowe, zainstalowane na jednostce klasy Salem, to jej główna broń w walce bezpośredniej. Niszczyciel ten korzysta z odnóży, w momencie gdy napotyka suchy ląd - może się zatem przemieszczać po nim, acz robi to powoli."
Unit_Description_0153="Pancerniki klasy Galaktyka to mocarne jednostki po brzegi najeżone uzbrojeniem. Podstawowa funkcja tych okrętów liniowych sprowadza się do bezpośredniego ostrzału oraz bombardowania, do czego używa sześciu Dział protonowych."
Unit_Description_0154="Klasa Komendant do ochrony swych samolotów wykorzystuje pełen zestaw lekkich, automatycznych działek plot., podczas gdy Wieżyczka antyrakietowa Zapper chroni przewożony ładunek przed nadlatującymi rakietami."
Unit_Description_0155="Specjalny, wewnętrzny dok konstrukcyjny pozwala na zbudowanie Planu B i skonstruowanie specjalnych głowic bojowych, których celem jest dziesiątkowanie sił wroga na poziomie strategicznym."
Unit_Description_0156="Dowódcy, którzy chcą zwiększyć zdolność budowania w swoich OJD (Opancerzona Jednostka Dowodzenia), z reguły instalują to ulepszenie. Powoduje ono, że OJD znacznie przyspiesza proces produkcji."
Unit_Description_0157="Chronoszyber tworzy Pole zastoju kwantowego wokół OJD, które w określonym promieniu unieruchamia wszelkie jednostki wroga. Proces ten jednak zabiera mnóstwo energii."
Unit_Description_0158="Wzmocnienie promienia ogniskuje standardowy Promień rozproszenia kwantowego OJD przy użyciu kilku specjalnych soczewek, przez co znacznie wzrasta spójność promienia i prawie dwukrotnie zwiększa się jego maksymalny zasięg."
Unit_Description_0159="To ulepszenie znacznie zwiększa zasięg standardowych, pokładowych systemów sensorowych OJD. Wybierane jest ono przez dowódców, którzy często działają poza obszarem swojej bazy głównej."
Unit_Description_0160="Podmienia zaawansowany zestaw inżynieryjny oraz zwiększa wachlarz planów dostępnych dowódcy. Ponadto znacznie zwiększa prędkość budowania dla OJD."
Unit_Description_0161="Gdy zainstalujesz Wzmocnienie rozprowadzania ciepła, OJD może prawie dwukrotnie szybciej wystrzeliwać Promienie rozproszenia kwantowego."
Unit_Description_0162="System alokacji zasobów zwiększa ilość zasobów, które OJD jest w stanie wygenerować, algorytmy wydajności przyspieszają proces konwersji."
Unit_Description_0163="Ulepszony system alokacji zasobów jeszcze bardziej usprawnia rozprowadzanie zasobów."
Unit_Description_0164="W momencie aktywowania, osobista tarcza tworzy osłonę wokół OJD. Osłona ta przestanie działać w chwili, gdy przyjmie na siebie wystarczająco dużo obrażeń. Przed następną aktywacją należy ją naładować."
Unit_Description_0165="W momencie aktywowania, osobista tarcza tworzy osłonę wokół OJD. Osłona ta przestanie działać w chwili, gdy przyjmie na siebie wystarczająco dużo obrażeń. Przed następną aktywacją należy ją naładować."
Unit_Description_0166="Osobisty teleport pozwala dowódcy przenieść się w mgnieniu oka na przestrzeni kilku kilometrów. Do aktywacji tego teleportu wymaga się dużej ilości energii."
Unit_Description_0167="Jednostka ta może bez przerwy naprawiać i odbudowywać wszelkie jednostki i struktury. ZOJD jest przywoływana poprzez Bramę kwantową."
Unit_Description_0168="Moduł skupienia inżynieryjnego to ulepszenie, które pozwala OJD szybciej budować oraz naprawiać."
Unit_Description_0169="System alokacji zasobów zmniejsza koszty działania OJD."
Unit_Description_0170="ZOJD może zostać poświęcona na rzecz innej struktury, oddając swoją masę tejże strukturze. Wtedy jednak trzeba będzie nową OJD przywołać poprzez Bramę kwantową."
Unit_Description_0171="W momencie aktywowania, osobista tarcza tworzy osłonę wokół OJD. Osłona ta przestanie działać w chwili, gdy przyjmie na siebie wystarczająco dużo obrażeń. Przed następną aktywacją należy ją naładować."
Unit_Description_0172="Jest to ulepszenie dla Osobistej tarczy, tarcza ta zwiększa moc Generatora tarczy."
Unit_Description_0173="Gdy OJD zostaje wyposażona w Inhibitor stabilności, jej Działo reaktonowe \"budzi\" potężnym wstrząsem okoliczny teren, co powoduje zniszczenia we wszystkich jednostkach wroga znajdujących się w promieniu działania."
Unit_Description_0174="Kompensator spójności systemowej to ulepszenie, które zwiększa tempo regenerowania zniszczonego pancerza w OJD."
Unit_Description_0175="Osobisty teleport pozwala Dowódcy wsparcia przenieść się w mgnieniu oka na przestrzeni kilku kilometrów. Do aktywacji tego teleportu wymaga się dużej ilości energii."
Unit_Description_0176="Punkt obronny T1 to standardowa naziemna struktura obronna dla cywilów i drugorzędna placówka militarna, wyposażona w Ciężkie, automatyczne działo laserowe, które daje spore poczucie bezpieczeństwa, nie wyczerpując przesadnie zasobów ekonomicznych miejscowej ludności."
Unit_Description_0177="Smugacz jest wyposażony w standardowe Cybrańskie automatyczne działo przeciwlotnicze, służąc tym samym bardziej za jednostkę obrony przeciwlotniczej niż za siłę zdolną do prowadzenia ognia laserowego. Postawiony na terenie morskim, Smugacz unosi się na pływającej platformie."
Unit_Description_0178="To usprawniona inżynieryjnie Wieża artyleryjska, automatyczne działo zostało tu zastąpione Wyrzutnią torped nanotechnologicznych i sprzętem do pływania. Wystrzeliwuje standardowe Cybrańskie torpedy nanotechnologiczne."
Unit_Description_0179="Tak jak i inne frakcje, Cybranie budują modułowe mury, by chronić swoje struktury przed niepożądaną obecnością oraz bezpośrednim ogniem nieprzyjaciela."
Unit_Description_0180="Cerebus to ulepszona Wieża artyleryjska, wyposażona w trzy pionowo ułożone działa cząsteczkowe."
Unit_Description_0181="Ta mocna wieża posiada takie same uzbrojenie, jak przenośna jednostka plot. Siewca Burz. Broń niszczy elektronikę i może doprowadzić do wyłączenia systemów wroga, niszcząc tym samym zaatakowaną jednostkę."
Unit_Description_0182="Ten system antyrakietowy ma szybką zdolność namierzania, przez co bardzo sprawnie detonuje nadlatujące pociski i rakiety. Postawiony nad wodą, system ten unosi się na pływającej platformie."
Unit_Description_0183="Wyrzutnia ciężkich torped wystrzeliwuje takie same Torpedy nanotechnologiczne, jak wersja T1, ale atakuje całymi, szybkimi seriami torped, aż cel zostaje zniszczony."
Unit_Description_0184="ED1 blokuje nadlatujące pociski oraz ataki energetyczne. Ten generator tarcz obronnych może być czterokrotnie usprawniany, gdzie za każdym razem zwiększa się koszt działania, promień oraz siłę tarczy."
Unit_Description_0185="Myrmidon uderza szybko, częstokroć równocześnie używając wszystkich ośmiu Systemów torped nanotechnologicznych, strzelając tak długo, aż cel zostanie zniszczony."
Unit_Description_0186="Strażnik to jednostka zaprojektowana tak, aby niszczyć nadlatujące pociski strategiczne, zanim trafią w cel. Strażnikowi należy wydać polecenie produkowania pocisków obronnych."
Unit_Description_0187="Gunther ostrzeliwuje unikalnymi Pociskami rezonansu molekularnego. To struktura zbudowana na bardzo silnej stabilnej platformie, która minimalizuje wibracje oraz odrzut, przez co działo to może strzelać szybko i skutecznie."
Unit_Description_0188="Wyrzutnia pocisków taktycznych korzysta z systemu pocisków Loa. W pojedynczej wyrzutni można przechować do pięciu pocisków. Jednostce należy wydać polecenie konstruowania pocisków."
Unit_Description_0189="Lotnisko tranzytowe to platforma napraw oraz tankowania, którą zaprojektowano po to, by zwiększyć skuteczny zasięg samolotów."
Unit_Description_0190="Rozpraszacz, największe działo w arsenale cybrańskim, posiada niesamowity zasięg oraz siłę ognia. Jedyna jednostka u Cybranów, która ma większy zasięg, to Wyrzutnia pocisków strategicznych."
Unit_Description_0191="Wewnętrzny dok konstrukcyjny pozwala tej wyrzutni pocisków budować oraz przechowywać wiele głowic bojowych zaprojektowanych, by dziesiątkować siły na poziomie strategicznym. Jednostce trzeba wydać polecenie, by produkowała pociski."
Unit_Description_0192="Przywoływacz wzywa Dowódcę wsparcia na pole bitwy."
Unit_Description_0193="Inżynier to jednostka spełniająca wiele funkcji: może konstruować, naprawiać, przechwytywać lub konwertować daną jednostkę. Ma zdolności amfibijne, może zatem poruszać się po wodzie, konstruując budynki marynarki wojennej."
Unit_Description_0194="To ulepszona wersja Inżyniera T1, która zdolna jest stawiać bardziej skomplikowane budowle. Buduje się ją w fabryce T2."
Unit_Description_0195="To ulepszona wersja Inżyniera T2, która zdolna jest stawiać najbardziej skomplikowane budowle. Tylko ona może budować jednostki eksperymentalne. Buduje się ją w fabryce T3."
Unit_Description_0196="Fabryka jednostek naziemnych tworzy podstawowe jednostki mobilne (tylko naziemne), które są niezbędne do prowadzenia wojny. Fabrykę można ulepszyć do poziomu T2 i może ona wspomagać inne fabryki."
Unit_Description_0197="Fabryka lotnicza produkuje podstawowe jednostki lotnictwa, potrzebne do prowadzenia działań wojennych. Fabryka produkuje jedynie lotnictwo i można ją ulepszyć do poziomu T2 i może ona wspomagać innye fabryki."
Unit_Description_0198="Stocznia marynarki produkuje podstawowe okręty potrzebne do prowadzenia działań wojennych. Stocznia produkuje jedynie jednostki marynarki i można ją ulepszyć do poziomu T2. Może ona wspomagać inne fabryki."
Unit_Description_0199="To ulepszona fabryka jednostek naziemnych T1. Można ją ulepszyć do poziomu 3, co da jej dostęp do zaawansowanych projektów. Może wspomagać inne fabryki."
Unit_Description_0200="To ulepszona fabryka lotnicza T1. Można ją ulepszyć do poziomu 3., co da jej dostęp do zaawansowanych projektów. Może wspomagać inne fabryki."
Unit_Description_0201="To ulepszona stocznia marynarki T1. Można ją ulepszyć do poziomu 3., co da stoczni dostęp do zaawansowanych projektów. Może wspomagać inne fabryki."
Unit_Description_0202="Ulepszona fabryka jednostek naziemnych T2. To najwyższy stopień technologiczny tego typu struktury. Może wspomagać inne fabryki."
Unit_Description_0203="To ulepszona fabryka lotnicza T2. Jest to najwyższy stopień technologiczny tego typu struktury. Może wspomagać inne fabryki."
Unit_Description_0204="Ulepszona stocznia marynarki T2. To najwyższy stopień technologiczny tego typu struktury. Może wspomagać inne fabryki."
Unit_Description_0205="Generator mocy to tanie, solidne i stabilne źródło energii. Generatory mocy mogą być podłączone do innych struktur, co daje tym drugim niewielką obniżkę kosztów działania."
Unit_Description_0206="Do dziś złoża naturalne zawierające węglowodór stanowią dobre źródło energii. Elektrownia węglowodorowa jest o wiele wydajniejsza niż generator mocy."
Unit_Description_0207="Masa to cenne źródło zasobów podczas Wiecznej Wojny, wydobywa się ją przy pomocy ekstraktorów masy. Ekstraktor masy może zostać ulepszony do bardziej wydajnej wersji - pompy masy."
Unit_Description_0208="Kreator masy to genialny system przetwarzania czystej energii na używalną Masę. Koszt energetyczny jest wielki, więc opłaca się go stosować tylko wtedy, gdy trudno zdobyć masę w inny sposób."
Unit_Description_0209="Zbiornik masy zwiększa maksymalną ilość dostępnej masy w bazie dowódcy. W momencie, gdy zbiornik postawiony jest obok ekstraktorów i kreatorów masy, otrzymujesz premię."
Unit_Description_0210="Akumulator Energii zwiększa maksymalną ilość dostępnej Energii w bazie dowódcy. W momencie, gdy akumulator postawiony jest obok Generatorów masy, otrzymujesz premię."
Unit_Description_0211="Ulepszenie generatora mocy do T2 jest bardzo kosztowne. Postawienie struktur obok generatora mocy T2 zwiększa ich wydajność operacyjną."
Unit_Description_0212="Ekstraktor T2 to ulepszona wersja ekstraktora masy lub budynek postawiony przez inżyniera T2. Utrzymanie tej wersji więcej kosztuje, ale z kolei pozwala ona na szybsze zbieranie masy."
Unit_Description_0213="Reaktor jonowy to najlepsze źródło dostaw energii na pierwszej linii frontu. Postawienie budynków obok Reaktora jonowego zwiększa ich wydajność operacyjną."
Unit_Description_0214="Ekstraktor T3 to ulepszona wersja ekstraktora masy T2 lub budynek postawiony przez inżyniera T3. Utrzymanie tej wersji więcej kosztuje, ale z kolei pozwala ona na szybsze zbieranie masy."
Unit_Description_0215="Budynki kreatora masy produkują wielkie ilości masy przy dużym użyciu energii elektrycznej. Na skuteczne działanie tej struktury mogą sobie pozwolić jedynie takie frakcje, które dysponują znacznymi zasobami energii."
Unit_Description_0216="Podstawowy radar cybrański ma ograniczony zasięg oraz uzbrojenie, ale jego postawienie bardzo mało kosztuje. System ten można ulepszać."
Unit_Description_0217="Noe to cybrańska instalacja sonarowa, bardzo przypominająca radar. Jest to to tani mechanizm wykrywania o krótkim zasięgu, całkiem dobrze sprawdza się w praktyce. System ten można ulepszać."
Unit_Description_0218="System radarowy T2 to odpowiednik Systemu T1, tyle że o większym zasięgu. Może być wynikiem ulepszenia Systemu T1, a następnie dalej ulepszany do poziomu T3, Radaru omnisensorowego."
Unit_Description_0219="System sonarowy T2 to odpowiednik systemu T1, tyle że o większym zasięgu. Może być wynikiem ulepszenia systemu T1, a następnie dalej ulepszany do poziomu systemu mobilnego."
Unit_Description_0220="Gdy pole to jest aktywne, wszelkie jednostki w jego zasięgu znikną z radarów. Zmierzch nie jest jednak w stanie ukryć jednostek z pola widzenia sensorów optycznych."
Unit_Description_0221="Platforma sonarowa T3 to mobilny system hydrolokacyjny o dalekim zasięgu. Zaopatrzona jest w Generator pola Stealth, który w niedużym promieniu pozwala zakłócić sygnały sonarowe."
Unit_Description_0222="Łańcuch omnisensorowy to narzędzie wywiadowcze najwyższego rzędu. Ma bardzo duży zasięg, a ponadto jest w stanie zniszczyć pole Stealth i anulować działanie innych technologii kamuflażowych."
Unit_Description_0223="Duch to dobra jednostka zwiadowcza, szybka i nieźle uzbrojona."
Unit_Description_0224="Te niewiarygodnie szybkie boty zaprojektowane są po to, by siać zniszczenie. Pulsar dźwiękowy krótkiego zasięgu zainstalowany na każdym z ramion emituje skoncentrowane, wirujące fale dźwiękowe, które przenikają i uszkadzają stałą materię."
Unit_Description_0225="Aurora ma bardzo lekki pancerz, ale za to duży zasięg działania oraz wielką siłę rażenia. Na szczęście dla innych frakcji, Działo rozpraszające Aurory nie jest zbyt szybkostrzelne."
Unit_Description_0226="Ferwor nadrabia brak celności zdolnością do bombardowania celu dziesiątkiem pocisków. Pociski te mają niewielki promień rażenia po detonacji, ale siła ich uderzenia w tym rejonie jest niesamowita."
Unit_Description_0227="Oset jest wyposażony w szybkostrzelną, dźwiękową baterię pulsacyjną. Broń ta zaprojektowana została, aby niszczyć lżejszy pancerz samolotów i powodować krytyczne obrażenia strukturalne."
Unit_Description_0228="Obsydian posiada działo kwantowe, które jest może dość wolno strzelającą bronią, ale za to potężną. Wszystkie jednostki Obsydian posiadają generator tarcz Tachyon, które po aktywacji generują wokół jednostki pole siłowe."
Unit_Description_0229="Poszukiwacz to jednostka, która posiada Wyrzutnię pocisków taktycznych Serpentyna, przez co stanowi skuteczną broń średniego zasięgu. Należy pamiętać, że mała siła rażenia wymaga wystrzelenia kilku pocisków, aby zniszczyć cel."
Unit_Description_0230="Dominator wyposażony jest w Wyrzutnię gazu plot. Broń ta tworzy \"bąble\", które niszczą wrogie jednostki na poziomie kwantowym, powodując, że cel rozszarpuje się na strzępy."
Unit_Description_0231="Azyl łączy użycie generatorów kinetycznych oraz elektromagnetycznych, tworząc tarczę wokół określonego rejonu. Z reguły używa się go do ochrony jednostek podczas ataków naziemnych."
Unit_Description_0232="Zwiastun jest wyposażony w Laser wysokiego natężenia oraz uproszczony system odzysku i naprawy, który pozwala tej jednostce odzyskiwać materię na polu walki oraz samej się naprawiać."
Unit_Description_0233="Ciężka mobilna artyleria Aeonów powoduje wielkie obrażenia przy dużym zasięgu. Pocisk rezonansu łańcuchowego po zdetonowaniu powoduje reakcję łańcuchową na określonym, małym obszarze."
Unit_Description_0234="Kolos z początku wyposażany jest w Laser fazonowy, który spala jednostki znajdujące się w pobliżu. Nadto Kolos może także przyciągać mniejsze jednostki wroga do siebie, korzystając z Promienia śledzącego i miażdżyć je."
Unit_Description_0235="Trzymając się aeońskiej filozofii, która promuje produkcję prostych jednofunkcyjnych jednostek, Miraż to właściwie naprowadzany pocisk, który wyposażony jest w zaawansowany zestaw sensorów optycznych."
Unit_Description_0236="Ten myśliwiec przechwytujący przedkłada obecność skoncentrowanej siły ognia w walce z lotnictwem nad montaż dodatkowych systemów. Bateria pulsaru dźwiękowego zainstalowana na Konserwatorze nadaje się idealnie do walk jeden-na-jeden przeciwko samolotom wroga."
Unit_Description_0237="Zamrażacz atakuje bardzo wybuchową Chronobombą. Przejściowe pole, które wytwarza się tam na kilka chwil po detonacji bomby, momentalnie zamraża znajdujące się na tym terenie jednostki wroga."
Unit_Description_0238="Ten mały transportowiec zaprojektowany został do przenoszenia małych oddziałów bojowych botów i/lub czołgów. Jest bardzo szybki, ale brak mu nieco zdolności załadunkowej, opancerzenia i siły ognia, jaką posiada jego cięższy odpowiednik."
Unit_Description_0239="Ten śmigłowiec ma pod spodem zamontowany Lekki, quadowy laser. Broń ta powoduje lekkie obrażenia, ale jest wyjątkowo szybkostrzelna. "
Unit_Description_0240="Bombowiec torpedowy Aeonów atakuje bombami typu Głębia Harmonii, które naprowadzają się na cel i eksplodują, niszcząc spójność kadłuba okrętowego i powodując zniszczenia strukturalne."
Unit_Description_0241="Prorok to najlepsza jednostka wywiadowcza Aeonów. Nie posiada ona może zdolności hydrolokacyjnej, ale ma znaczny zasięg lotu oraz duży promień poszukiwania radarem i sensorami optycznymi."
Unit_Description_0242="Aluminar to transportowiec. Jego zadaniem jest przewozić małe oddziały szturmowe botów i /lub czołgów. Ma znacznie bogatszy pancerz niż Rydwan oraz posiada na swym pokładzie Baterie pulsarów dźwiękowych."
Unit_Description_0243="Korona to pierwsza próba wykorzystania technologii Seraphim podczas produkcji jednostek Aeonów. Automatyczne działo przemieszczenia kwantowego zainstalowane na Koronie wystrzeliwuje pociski rozpryskowe."
Unit_Description_0244="Szoker atakuje pojedynczą Bombą kwarkową. Bomby te mają mały promień działania po detonacji, ale powodują znaczne uszkodzenia celu. Szoker może także wysłać Mylącą flarę, która wprowadza zamieszanie w systemach komputerowych atakujących wrogów."
Unit_Description_0245="Najgroźniejsza broń na pokładzie jednostki CAR to duży Generator promieni kwantowych, zainstalowany w centralnej części tej jednostki. Nadto, CAR może na swym pokładzie przewozić całe skrzydło samolotów bojowych."
Unit_Description_0246="Marker to podstawa floty aeońskiej. Posiada zdolności hydrolokacyjne oraz radarowe, przez co obecność tych jednostek jest wręcz niezbędna w każdej grupie bojowej okrętów. W swym arsenale posiada także broń przeciwtorpedową."
Unit_Description_0247="Sylf koncentruje się na polowaniu na okręty. Posiada na pokładzie dwie Chronotorpedy i posiada zdolność bojową równą innym okrętom podwodnym tej frakcji."
Unit_Description_0248="Skrawek daje aeońskiej flocie wsparcie przeciwlotnicze. Na pokładzie ma zainstalowaną standardową aeońską Przeciwlotniczą baterię pulsarów dźwiękowych. Skrawek przedkłada prędkość nad opancerzenie. "
Unit_Description_0249="Zaprojektowana, by dawać doskonałą ochronę przeciwlotniczą, Infinity wyposażona jest w dwie wyrzutnie pocisków ziemia-powietrze Zealot oraz Dwulufowe działo kwantowe dające możliwość bezpośredniego prowadzenia walki."
Unit_Description_0250="Eksodus to jednostka zaprojektowana do walki bezpośredniej i polowań na okręty podwodne. Wyposażona jest w działo Oblivion oraz kilka rodzajów broni przeciwtorpedowych i przeznaczonych do walki z okrętami podwodnymi."
Unit_Description_0251="Omen posiada na swym pokładzie trzy Działa Oblivion, które nawet przy niewielkiej częstotliwości oddawania strzałów czynią go groźną bronią. Antyrakietowe flary Diabelski Ogień dają ochronę przed pociskami taktycznymi."
Unit_Description_0252="Keefer może przechowywać kilka szwadronów samolotów, a także tankować i naprawiać wszelkie inne samoloty, które na nim wylądują. Nie posiada uzbrojenia ofensywnego, ale posiada parę Wyrzutni pocisków ziemia-powietrze Zealot."
Unit_Description_0253="Wyciszacz to zanurzeniowa platforma rakietowa. Jej podstawowy arsenał stanowi wyrzutnia pocisków taktycznych Serpentyna. Wyciszacz może wyposażyć swoje pociski w głowice bojowe."
Unit_Description_0254="Burza atakuje przy pomocy Wyrzutni ciężkich chronotorped. W wynurzeniu jednostka ta może korzystać z pojedynczego działa Oblivion. Jest ponadto w stanie w terenie stworzyć flotę lekkich jednostek wsparcia."
Unit_Description_0255="Eruptor to podstawowa jednostka obrony naziemnej oraz drugorzędna jednostka militarna, posiada wyrzutnię Grawiton, która daje pewien poziom obrony bez obciążania miejscowej ekonomii kosztami. "
Unit_Description_0256="Poszukiwacz jest wyposażony w standardową, aeońską Baterię przeciwlotniczych dział pulsacyjnych, skupiając się na obronie przeciwlotniczej, a nie na bezpośrednim ostrzale. Postawiony na wodzie, Poszukiwacz posiada platformę pływającą. "
Unit_Description_0257="Fala to tania, skuteczna struktura obrony morskiej, posiadająca standardową aeońską Wyrzutnię chronotorped, zainstalowaną w lekko opancerzonej wieżyczce. Jednostkę tę można budować tylko na wodzie."
Unit_Description_0258="Tak jak i inne frakcje, Aeoni budują modułowe mury, by chronić swoje struktury przed niepożądaną obecnością oraz bezpośrednim ogniem nieprzyjaciela."
Unit_Description_0259="Oblivion, jednostka przyjmująca swą nazwę od Dział Oblivion, to ciężko opancerzona wieża obronna. Aeońskie Działo Oblivion jest powolne, ale czyni straszliwie szkody w określonym promieniu swego działania. "
Unit_Description_0260="Zamiast zwykłych dział plot., Aeonowie używają Wyrzutni gazu plot. Broń ta tworzy \"bąble”, które powodują u celu zniszczenia na poziomie kwantowym, przez co rozdziera się on na strzępy."
Unit_Description_0261="Wulkan używa flary taktycznej Diabelski Ogień, która przyciąga pociski w miejsce, gdzie można je bezpiecznie zdetonować. Jednostkę tę można budować nad wodą."
Unit_Description_0262="Lepiej uzbrojona wersja Wyrzutni torped T1,  wyrzutnia T2 posiada Wielostrzałową wyrzutnię chronotorped."
Unit_Description_0263="Tarcza Światła to aeońska wersja tarczy. Łączy ona w sobie funkcje elektromagnetyczne oraz generator kinetyczny, przez co jest w stanie niszczyć nadlatujące pociski oraz inny sprzęt wojskowy."
Unit_Description_0264="W przeciwieństwie do innych systemów przeciwlotniczych, broń ta wysyła w stronę celu pojedynczy pocisk Zealot. Gdy postawiona na wodzie, Wyrzutnia SAM posiada platformę pływającą."
Unit_Description_0265="Jednostkę Patron skonstruowano po to, aby niszczyła nadlatujące pociski, nim dotrą one do celu. Wyrzutnia ta posiada do swej dyspozycji 5 pocisków. Patronowi należy wydać polecenie konstrukcji pocisków obronnych."
Unit_Description_0266="Blask to ulepszenie jednostki o nazwie Tarcza Światła. Jest ona w stanie wchłonąć więcej siły uderzeniowej i swą ochroną obejmuje większy obszar."
Unit_Description_0267="Bateria stacjonarna Wyziew bierze swą oryginalną nazwę od pocisków, których używa. Pociski te powodują na przestrzeni określonego czasu znaczne obrażenia u celu."
Unit_Description_0268="Jednostka ta jest w stanie skonstruować i przechowywać do ośmiu pocisków Serpentyna. Są to pociski seryjne, które pozwalają prowadzić stały ostrzał na przyzwoitym poziomie. Jednostce należy wydać polecenie produkcji pocisków."
Unit_Description_0269="Kolebka to platforma naprawcza służąca także do tankowania, dzięki której znacznie zwiększa się zasięg samolotów."
Unit_Description_0270="Najbardziej zaawansowana jednostka artyleryjska Aeonów wystrzeliwuje Pociski rezonansu dźwiękowego, które dokonują znacznych zniszczeń przy dalekim zasięgu działania i fenomenalnej skuteczności. Minusem jest mała szybkostrzelność."
Unit_Description_0271="Ta wyrzutnia pocisków może skonstruować i przechować do pięciu Głowic bojowych odkształcenia kwantowego. Głowice te dają wielką siłę ognia przy dalekim zasięgu. Jednostce należy wydać polecenie konstruowania pocisków."
Unit_Description_0272="Portal pozwala na wezwanie ZOJD. Zastępcza jednostka dowodzenia może dokonywać konserwacji oraz napraw jednostek i struktur."
Unit_Description_0273="Inżynier to jednostka spełniająca wiele funkcji: może konstruować, naprawiać, przechwytywać lub konwertować daną jednostkę. Ma zdolności amfibijne, może zatem poruszać się po wodzie, konstruując budynki marynarki wojennej."
Unit_Description_0274="Jest to ulepszona wersja Inżyniera T1, która jest w stanie budować bardziej złożone struktury. Konstruuje się ją w fabryce T2."
Unit_Description_0275="To ulepszona wersja Inżyniera T2, która zdolna jest stawiać najbardziej skomplikowane budowle. Tylko ona może budować jednostki eksperymentalne. Buduje się ją w fabryce T3."
Unit_Description_0276="Fabryka jednostek naziemnych tworzy podstawowe jednostki mobilne (tylko naziemne), które są niezbędne do prowadzenia wojny. Fabrykę można ulepszyć do poziomu T2 i może wspomagać innye fabryki."
Unit_Description_0277="Fabryka lotnicza produkuje podstawowe jednostki lotnictwa, potrzebne do prowadzenia działań wojennych. Fabryka produkuje jedynie lotnictwo i można ją ulepszyć do poziomu T2. Może ona wspomagać inne fabryki."
Unit_Description_0278="Stocznia marynarki produkuje podstawowe okręty potrzebne do prowadzenia działań wojennych. Stocznia produkuje jedynie jednostki marynarki i można ją ulepszyć do poziomu T2. Może ona wspomagać inne fabryki."
Unit_Description_0279="To ulepszona Fabryka jednostek naziemnych T1. Można ją ulepszyć do poziomu 3., co da jej dostęp do zaawansowanych projektów. Może wspomagać inne fabryki.   "
Unit_Description_0280="To ulepszona Fabryka lotnicza T1. Można ją ulepszyć do poziomu 3., co da jej dostęp do zaawansowanych projektów. Może wspomagać inne fabryki.  "
Unit_Description_0281="To ulepszona Stocznia marynarki T1. Można ją ulepszyć do poziomu 3., co da stoczni dostęp do zaawansowanych projektów. Może wspomagać inne fabryki.  "
Unit_Description_0282="To ulepszona Fabryka jednostek naziemnych T2. To najwyższy stopień technologiczny tego typu struktury. Może wspomagać inne fabryki.  "
Unit_Description_0283="To ulepszona Fabryka lotnictwa T2. To najwyższy stopień technologiczny tego typu struktury. Może wspomagać inne fabryki.  "
Unit_Description_0284="To ulepszona Stocznia marynarki T2. To najwyższy stopień technologiczny tego typu struktury. Może wspomagać inne fabryki.  "
Unit_Description_0285="Generator mocy to tanie, solidne i stabilne źródło energii. Generatory mocy mogą być podłączone do innych struktur, co daje tym drugim niewielką obniżkę kosztów działania."
Unit_Description_0286="Do dziś złoża naturalne zawierające węglowodór stanowią dobre źródło energii. Elektrownia węglowodorowa jest o wiele wydajniejsza niż generator mocy."
Unit_Description_0287="Jednostka o nazwie Zbiornik masy zwiększa maksymalną ilość dostępnej masy w bazie dowódcy. W momencie, gdy zbiornik postawiony jest obok Generatorów mocy, otrzymujesz premię."
Unit_Description_0288="Masa to cenne źródło zasobów podczas Wiecznej Wojny, wydobywa się ją przy pomocy ekstraktorów masy. Ekstraktor masy może zostać ulepszony do bardziej wydajnej wersji - pompy masy."
Unit_Description_0289="Kreator masy to genialny system przetwarzania czystej energii na używalną Masę. Koszt energetyczny jest wielki, więc opłaca się go stosować tylko wtedy, gdy trudno masę zdobyć w inny sposób."
Unit_Description_0290="Jednostka o nazwie Zbiornik masy zwiększa maksymalną ilość dostępnej masy w bazie dowódcy. W momencie, gdy zbiornik postawiony jest obok Ekstraktorów i Kreatorów masy, otrzymujesz premię.  "
Unit_Description_0291="Ulepszenie Generatora mocy do T2 jest bardzo kosztowne. Postawienie struktur obok Generatora mocy T2 zwiększa ich wydajność operacyjną.  "
Unit_Description_0292="Ekstraktor T2 to ulepszona wersja Ekstraktora masy lub budynek postawiony przez Inżyniera T2. Utrzymanie tej wersji więcej kosztuje, ale z kolei pozwala ona na szybsze zbieranie masy.  "
Unit_Description_0293="Reaktor kwantowy to najlepsze źródło dostaw energii na pierwszej linii frontu. Postawienie budynków obok Reaktora kwantowego zwiększa ich wydajność operacyjną.  "
Unit_Description_0294="Ekstraktor T3 to ulepszona wersja Ekstraktora masy T2 lub budynek postawiony przez Inżyniera T3. Utrzymanie tej wersji więcej kosztuje, ale z kolei pozwala ona na szybsze zbieranie masy.  "
Unit_Description_0295="Budynki Kreatora masy produkują wielkie ilości masy przy dużym użyciu energii elektrycznej. Na skuteczne działanie tej struktury mogą sobie pozwolić jedynie takie frakcje, które dysponują znacznymi zasobami energii.  "
Unit_Description_0296="Podstawowy radar  ma ograniczony zasięg oraz uzbrojenie, ale jego postawienie bardzo mało kosztuje. System ten można ulepszać, zyskując na zasięgu i innych cechach."
Unit_Description_0297="Jest to instalacja hydrolokacyjna, bardzo przypominająca radar. System ten można ulepszać, zyskując na zasięgu i innych cechach."
Unit_Description_0298="System radarowy T2 to odpowiednik systemu T1, tyle że o większym zasięgu. Może być wynikiem ulepszenia Systemu T1, a następnie dalej ulepszany do poziomu T3, Radaru omnisensorowego.  "
Unit_Description_0299="System sonarowy T2 to odpowiednik Systemu T1, tyle że o większym zasięgu. Może być wynikiem ulepszenia Systemu T1, a następnie dalej ulepszany do poziomu systemu mobilnego.  "
Unit_Description_0300="Gdy generator pola Stealth jest aktywny, wszelkie jednostki w jego zasięgu znikną z radarów. Pole nie potrafi jednak wpłynąć na pole widzenia."
Unit_Description_0301="Platforma sonarowa to mobilny system hydrolokacyjny o dalekim zasięgu. Zaopatrzona jest w wyrzutnie anty-torpedowe. Ta Instalacja  sonarowa T3 może być wynikiem ulepszenia instalacji T2."
Unit_Description_0302="Łańcuch omnisensorowy to narzędzie wywiadowcze najwyższego rzędu. Ma bardzo duży zasięg, a ponadto jest w stanie zniszczyć pole Stealth i anulować działanie innych technologii kamuflażowych."
Unit_Description_0303="OJD to najważniejsza jednostka na polu bitwy. W niej przybywa Dowódca, znajdziemy to zarówno koszary, jak i centrum dowodzenia. OJD posiada wszelkie schematy niezbędne do zbudowania armii na polu bitwy."
Unit_Description_0304="OJD to najważniejsza jednostka na polu bitwy. W niej przybywa Dowódca, znajdziemy to zarówno koszary, jak i centrum dowodzenia. OJD posiada wszelkie schematy niezbędne do zbudowania armii na polu bitwy."
Unit_Description_0305="OJD to najważniejsza jednostka na polu bitwy. W niej przybywa Dowódca, znajdziemy to zarówno koszary, jak i centrum dowodzenia. OJD posiada wszelkie schematy niezbędne do zbudowania armii na polu bitwy."
Unit_Description_0306="To ulepszenie zwiększa wielkość Tarczy oraz jej siłę. Z drugiej strony, koszt działania Tarczy wzrasta."
Unit_Description_0307="Oparty na projekcie tytana, Percival, ma cięższy pancerz i wyposażony jest w działo plazmowe, które zdolne jest do niezwykle silnego, bezpośredniego ostrzału. Percival jest wolny, ale dysponuje ogromną siłą ognia."
Unit_Description_0308="Ulepszając podstawową platformę Flapjacka i wyposażając go w wyrzutnię rakiet taktycznych Aloha, naukowcy UEF stworzyli mobilną platformę rakietową Grot."
Unit_Description_0309="Mający ciężki pancerz, uzbrojony w ciężkie działa plazmowe, wyrzutnie rakiet Łupieżca i generator tarczy Continental ma 28 miejsc do przenoszenia większych grup jednostek na pole bitwy."
Unit_Description_0310="Cooper to lekka łódź z pojedynczym lukiem torpedowym i wyrzutnią pocisków przeciwtorpedowych. Chociaż jest dość krucha, to jednak w większych grupach taka łódź może stać się zagrożeniem dla łodzi podwodnych."
Unit_Description_0311="Bastion jest dość niedrogim statkiem, który może chronić pobliskie jednostki za pomocą generatora tarczy, przedłużając im życie w boju i umożliwiając zwiększenie nacisku na cel."
Unit_Description_0312="Wyposażony w podwójne działa plazmowe Hiro oraz torpedy Neptun jest doskonałą platformą obrony morskiej. Ponadto, na jego wyposażeniu składają się też antyrakietowe działa Falanga i wyrzutnie rakiet przeciwtorpedowych."
Unit_Description_0313="Wyposażony w ciężki karabin plazmowy Gatlinga, Ravager, zadaje ogromne obrażenia pojedynczym celom. Ciężki pancerz zewnętrzny wytrzymuje ponadto ogromne ilości uszkodzeń, zanim wreszcie się załamie."
Unit_Description_0314="Centrum Novax wypuszcza i kontroluje satelity Novax. Te satelity poruszają się powoli w górnych partiach atmosfery, poza zasięgiem dział przeciwlotniczych i wykorzystują broń energetyczną, by siać zniszczenie pośród swych wrogów."
Unit_Description_0315="Iskierka jest wyposażonym bojowo Inżynierem T2, posiadającym Riot gun oraz wewnętrzny zakłócacz radaru, który pozwala jej przetrwać dłużej na polu bitwy."
Unit_Description_0316="Autonomiczna jednostka konstrukcyjna zwana Psiarnią wypuszcza sondy inżynieryjne typu 'Rover', które zajmują się naprawami, odzyskiwaniem i pomocą przy przechwytywaniu jednostek, które znajdą się w ich zasięgu operacyjnym."
Unit_Description_0317="Mobilna bomba Ogniowy Żuk jest lekko opancerzoną jednostką pozbawioną broni, ale mogącą odpalić się w momencie zbliżenia się do celu. Wewnętrzne zabezpieczenia uniemożliwiają pełną eksplozję w chwili zniszczenia jednostki."
Unit_Description_0318="Lojalistyczne ulepszenie - wodny pojazd Cegła - wyposażony jest w ciężki pancerz i potężną broń. Jego uzbrojenie składa się z ciężkiego lasera pulsacyjnego, wyrzutni torped i flar przeciwtorpedowych."
Unit_Description_0319="Megalit przypomina wielkiego kraba, wyposażonego w dwa działa protonowe i systemy obrony przeciwlotniczej, a także wyrzutnie torped i flary przeciwtorpedowe. Może również tworzyć małe statki."
Unit_Description_0320="Dobrze uzbrojony i niezwykle szybki Jester może przejmować i niszczyć szybko i efektywnie zgrupowania małych jednostek. Jednakże, Jester ma lekki pancerz i ograniczony zasięg."
Unit_Description_0321="Wailer jest cybrańską wersją Svirda. Broń UEF została zastąpiona rakietami nanite i pulsacyjnymi laserami dezintegrującymi. Dodano również zestaw zakłócający radary."
Unit_Description_0322="Wyposażona w luki torpedowe Nanite oraz flary przeciwtorpedowe Barakuda jest w stanie podjąć walkę i pokonać większość wrogich jednostek. Posiada również osobiste pole stealth, które powoduje, że nie daje się wykryć sonarem."
Unit_Description_0323="Syrena wyposażona jest w pole stealth działające na radary i sonary, co pozwala jej i statkowi w jej zasięgu przedostać się przez tereny wykrywania radarowego i nasłuchu bez wykrycia. Flary przeciwtorpedowe stanowią jej obronę przed łodziami podwodnymi."
Unit_Description_0324="Autonomiczna jednostka konstrukcyjna Rój wypuszcza do czterech minirobotów konstrukcyjnych, które naprawiają, odzyskują i pomagają przechwycić jednostki, które znajdą się w operacyjnym zasięgu Roju."
Unit_Description_0325="Wyposażone w wyrzutnię torped Kril, ulepszenie torpedowego systemu obronnego HARMS może stawić czoła nawet największym jednostkom wroga."
Unit_Description_0326="Wieszcz generuje tysiące nanokamer, które rozpraszają się po ogromnym terenie i monitorują go. Te nanokamery szybko się wypalają, ale Wieszcz cały czas je odnawia."
Unit_Description_0327="Chociaż Płomień jest jednostką lekko opancerzoną, jest szybki i wyposażony w podwójne autodziała kwantowe. Płomień ma przebijać się przez linie wroga i niszczyć gorzej chronione sektory tylne."
Unit_Description_0328="Zbudowany na bazie Zwiastuna, Striker, cechuje się zarówno duża ilością zadawanych obrażeń oraz niezwykłym zasięgiem. Jego głównym zadaniem jest zdejmowanie z daleka ważnych celów, takich jak artyleria."
Unit_Description_0329="Tańszy od Korony, ale szybszy i lepiej uzbrojony od Conservatora, Szybki Wiatr, doskonale nadaje się do walki powietrznej, wypełniając lukę między myśliwcami T1 i T3."
Unit_Description_0330="Aby odpierać ataki śmigłowców, Aeoni stworzyli swój własny śmigłowiec przeciwlotniczy Odnawiacz. Powolny, ale ciężko opancerzony Odnawiacz ma na pokładzie lekki laser kwantowy i rakiety typu Zelota, co daje mu imponujące możliwości przeciwlotnicze."
Unit_Description_0331="Korzystając z Ofiary jako bazy projektu, naukowcy Aeonów powiększyli rozmiar jednostki, umożliwiając jej przenoszenie torped i ulepszając pancerz. Nowy Solace jest w stanie mocniej przycisnąć wroga i wytrzymać na polu walki dłużej niż starszy model, Sito."
Unit_Description_0332="Aby walczyć z wrogimi łodziami podwodnymi, Aeoni skonstruowali Vesper - łowcę łodzi podwodnych. Jednostka ta uzbrojona jest w chronotorpedy i kwazarowe ładunki przeciwtorpedowe. Zdolna jest do łatwego eliminowania wrogich statków."
Unit_Description_0333="Wyposażony w dwa komplety taktycznych rakiet Serpentyna, Wir, ma daleki zasięg, doskonałą celność i okazuje się doskonałym środkiem niszczenia defensywnych baterii na wybrzeżu."
Unit_Description_0334="Salvation strzela szybko, pokrywając spory teren ogniem zaporowym. Każdy pocisk rozdziela się po wystrzeleniu dwukrotnie, ale jego konstrukcja umożliwia stały ostrzał wroga."
Unit_Description_0335="Oko Rhianne wchodzi w przestrzeń kwantową, a potem wraca w normalną przestrzeń. Dzięki temu dowódca Aeonów widzi każdy fragment pola bitwy."
Unit_Description_0336="Wzorzec korzysta z technologii kwantowej, aby uzyskać nieograniczoną ilość energii i masy. Zniszczony wzorzec wybucha z siłą broni strategicznej."
Unit_Description_0337="Lekka, szybka jednostka Selen przenosi mały radar i lekką broń do samoobrony. W chwilach bezczynności automatycznie włącza pole maskujące, stając się niezwykle użytecznym, mobilnym radarem."
Unit_Description_0338="Lubując się w szybkich i zwrotnych jednostkach, Seraphimowie zaprojektowali średni czołg Thaam. Uzbrojony w standardowe działo Spectra jest w stanie strzelać szybko i skutecznie."
Unit_Description_0339="Zthuee jest wodnym pojazdem niebezpośredniego wsparcia. Jego pociski uwalniają ładunek elektryczny, który tworzy szybko rozszerzającą się błyskawicę, trafiającą wrogów w zasięgu."
Unit_Description_0340="Podstawa polowej obrony przeciwlotniczej, korzystająca z broni typu Gatling, której pociski wyrządzają niewielkie szkody, ale których skoncentrowany strumień jest w stanie niszczyć słabsze jednostki przeciwnika."
Unit_Description_0341="Ciężki robot szturmowy Ilshavoh posiada na wyposażeniu dwa ciężkie boltery Verimar. Jednostka ta zdolna jest rozrywać na strzępy swoje ludzkie odpowiedniki, ale lekki pancerz czyni ją wrażliwą na artylerię i ostrzał niebezpośredni."
Unit_Description_0342="Stara jednostka Yenzyne została ulepszona za pomocą systemu poduszkowego i ciężkiego, fazowego autodziała, stając się groźną maszyną bojową."
Unit_Description_0343="Mobilna wyrzutnia rakiet Ythisah jest konwencjonalną jednostką rakietową. Jej rakiety wyzwalają po eksplozji dodatkowy impuls elektromagnetyczny, który na krótko zatrzymuje budynki wroga."
Unit_Description_0344="Iashavoh jest wersją artylerii przeciwlotniczej Seraphimów."
Unit_Description_0345="Othuum to wodny czołg oblężniczy. Jego działo Tau strzela wolno, ale zadaje ogromne obrażenia, szczególnie gdy wspierają je boltery Aire-au. Othuum posiada również pojedynczy luk z torpedą Uall an wypadek morskiego starcia."
Unit_Description_0346="Usha-ah to jednostka, która może szybko dogonić cel. Kiedy już znajdzie się na właściwej pozycji, wchodzi w tryb snajpera. To poprawia celność, zwiększa obrażenia, ale zmniejsza szybkostrzelność."
Unit_Description_0347="Suthanus uzbrojony jest w osadzone na pancerzu ciężkie działo artyleryjskie. Wystrzeliwuje ono pocisk energetyczny, który zadaje średnie obrażenia i wypuszcza energetyczną istotę, która do końca swoich chwil atakuje pobliskie jednostki."
Unit_Description_0348="Mobilny generator tarczy Seraphimów zapewnia doskonałą ochronę mobilnym siłom."
Unit_Description_0349="Ythotha to w rzeczywistości połączenie dwóch jednostek. W swej podstawowej formie Ythotha wyposażona jest w laser fazonowy. Po zniszczeniu uwalnia się Othuy - istota z energii, która przez krótki czas atakuje pobliskie jednostki."
Unit_Description_0350="Standardowy zwiadowca powietrzny Sele-istle jest szybki, ma lekki pancerz i szerokie pole widzenia. Jego radar umieszczony jest w odpornej na uderzenia kasetce, dzięki czemu działa nawet przez jakiś czas po tym, jak jednostka się rozbije."
Unit_Description_0351="Szybki, zwinny myśliwiec Przechwytywacz uzbrojony jest w Sheo - broń przypominającą Gatlinga wystrzeliwującego skoncentrowany strumień pocisków, które w krótkim czasie zadają znaczne obrażenia."
Unit_Description_0352="Sinnve zaprojektowano z myślą o szybkich, dokładnych uderzeniach. Ten bombowiec jest bardzo szybki, ale nosi niewielką ilość paliwa. Trudno mu trafiać w ruchome cele, jako że 'bomba' zwalnia, by wspomóc celność."
Unit_Description_0353="Vish działa podobnie jak ludzki transporter. Ma osiem miejsc i może przenosić różne jednostki po polu walki."
Unit_Description_0354="Notha stanowi kombinację bombowca i myśliwca przechwytującego, dzięki czemu może pełnić obie te role. Ma takie samo uzbrojenie jak jednostki, od których się wywodzi, chociaż w odróżnieniu od nich, ma dwa rodzaje broni przeciwlotniczej."
Unit_Description_0355="Ten śmigłowiec nie wykorzystuje taktyki unikowej ludzkich helikopterów - zamiast tego jest lepiej uzbrojony. Vulthoo uzbrojony jest w dwa autodziała, gotowe strzelać naokoło."
Unit_Description_0356="Uosioz wydaje się bezpośrednim następcą Sita - torpedowego bombowca Aeonów. Największa różnica leży w tym, że Uosioz wypuszcza trzy ciężkie torpedy, co daje mu większą siłę ognia."
Unit_Description_0357="Solidna jednostka do transportu powietrznego Vishala uzbrojona jest w ciężkie autodziało fazowe. Działo służy do walki naziemnej, natomiast dwa Shleo służą jako obrona przeciwlotnicza. Vishala ma 16 miejsc transportowych."
Unit_Description_0358="Iaselen ma doskonały zasięg optyczny, porządny radar i zestaw sonarów. Jest to szybka i zręczna jednostka, której duży zapas paliwa pozwala na podejmowanie się długich misji."
Unit_Description_0359="Iazyne wyposażona w działo przeciwlotnicze Losaare stanowi najefektywniejszą broń Seraphimów, wykorzystywaną przeciw jednostkom powietrznym. Jest ona w stanie zmierzyć się z myśliwcem dominacji powietrznej."
Unit_Description_0360="Sinntha wyposażona jest w unikatową broń Seraphimów - bombę strategiczną Khamseen. Ta broń zadaje ogromne obrażenia pojedynczym celom i całemu terenowi ostrzału."
Unit_Description_0361="Ahwassa to bombowiec zdolny niszczyć całe bazy. Do obrony wykorzystuje trzy autodziała Losaare. Zrzuca strategiczne bomby eksperymentalne, które powodują ogromne szkody na dużym terenie."
Unit_Description_0362="Hau-esel wyposażony w autodziało do bombardowania morskiego i naziemnego oraz przeciwlotniczego Gatlinga potrafi pokazać na polu walki sporą potęgę."
Unit_Description_0363="Seraphimowie dodali wyrzutnię torped do łodzi podwodnej Sou-istle, by ulepszyć jej obronę. Sou-istle wyposażona jest ponadto w działo Spectra celem osiągnięcia lepszych efektów na powierzchni."
Unit_Description_0364="Ithalua wyposażona w parę przeciwlotniczych dział artyleryjskich Olaris, wyrzutnię rakiet taktycznych i obronę rakietową Elathrun, wspiera floty zarówno defensywnie, jak i niebezpośrednio."
Unit_Description_0365="Uashavoh niszczy zbliżające się torpedy podwodnym promieniem o małym zasięgu. Wystrzeliwuje torpedy Ana-it, a posiada ponadto ultrachromatyczne generatory promieni, które atakują cele na powierzchni."
Unit_Description_0366="Hathuum wyposażony jest w trzy ciężkie działa Quarnon, rozłożone równo na statku. Dodatkowo, Hauthuum posiada dwa działa przeciwlotnicze, dwa systemy obrony przeciwrakietowej i strategiczną wyrzutnię rakiet."
Unit_Description_0367="Yathsou posiada trzy luki torpedowe i podwójny system obrony przeciwtorpedowej Ajellu, pozwalający na walkę z kilkoma grupami wrogich łodzi podwodnych. Yathsou wyposażony jest ponadto w autodziało przeciwlotnicze, chroniące jednostkę przed atakami z powietrza."
Unit_Description_0368="Lotniskowiec nie jest uzbrojony, jeśli nie liczyć dwóch par autodział przeciwlotniczych Losaare. Zamiast tego jest w stanie przenosić ogromne ilości samolotów."
Unit_Description_0369="Uttaus to wieżyczka wyposażona w podwójne działo Spectra, a skonstruowana z myślą o obronie bazy w sytuacjach niskiego ryzyka. Uttaus to dobra siła ognia za niewielkie pieniądze."
Unit_Description_0370="Korzystająca z tej samej co Uttaus ramy Ialla, w miejscu zwykłego działa ma wersję przeciwlotniczą. Chociaż dobrze radzi sobie z atakującymi T1 ma za małą silę ognia, by poradzić sobie z jednostkami T2 lub T3."
Unit_Description_0371="Sou-atha oferuje dobrą ochronę przeciw szerokiej gamie okrętów, ale ma za słaby pancerz, by przetrwać przeciągający się ostrzał. Jest więc niedrogim, słabym środkiem obrony morskiej."
Unit_Description_0372="Tak jak inne frakcje, Seraphimowie korzystają z sekcji muru do obrony swych budynków przed intruzami i ostrzałem."
Unit_Description_0373="Ciężko opancerzona wieżyczka Uttaushala korzysta z generatora promienia ultrachromatycznego. To daje jej doskonały zasięg i ogromną siłę ognia, pozwalając jej rozprawić się z najsilniejszymi nawet przeciwnikami."
Unit_Description_0374="Ulepszenie obrony przeciwlotniczej na 1 poziomie technologicznym. Sinnatha korzysta z cięższego działa artylerii przeciwlotniczej 'Olaris', by chronić bazy Seraphimów przed atakami z powietrza."
Unit_Description_0375="Korzystająca z zaawansowanych systemów celowania i namierzania Ythisatha, jest w stanie zestrzeliwać rakiety jednym, dobrze wymierzonym strzałem."
Unit_Description_0376="Jako standardowy generator tarczy, ta jednostka ma nieco mniejszy promień niż jej ludzki odpowiednik, ale umożliwia całościową ochronę."
Unit_Description_0377="Uosthu to ciężko opancerzona wieżyczka, która korzysta z wyrzutni ciężkich torped. Posiada również system obrony przeciwtorpedowej pomagający bronić się przed wrogimi łodziami podwodnymi."
Unit_Description_0378="Zamiast wystrzeliwać rakiety, Iathu-ioz atakuje wrogie samoloty kulami energii. Kule energii śledzą cel i zadają poważne obrażenia w chwili uderzenia, przy okazji wysysając część paliwa."
Unit_Description_0379="Ythisioz połączony jest z siecią wywiadowczą Seraphimów, pozwalającą na śledzenie zbliżających się rakiet i wyliczenie najlepszego kąta ich przejęcia. Ythisioz wymaga wydania mu rozkazu budowania rakiet."
Unit_Description_0380="Jako efektywny generator tarczy Athanuthe jest w stanie chronić większy obszar niż większość porównywalnych systemów tarcz. Jest w stanie również wytrzymać więcej uszkodzeń nim będzie musiał się ponownie naładować."
Unit_Description_0381="Zthuthaam zapewnia wsparcie artylerii na poziomie strategicznym. Pocisk Zhuthaamu zadaje spore obrażenia przy uderzeniu, ale ma niewielkie pole rażenia. Jest to akceptowalne z uwagi na wysoką szybkostrzelność jednostki."
Unit_Description_0382="Ythis ma większy zasięg i zadaje więcej obrażeń niż jednostki będące jego ludzkimi odpowiednikami, to jednak zbudowanie każdej rakiety wymaga surowców, co może spowodować załamanie ekonomiczne, jeśli z rakiet korzysta się często."
Unit_Description_0383="Iathu-uhthe zapewnia natychmiastowe tankowanie i reperowanie do sześciu jednostek powietrznych, jeśli tylko jest dość czasu. Jedynie ta liczba różni ją od ludzkiego odpowiednika."
Unit_Description_0384="Hovatham wymaga do strzału zasobów, ale doskonale nadrabia to celnością, zasięgiem i obrażeniami. Każdy pocisk wypuszcza energetyczną istotę, która atakuje pobliskie jednostki do końca swego istnienia."
Unit_Description_0385="Hastue buduje, przechowuje i wystrzeliwuje rakiety. Każda rakieta wymaga zasobów, ale ma spore pole rażenia i eksploduje z siłą zdolną zniszczyć prawie wszystko, co znajdzie się w zasięgu wybuchu."
Unit_Description_0386="Yolona Oss wystrzeliwuje gigantyczna rakietę. Za każdą rakietę trzeba zapłacić sporą sumę w surowcach, a przechowywać w danym momencie można tylko jeden pocisk - rakieta jednak jest tak duża, że wymaga trafienia aż dwoma pociskami defensywnymi."
Unit_Description_0387="Inżynier jest jednostką wielozadaniową, zdolną do budowania, naprawiania i zbierania. Posiada cechy amfibijne i może sunąć po powierzchni wody, aby budować morskie zakłady."
Unit_Description_0388="Jest to ulepszona wersja Inżyniera T1, zdolna budować bardziej złożone struktury. Jest tworzona w Fabryce T2."
Unit_Description_0389="Jest to ulepszona wersja Inżyniera T2, zdolna budować najbardziej złożone budowle. Jest to jedyny Inżynier, który może konstruować jednostki eksperymentalne. Inżynier T3 jest tworzony w Fabryce T3."
Unit_Description_0390="Fabryka jednostek naziemnych tworzy pierwsze mobilne jednostki konieczne do toczenia wojny. Fabryka jest przystosowana do produkcji tylko naziemnych jednostek. Fabryka może być ulepszona do poziomu T2 i wspierać inne fabryki."
Unit_Description_0391="Fabryka lotnicza tworzy pierwsze jednostki powietrzne konieczne do toczenia wojny. Fabryka jest przystosowana do produkcji tylko jednostek powietrznych. Fabryka może być ulepszona do poziomu T2 i wspierać inne fabryki."
Unit_Description_0392="Stocznia marynarki tworzy pierwsze jednostki wodne konieczne do toczenia wojny. Fabryka jest przystosowana do produkcji tylko jednostek wodnych. Fabryka może być ulepszona do poziomu T2 i wspierać inne fabryki."
Unit_Description_0393="Jest to ulepszenie Fabryki jednostek naziemnych T1. Fabryka ta może być ulepszona do poziomu T3, co daje jej dostęp do zaawansowanych planów jednostek. Może ona również wspierać inne fabryki."
Unit_Description_0394="Jest to ulepszenie Fabryki lotniczej T1. Fabryka ta może być ulepszona do poziomu T3, co daje jej dostęp do zaawansowanych planów jednostek. Może ona również wspierać inne fabryki."
Unit_Description_0395="Jest to ulepszenie Stoczni marynarki T1. Stocznia ta może być ulepszona do 3 poziomu technologicznego, co daje jej dostęp do zaawansowanych planów jednostek. Może ona również wspierać inne stocznie."
Unit_Description_0396="Jest to ulepszenie Fabryki jednostek naziemnych 2 poziomu technologicznego. Fabryka ta nie może być dalej ulepszana. Może ona wspierać inne fabryki."
Unit_Description_0397="Jest to ulepszenie Fabryki lotniczej 2 poziomu technologicznego. Fabryka ta nie może być dalej ulepszana. Może ona wspierać inne fabryki."
Unit_Description_0398="Jest to ulepszenie Stoczni marynarki 2 poziomu technologicznego. Stocznia ta nie może być dalej ulepszana. Może ona wspierać inne stocznie."
Unit_Description_0399="Aezthy-uhthe jest wyposażony w najbardziej zaawansowany sprzęt, pozwalający na przyzywanie dowódców wsparcia, aby wspomogli głównego dowódcę na polu bitwy."
Unit_Description_0400="Uya-iya to tanie, solidne i stabilne źródło energii. Generatory mocy można połączyć z innymi budowlami, zmniejszając przyłączonym w ten sposób strukturom w niewielkim stopniu koszta utrzymania."
Unit_Description_0401="Złoża węglowodoru zawierające naturalne surowce stanowią dziś realne źródło energii. Uya-atoh jest dużo efektywniejszy niż zwykły generator."
Unit_Description_0402="Akumulator energii zwiększa maksymalny limit energii ekonomii dowódcy. Buduj je obok Generatorów, aby uzyskać premię."
Unit_Description_0403="Masa jest cennym surowcem w czasach Wiecznej Wojny - pozyskuje się ją za pomocą Ekstraktorów. Ekstraktor masy może być ulepszony do bardziej wydajnej wersji."
Unit_Description_0404="Fabrykant masy jest pomysłowym systemem do zamieniania czystej Energii w gotową do użycia Masę. Koszty energii są bardzo duże, zatem użycie Fabrykanta ma sens tylko wtedy, gdy Masy jest bardzo mało lub nie ma jej wcale."
Unit_Description_0405="Zbiornik masy zwiększa maksymalny limit masy ekonomii dowódcy. Buduj je obok Ekstraktorów i fabrykantów, aby uzyskać premię."
Unit_Description_0406="Ulepszenie generatora mocy 1 poziomu technologicznego. Konstruowanie budowli obok reaktora fuzyjnego ulepsza efektywność operacyjną stykających się budynków."
Unit_Description_0407="Ekstraktor masy 2 poziomu technologicznego musi zostać wybudowany przez Inżyniera T2. Ta wersja ma wyższe koszty utrzymania, ale produkuje masę dużo szybciej."
Unit_Description_0408="Generator mocy 3 poziomu technologicznego to najlepsze źródło energii na froncie. Wznoszenie budowli obok wieży fuzyjnej poprawia ich efektywność."
Unit_Description_0409="Ekstraktor masy trzeciego poziomu technologicznego można skonstruować jako ulepszenie poprzedniego ekstraktora z pomocą Inżyniera 3 poziomu. Jest to wersja droższa w utrzymaniu, ale pozwalająca na szybsze zbieranie masy."
Unit_Description_0410="Fabrykant masy 3 poziomu technologicznego produkuje ogromne ilości masy, zużywając mnóstwo energii. Tylko infrastruktura z nadwyżką energii może pozwolić sobie na taką budowlę."
Unit_Description_0411="Standardowa platforma radarowa Seraphimów nadaje się do efektywnego monitorowania aktywności intruzów. Lekka wersja ma ograniczony zasięg i pancerz, ale można ją ulepszyć."
Unit_Description_0412="Platforma sonarowa Seraphimów jest bardzo podobna do swojego radarowego odpowiednika. Jako tani mechanizm wykrywania krótkiego zasięgu, Shou wywiązuje się ze swoich zadań. Sensory można ulepszyć."
Unit_Description_0413="Shou-esel jest odpowiednikiem sonaru Shou, posiadającym większy zasięg. Shou-esel to ulepszona wersja Shou."
Unit_Description_0414="Sele-esel to odpowiednik lekkiego systemu radarowego Esel mający większy zasięg. Sele-esel to ulepszona wersja Aezesel."
Unit_Description_0415="Sele-ioz pokrywa spory fragment terenu zaawansowanym polem maskującym przed radarami. Pole ukrywa obecność wszelkich jednostek na radarze, ale nie maskuje przed spojrzeniem gołego oka."
Unit_Description_0416="Zestaw omnisensorowy Aezesel jest ostateczną opcją wywiadowczą. Poza ogromnym zasięgiem, Aezesel pokona również pola Stealth przeciwników i inne technologie maskujące."
Unit_Description_0417="Połączenie myśliwca i bombowca, zaprojektowanego, aby atakować jednostki lądowe i powietrzne. Na uzbrojenie składają się połączone przeciwlotnicze działa elektrodynamiczne i ciężkie napalmowe bomby kasetowe. "
Unit_Description_0418="Połączenie myśliwca i bombowca, zaprojektowanego, aby atakować jednostki lądowe i powietrzne. Na uzbrojenie składają się połączone przeciwlotnicze działa elektrodynamiczne i ciężkie napalmowe bomby kasetowe. "
Unit_Description_0419=" Wybuchowa i niszcząca natura systemu uzbrojenia Litość, zmusiła naukowców Aeonów do skonstruowania prostego i jednorazowego sytemu jej przenoszenia. Jako efekt, ładunek jest umieszczony na odrobinę bardziej skomplikowanej rakiecie kierowanej."
Unit_Description_0420=" Siedziba dowódcy. Połączenie baraków i centrum dowodzenia. Zawiera wszystkie plany konstrukcyjne, niezbędne do wybudowania armii od zera. "
Unit_Description_0421=" Dodaje teleporter. Do aktywacji wymaga sporej ilości mocy. "
Unit_Description_0422=" Zwiększa prędkość z jaką OJD naprawia swoje uszkodzenia. Zwiększa również ilość punktów życia."
Unit_Description_0423=" Znacznie zwiększa prędkość z jaką OJD naprawia swoje uszkodzenia. Zwiększa również ilość punktów życia."
Unit_Description_0424=" Zwiększa ilość zasobów generowanych przez OJD."
Unit_Description_0425=" Wymaga systemu alokacji zasobów. Jeszcze bardziej zwiększa ilość zasobów generowanych przez OJD."
Unit_Description_0426=" Zwiększa ilość dostępnych schematów i zwiększa prędkość budowy OJD."
Unit_Description_0427=" Zastępuje zaawansowany pakiet inżynieryjny. Zwiększa ilość dostępnych schematów i zwiększa prędkość budowy OJD."
Unit_Description_0428=" Zwiększa obrażenia zadawane przez główną broń OJD. Dodaje obrażenia obszarowe."
Unit_Description_0429=" Automatycznie przyspiesza prędkość naprawy jednostek w pobliżu. Użycie nie pochłania zasobów."
Unit_Description_0430=" Jeszcze bardziej przyspiesza prędkość naprawy jednostek w pobliżu. Zwiększa maksymalną liczbę punktów życia jednostek w pobliżu."
Unit_Description_0431=" Zwiększa szybkostrzelność głównego działa."
Unit_Description_0432=" Montuje wyrzutnię rakiet balistycznych na plecach OJD."
Unit_Description_0433=" Wielozadaniowa jednostka, służąca do budowy, naprawy, zajmowania i odzyskiwania. Odpowiednik inżyniera poziomu Tech 3."
Unit_Description_0434=" Montuje wyrzutnię rakiet balistycznych na plecach OJD."
Unit_Description_0435=" Zwiększa prędkość z jaką OJD naprawia swoje uszkodzenia. Zwiększa również ilość punktów życia."
Unit_Description_0436=" Znacznie zwiększa zasięg standardowego systemu sensorów SACU, włączając w to Omni."
Unit_Description_0437=" Przyspiesza wszystkie funkcje inżynieryjne."
Unit_Description_0438=" Dodaje do OJD generator tarczy. Aby działać, wymaga energii."
Unit_Description_0439=" Dodaje teleporter. Do aktywacji wymaga znacznej ilości energii. "
Unit_Description_0440=" Pojedynczy strzał niszczy większość jednostek. Zużywa dużo mocy."
Unit_Description_0441=" Szybki, ciężko opancerzony bot bojowy. Uzbrojony w ciężkie maszynowe działo plazmowe i wyrzutnię ciężkich granatów odłamkowych."
Unit_Description_0442=" Samobieżna jednostka wsparcia. Zaprojektowana do niszczenia tarcz przeciwnika. Uzbrojenie jest w dużej mierze nieskuteczne przeciwko jednostkom przeciwnika."
Unit_Description_0443=" Moździerz automatyczny który strzela ładunkami wybuchowymi z dość dużą celnością."
Unit_Description_0444=" Ciężko opancerzony bot rakietowy. Zaprojektowany aby atakować i niszczyć ciężko opancerzone jednostki."
Unit_Description_0445=" Nieuzbrojona, niewykrywalna dla radarów łódź podwodna służąca do misji zwiadowczych. Wyposażona we flary przeciwtorpedowe."
Unit_Description_0446=" Automatycznie naprawia, odzyskuje, pomaga i zajmuje każdą jednostkę w swoim zasięgu."
Unit_Description_0447=" Jednostka amfibijna poziomu trzeciego, służąca do budowy, naprawy i odzyskiwania."
Unit_Description_0448=" Amfibijny bot szturmowy. Może atakować jednostki morskie i lądowe."
Unit_Description_0449=" Samobieżna jednostka przeciwlotnicza. Uzbrojona w działa przeciwlotnicze."
Unit_Description_0450=" Powolna ciężka artyleria. Musi się zatrzymać aby wystrzelić."
Unit_Description_0451=" Automatycznie naprawia, odzyskuje, pomaga i zajmuje każdą jednostkę w swoim zasięgu."
Unit_Description_0452=" Automatycznie naprawia, odzyskuje, pomaga i zajmuje każdą jednostkę w swoim zasięgu."
Unit_Description_0453=" Automatycznie naprawia, odzyskuje, pomaga i zajmuje każdą jednostkę w swoim zasięgu."
Unit_Description_0454=" Jeszcze bardziej zwiększa prędkość, z jaką OJD naprawia swoje uszkodzenia. Zwiększa również ilość punktów życia."
Unit_Description_0458=" Flying Drone which can assists, repairs, and reclaim any unit. Can be ordered to initiate construction of T1 structures. It's vulnerable to any air fighters or anti-air units"
Unit_Description_0459=" Flying Drone which can assists, repairs, and reclaim any unit. Can be ordered to initiate construction of T3 structures. It's vulnerable to any air fighters or anti-air units"
Unit_Description_0460=" Mobile Anti-Air unit. Armed with a rapid-fire cannon, excellent against enemy gunships or air-fighters."
Unit_Description_0461=" Mobile Anti-Air unit. Armed with a high-speed missiles, excellent against enemy gunships or air-fighters. Capable of switching weapon to anti-land attack but with smaller damage."
Unit_Description_0462=" Mobile Anti-Air unit. Armed with a high-speed missiles, excellent against enemy gunships or air-fighters. Capable of switching weapon to anti-land attack but with smaller damage."
Unit_Description_0463=" Mobile Anti-Air unit. Armed with a high-impact projectiles, excellent against enemy gunships or air-fighters."
Unit_Description_0464=" Mobile Anti-Air unit. Armed with a long-range lasers, excellent against enemy gunships or air-fighters. Capable of switching weapon to anti-land attack but with smaller damage."
Unit_Description_0465_faf="Wyposażenie to znacznie zwiększa prędkość, z jaką OJD naprawia samą siebie. Jest to dobry wybór dla dowódców, którzy wykorzystują OJD do działań ofensywnych."
