Unit_test_Description="Wiele lat temu, dowódca imieniem Finn został pokonany i zmuszony do ucieczki. Później zwabił swojego przeciwnika na mała wyspę i tam go pokonał. Od tego czasu wyspa nosi jego imię."
VO_Credits_Aeon_Credits_010_010="Księżniczka zniknęła. Nie pozostał po niej ślad."
VO_Credits_Aeon_Credits_010_020="Bez wątpienia, jest to dzień smutku i rozpaczy. Ale nigdy nie zapomnimy, kim była dla nas Księżniczka, jakiej przyszłości chciała dla swojego narodu. Będziemy walczyć w jej imię do ostatniego tchu."
VO_Credits_Aeon_Credits_010_030="Robiąc inaczej, obrazilibyśmy jej pamięć i jej poświęcenie."
VO_Credits_Aeon_Credits_010_040="I właśnie dlatego, mimo naszego wyczerpania, mimo naszego smutku, wytropimy i zniszczymy wszystkich zdrajców, którzy dalej walczą po stronie Zakonu. Zniszczymy ostatnie gniazda oporu Seraphimów."
VO_Credits_Aeon_Credits_010_050="Upewnimy się, że te elementy nigdy już nie zagrożą ludzkości."
VO_Credits_Aeon_Credits_010_060="A kiedy wygramy ostatnią bitwę przeciwko Seraphimom i Zakonowi, odłożymy broń. Od tego dnia, Droga będzie używana do szerzenia piękna i pokoju. Nigdy więcej nie zostanie ona użyta jako broń, albo jako usprawiedliwienie morderstwa lub wojny."
VO_Credits_Aeon_Credits_010_070="To jest ścieżka, którą prowadziła nas Księżniczka. I tą ścieżką będziemy podążać."
VO_Credits_Credits_010_010="Patrzę na wasze twarze i widzę ulgę, radość i poczucie triumfu. Niewątpliwie, myślicie tylko o świętowaniu zwycięstwa. W końcu Seraphimowie i Zakon uciekają, a QAI został zniszczony."
VO_Credits_Credits_010_020="Ale ostrzegałbym przed zbyt wylewnym świętowaniem. Być może wygraliśmy, ale było to pyrrusowe zwycięstwo. Nasza sytuacja wciąż jest niepewna, a zagłada czai się wszędzie."
VO_Credits_Credits_010_030="A największe niebezpieczeństwo nie pochodzi od Seraphimów, ale od nas samych."
VO_Credits_Credits_010_040="Musimy dokonać prostego wyboru. Czy mamy wybaczyć naszym dawnym wrogom i uznać, że więcej nas łączy niż dzieli?"
VO_Credits_Credits_010_050="Czy cofniemy się do tego, w co zawsze wierzyliśmy? Czy pozwolimy, aby strach i nienawiść decydowała o naszych czynach? Czy w obliczu nieznanego odpowiemy przemocą? Jeśli mamy przetrwać, nie możemy do tego dopuścić."
VO_Credits_Credits_010_060="Nie pozwolę, aby tak się stało."
VO_Credits_Credits_010_070="Ogłaszam, że wraz z chwilą obecną, UEF uznaje niepodległość Cybran i Aeonów. Oba narody mają pełne prawo do swojej obecnej historii i terytoriów, które zajmują. W niedalekiej przyszłości, mam nadzieję, zawrzemy trwały sojusz naszych trzech narodów."
VO_Credits_Credits_010_080="Zawsze marzyliśmy o zjednoczeniu galaktyki, zebraniu razem braci i sióstr ludzkości. W końcu to marzenie udało się zrealizować. I módlmy się, abyśmy nigdy nie zapomnieli, co doprowadziło do tej chwili--nie lufy dział, ale optymizm pokoju."
VO_Credits_Credits_010_090="Aby trwał wiecznie."
VO_Credits_Credits_020_010="Księżniczka znikła. Nie pozostał po niej ślad."
VO_Credits_Credits_020_020="Bez wątpienia, jest to dzień smutku i rozpaczy. Ale nigdy nie zapomnimy, kim była dla nas Księżniczka, jakiej przyszłości chciała dla swojego narodu. Będziemy walczyć w jej imię do ostatniego tchu."
VO_Credits_Credits_020_030="Robiąc inaczej, obrazilibyśmy jej pamięć i jej poświęcenie."
VO_Credits_Credits_020_040="I właśnie dlatego, mimo naszego wyczerpania, mimo naszego smutku, wytropimy i zniszczymy wszystkich zdrajców, którzy dalej walczą po stronie Zakonu. Zniszczymy ostatnie gniazda oporu Seraphimów."
VO_Credits_Credits_020_050="Upewnimy się, że te elementy nigdy już nie zagrożą ludzkości."
VO_Credits_Credits_020_060="A kiedy wygramy ostatnią bitwę przeciwko Seraphimom i Zakonowi, odłożymy broń. Od tego dnia, Droga będzie używana do szerzenia piękna i pokoju. Nigdy więcej nie zostanie ona użyta jako broń, albo jako usprawiedliwienie morderstwa lub wojny."
VO_Credits_Credits_020_070="To jest ścieżka, którą prowadziła nas Księżniczka. I tą ścieżką będziemy podążać."
VO_Credits_Credits_030_010="Właśnie otrzymałem wiadomość od generała Halla, że UEF uznała niepodległość Cybran. O, tak. Teraz możemy sami decydować o swoim życiu i kierować nim tak, jak tylko zechcemy."
VO_Credits_Credits_030_020="Hall zaproponował również zawarcie trwałego przymierza naszych dwóch narodów. Propozycję tę jednak, z ciężkim sercem, w chwili obecnej odrzuciłem."
VO_Credits_Credits_030_030="Moje dzieci, jesteśmy wolni. Ale co oznacza ta wolność? Czy mamy opuścić naszych ludzi i sprzymierzyć się z potworami? Czy mamy porzucić naszych braci i siostry z powodu egoizmu i chciwości?"
VO_Credits_Credits_030_040="Czy może oznacza to, że na naszych barkach spoczywa odpowiedzialność za bycie wolnymi i musimy ją znosić z pokorą i godnością? Że musimy przedłożyć nasze wspólne dobro nad dobro jednostki? O, tak. Właśnie to oznacza dla mnie wolność. Dla wszystkich nas."
VO_Credits_Credits_030_050="Musimy koniecznie naprawić zniszczenia wewnątrz narodu Cybran. Wszystkie węzły muszą żyć w pokoju i harmonii. O, tak. Żyć w pokoju."
VO_Credits_Credits_030_060="Ale to nie wszystko. Zawsze jest coś więcej, co wymaga pracy."
VO_Credits_Credits_030_070="Będziemy dalej pomagać naszej siostrze, Rhizie, gdziekolwiek to możliwe. Jej walka jest naszą walką. Musimy wybaczyć. Pomagać tym, którzy niegdyś byli naszymi największymi wrogami."
VO_Credits_Credits_030_080="To jest droga postępu. O, tak. To jest droga postępu"
VO_Credits_Credits_030_090="Bądźcie bezpieczne, moje dzieci. Bądźcie bezpieczne."
VO_Credits_Credits_040_010="AAAACHHHH!"
