X01_B01_000_010="711338"
X01_B01_001_010="Nie wiem jak to się stało, do cholery, ale te skurczybyki nas znalazły. Desantowali się na planetę i atakują Fort Clarke i cywilne budynki leżące nieopodal."
X01_B01_002_010="To nasz koniec, dowódco. Fort Clarke jest naszą ostatnią bazą a wszystkie drogi ucieczki zostały odcięte. Jeśli dzisiaj zawiedziemy, nic nie przeszkodzi Seraphimom i ich sługusom w zabiciu każdego człowieka w galaktyce."
X01_B01_002_020="Nie mamy innego wyboru jak okopać się i utrzymać tę linię. Generał Fletcher jest już na planecie i dowodzi obroną Fortu Clarke. Chcemy otworzyć drugi front, dlatego udasz się na południe od jego pozycji."
X01_B01_002_030="To twoja strefa lądowania. W okolicy znajduje się kilka baz Zakonu, które zapewniają wsparcie siłom Zakonu atakującym Fort Clarke. Zniszczysz wszystkie budynki Zakonu, a następnie przemieścisz się w głąb lądu."
X01_B01_002_040="Podążaj na północ, aż spotkasz się Fletcherem. Kiedy już przerwiecie oblężenie Fortu Clarke, razem zaatakujecie i zniszczycie dowódcę Seraphimów."
X01_B01_003_010="Zwycięstwo jest jedynym wyjściem, dowódco."
X01_DB01_010_010="[{i Hall}]: Było ciężko, ale udało ci się, dowódco. Fort Clarke jest bezpieczny, a my odnieśliśmy znaczące zwycięstwo nad tymi cholernymi obcymi i ich sojusznikami. Od dzisiaj przestajemy przed nimi uciekać. Jeśli mamy przeżyć, musimy być w stanie przenieść walkę na ich terytorium. I właśnie to zrobimy."
X01_DB01_020_010="[{i Kael}]: Do wszystkich dowódców Zakonu: Fort Clarke został zdobyty, resztki struktur dowódczych UEF zostały zniszczone, a Koalicja jest już historią. To wielki dzień dla Zakonu Illuminate! Zwyciężyliśmy!"
X01_M01_010_010="[{i HQ}]: W tej strefie lądowania będzie gorąco, dowódco. Przygotuj się na prawdziwe piekło. Bez odbioru."
X01_M01_011_010="[{i HQ}]: Baza jest chroniona przez linię artylerii przeciwnika. To cele dodatkowe, ale jeśli je zniszczysz, twoje życie stanie się dużo prostsze.\n"
X01_M01_012_010="[{i HQ}]: Kiedy rozprawisz się z główną baza przeciwnika, przekażemy ci dalsze... cholera, nadlatują śmigłowce przeciwnika. Musimy przetransportować cię, dopóki mamy taką możliwość.\n"
X01_M01_013_010="[{i HQ}]: Cholera, atakują Bramę. Transportuj się na planetę póki jeszcze możesz!\n"
X01_M01_014_010="[{i HQ}]: To było odrobinę zbyt niebezpieczne. Ledwo nam się udało. Zajmij się tym, dowódco.\n"
X01_M01_020_010="[{i HQ}]: Masz już swój pierwszy cel: zniszcz bazy znajdujące się na klifach i przejdź w głąb lądu. Odbieram też odczyty kilku stanowisk artylerii na północ od twoich pozycji. To dodatkowe cele - zniszcz je, jeśli będziesz w stanie. Bez odbioru."
X01_M01_021_010="[{i HQ}]: Odczyty wskazują tez na kilka pozycji artylerii przeciwnika. To cele dodatkowe, ale jeśli je zniszczysz, twoje życie stanie się dużo prostsze."
X01_M01_030_010="[{i Fletcher}]: Właśnie wpadłeś w sam środek piekła, pułkowniku, ale cieszę się, że tu jesteś."
X01_M01_031_010="[{i Rhiza}]: Dajemy ci Szybki Wiatr, myśliwiec bojowy średniego zasięgu. Rhiza bez odbioru.\n"
X01_M01_032_010="[{i Rhiza}]: Dowódco, otrzymałeś właśnie schematy konstrukcyjne Płomienia. Jest słabo opancerzony, ale ma niezłą siłę ognia. Rhiza bez odbioru.\n"
X01_M01_040_010="[{i Fletcher}]: Cybranin, hę? Myślałem, że będziecie zajęci zmienianiem wody w zbiorniku z mózgiem Brackmana."
X01_M01_040_020="[{i Dostya}]: Zignoruj go, dowódco. Skup się na nadchodzącej bitwie. Dostya, bez odbioru."
X01_M01_050_010="[{i Fletcher}]: Będę miał na ciebie oko, Aeonie. Nie zapomniałem, co twoi ludzie zrobili w czasie wojny."
X01_M01_050_020="[{i Rhiza}]: Nie zwracaj na niego uwagi, Orędowniku. Przynieś chwałę Księżniczce."
X01_M01_060_010="[{i Gari}]: Dzisiaj Koalicja upadnie. Nikt nie umknie przed naszym gniewem."
X01_M01_070_010="[{i HQ}]: Właśnie ładujemy schematy konstrukcji Parsifala do twojej OJD; to szturmowy bot oblężniczy, zmodyfikowany tak, aby mógł poruszać się w wodzie. Bez odbioru"
X01_M01_080_010="[{i HQ}]: Właśnie ładujemy schematy konstrukcji Cegły do twojej OJD; to szturmowy robot oblężniczy, zmodyfikowany tak, aby mógł poruszać się w wodzie. Kolejna specjalność Brackmana. Bez odbioru."
X01_M01_090_010="[{i Fletcher}]: Naprawdę przydałaby mi się pańska pomoc, pułkowniku. Niech pan zniszczy te bazy tak szybko, jak to możliwe."
X01_M01_100_010="[{i Fletcher}]: Nie możemy się spotkać, dopóki te bazy nie zostaną zniszczone."
X01_M01_105_010="[{i Fletcher}]: Przestań się obijać i zniszcz te bazy!"
X01_M01_106_010="[{i Fletcher}]: Przydaj się na coś i zniszcz te bazy."
X01_M01_110_010="[{i Fletcher}]: Zaczynam myśleć, że nie masz dość ikry, żeby walczyć za własna rasę. Zniszczysz w końcu te bazy czy nie?"
X01_M01_116_010="[{i Fletcher}]: Fort Clarke upadnie, jeśli nie weźmiesz się do roboty. Zniszcz te bazy!"
X01_M01_117_010="[{i Hall}]: Dowódco, musisz jak najszybciej przedostać się w głąb lądu. Od tego zależą życia niezliczonej ilości istot."
X01_M01_118_010="[{i Rhiza}]: Dowódca Zakonu imieniem Gari oczekuje cię, Orędowniku. Jest jednym z najpilniejszych uczniów Egzaminatorki Kael; zabij ją w imię Księżniczki. Bez odbioru."
X01_M01_120_010="[{i HQ}]: Północna baza została zniszczona. Bez odbioru."
X01_M01_130_010="[{i HQ}]: Południowa baza poszła z dymem. Bez odbioru."
X01_M01_140_010="[{i HQ}]: To były te dwie bazy. Przedostań się w głąb lądu. Bez odbioru."
X01_M01_160_010="[{i HQ}]: Pierwsze stanowisko artylerii zniszczone. Bez odbioru."
X01_M01_170_010="[{i HQ}]: Potwierdzam zniszczenie drugiego stanowiska artylerii. Bez odbioru."
X01_M01_180_010="[{i HQ}]: Kolejne stanowiska artylerii stoją w płomieniach. Zostało już tylko jedno. Bez odbioru."
X01_M01_190_010="[{i HQ}]: Dobra robota, to było czwarte. Bez odbioru."
X01_M01_200_010="[{i HQ}]: To było ostatnie z nich - wszystkie stanowiska artylerii zniszczone. Bez odbioru."
X01_M01_210_010="[{i HQ}]: Niektóre z tych stanowisk artylerii dalej prowadzą ostrzał. Bez odbioru."
X01_M01_220_010="[{i HQ}]: Artyleria Zakonu ciągle działa. Bez odbioru."
X01_M01_230_010="[{i HQ}]: Ta szalona jędza atakuje miasta. Powstrzymaj ją. Bez odbioru."
X01_M01_240_010="[{i HQ}]: Łodzie podwodne przeciwnika działają na obszarze na północ od twojej strefy lądowania, dowódco. Zniszcz je. Bez odbioru."
X01_M01_250_010="[{i HQ}]: Dobra robota. Łodzie podwodne nie będą ci już przeszkadzać, możesz więc przygotować natarcie na pozycje Zakonu w głębi lądu. Bez odbioru."
X01_M01_260_010="[{i HQ}]: Ten uszkodzony generator tarcz ochroni cię przed pociskami wroga. Napraw go. Bez odbioru."
X01_M01_270_010="[{i HQ}]: Doskonale. Tarcza została całkowicie naprawiona i działa z pełną wydajnością. Bez odbioru."
X01_M01_280_010="[{i HQ}]: Na co, do cholery, czekasz? Wybierz swoją OJD w tej chwili.\n"
X01_M01_290_010="[{i HQ}]: Dowódco, wybierz swoją OJD.\n"
X01_M01_OBJ_010_010="Zniszcz bazy Zakonu"
X01_M01_OBJ_010_020="Dowódca Zakonu założył dwie bazy na północnej wyspie. Zniszcz wszystkie fabryki w każdej z tych baz, aby mieć pewność, że nie opóźnią naszej ofensywy."
X01_M01_OBJ_010_030="Eskortuj ciężarówki."
X01_M01_OBJ_010_035="Rozkaż konwojowi cywili udać się we wskazane miejsce."
X01_M01_OBJ_010_040="Zabij Incarnasa."
X01_M01_OBJ_010_045="Poproś Fletchera o atak artyleryjski jego Mavorsów.\n"
X01_M01_OBJ_020_010="Zniszcz stanowiska artylerii Zakonu"
X01_M01_OBJ_020_020="Dowódca Zakonu ustawił artylerię nad kanałem. Zniszczenie jej znacznie ułatwi twoją przeprawę."
X01_M01_OBJ_020_030="Napraw generator tarczy"
X01_M01_OBJ_020_040="Napraw pobliski generator tarczy. Kiedy będzie sprawny, zapewni ci maksymalną ochronę przed wrogim ostrzałem."
X01_M01_OBJ_020_050="Zabezpiecz kanał"
X01_M01_OBJ_020_060="Zniszcz łodzie podwodne przeciwnika, które patrolują kanał."
X01_M02_010_010="[{i HQ}]: Oficer Graham na linii. Przełączam go."
X01_M02_010_020="[{i Graham}]: Dowódco, jednostki Zakonu przełamały naszą obronę. Zostaliśmy odcięci od Fortu Clarke i generał Fletcher nie może wysłać do nas uzupełnień. Potrzebujemy twojej pomocy."
X01_M02_010_030="[{i Hall}]: Zmiana planów, dowódco. Fletcher będzie musiał jeszcze przez chwilę sam bronić Fortu Clarke - twoim zadaniem jest ochrona cywilów i zniszczenie wszystkich jednostek wroga na tym terenie."
X01_M02_010_040="[{i Gari}]: Oczyszczę wszystkich na tej planecie! Jesteście głupcami, skoro stajecie przeciwko mojej potędze!"
X01_M02_011_010="[{i Graham}]: Dowódco, jednostki Zakonu przełamały naszą obronę. Zostaliśmy odcięci od Fortu Clarke i generał Fletcher nie może wysłać do nas uzupełnień. Potrzebujemy twojej pomocy."
X01_M02_012_010="[{i Hall}]: Zmiana planów, dowódco. Fletcher będzie musiał jeszcze przez chwilę sam bronić Fortu Clarke - twoim zadaniem jest ochrona cywilów i zniszczenie wszystkich jednostek wroga na tym terenie."
X01_M02_013_010="[{i Gari}]: Oczyszczę wszystkich na tej planecie! Jesteście głupcami, skoro stajecie przeciwko mojej potędze!"
X01_M02_020_010="[{i Hall}]: Ta psychopatka niebezpiecznie zbliża się do cywili, dowódco. Powstrzymaj ją."
X01_M02_030_010="[{i Hall}]: Chroń cywili!"
X01_M02_035_010="[{i Graham}]: Wróg nas ostrzeliwuje, dowódco. Nie wytrzymamy zbyt długo. Proszę, zrób coś!"
X01_M02_035_020="[{i Hall}]: Chroń te budynki, dowódco!"
X01_M02_035_030="[{i Gari}]: Ci ludzie będą wspaniałą ofiarą dla naszych bogów!."
X01_M02_036_010="[{i Hall}]: Nie możemy stracić tych schronów, dowódco."
X01_M02_037_010="[{i Graham}]: Strzelają do nas ze wszystkich kierunków! Boże, pomóż nam..."
X01_M02_038_010="[{i Graham}]: Potrzebujemy pomocy, dowódco!"
X01_M02_039_010="[{i Graham}]: Cywile są bezpieczni. Na zawsze będę twoim dłużnikiem, dowódco."
X01_M02_040_010="[{i Graham}]: Och, nie.. zabili wszystkich..."
X01_M02_041_010="[{i Graham}]: Na razie schrony są bezpieczne, pułkowniku, ale chyba nie wytrzymają kolejnego ataku. Jeśli zakon znowu nas zaatakuje..."
X01_M02_041_020="[{i Graham}]: Mamy kolejny problem, pułkowniku. Na wschód od twoich pozycji znajduje się drugie miasto. GD Zakonu jeszcze go nie zaatakował, ale to może być tylko kwestią czasu. Musisz ochronić to miasto."
X01_M02_041_022="[{i Hall}]: Chcę, aby ci cywile stąd znikli, pułkowniku. Oficer Graham udostępni ci grupę ciężarówek; użyj ich, aby ewakuować cywili do centrum miasta."
X01_M02_041_025="[{i HQ}]: Musisz powiedzieć tym ciężarówkom, gdzie mają jechać. Kliknij Sygnał Dowodzenia po lewej stronie HUD, poniżej Celów misji, a następnie kliknij w miejscu, do którego mają udać się ciężarówki. Bez odbioru."
X01_M02_041_030="[{i Gari}]: Moje skanery pokazują zbliżająca się kolumnę ciężarówek. Bez wątpienia pojazdy cywilne. Upolowanie ich będzie prawdziwą przyjemnością."
X01_M02_042_010="[{i Hall}]: Trzeba ewakuować tych cywilów, pułkowniku. Konstabl Graham udostępni kilka ciężarówek, z których możesz skorzystać, by ewakuować centrum miasta."
X01_M02_042_020="[{i HQ}]: Musisz nakazać tym ciężarówkom dokąd i kiedy mają ruszyć. Kliknij przycisk sygnału dowodzenia po lewej stronie kokpitu, poniżej listy zadań. Potem kliknij na ziemi w miejscu, w które dotrzeć mają ciężarówki. Bez odbioru."
X01_M02_043_010="[{i Graham}]: Schronienia są chwilowo bezpieczne, pułkowniku, ale nie sądzę, żeby przetrwały następny atak. Jeśli dowódca Zakonu ponownie uderzy…"
X01_M02_044_010="[{i Gari}]: Moje skany wskazują, że włącza się grupa ciężarówek. Są na pewno pełne cywilów. Chętnie ich upoluję."
X01_M02_045_010="[{i HQ}]: Zbliżają się wrogie jednostki morskie, pułkowniku. Zatop je zanim zaczną ostrzeliwać miasto. Bez odbioru."
X01_M02_046_010="[{i Graham}]: Nie wierzę... całe miasto zostało stracone.\n"
X01_M02_047_010="[{i HQ}]: Zbliżają się wrogie jednostki morskie, pułkowniku. Zatop je zanim zaczną atak. Bez odbioru."
X01_M02_050_010="[{i Hall}]: Ciężarówka znajduje się na otwartym terenie, pułkowniku. Zabierz ją stamtąd."
X01_M02_060_010="[{i Graham}]: Dowódco, musimy przemieścić te ciężarówki w bezpieczne miejsce!"
X01_M02_070_010="[{i Graham}]: Ciężarówki są narażone na atak, pułkowniku!"
X01_M02_075_010="[{i HQ}]: Ciężarówki są atakowane."
X01_M02_077_010="[{i HQ}]: Dowódca zakonu atakuje ciężarówki."
X01_M02_080_010="[{i Graham}]: Straciliśmy jedną z ciężarówek!"
X01_M02_090_010="[{i Graham}]: Zniszczyli kolejną ciężarówkę... Pułkowniku, proszę, niech pan chroni cywili!"
X01_M02_100_010="[{i Graham}]: Och nie... kolejna ciężarówka została zniszczona. Nie możemy stracić już żadnej więcej!"
X01_M02_160_010="[{i Graham}]: Cywile zginęli... nikt nie przeżył..."
X01_M02_160_020="[{i Gari}]: Ha-ha-ha!"
X01_M02_161_010="[{i Gari}]: Ha-ha-ha!"
X01_M02_170_010="[{i Graham}]: Ciężarówka dotarła do centrum miasta, sir."
X01_M02_180_010="[{i Graham}]: Kolejna ciężarówka jest bezpieczna."
X01_M02_190_010="[{i Graham}]: Wszystkie ciężarówki dotarły na miejsce i właśnie transportujemy cywili w bezpieczne miejsce. Nie wiem jak mam panu dziękować pułkowniku."
X01_M02_200_010="[{i Graham}]: Zbyt wiele ciężarówek zniszczonych... to koniec..."
X01_M02_210_010="[{i Hall}]: Dobra robota pułkowniku. Jestem cholernie dumny, że jest pan członkiem UEF."
X01_M02_240_010="[{i HQ}]: To jeszcze nie koniec, dowódco. Skany pokazują jednostki Zakonu przegrupowujące się do kontrataku z północnego-wschodu. Bez odbioru."
X01_M02_240_020="[{i HQ}]: Dowódca Zakonu rozpoczęła atak. Będzie bardzo nieprzyjemnie. Bez odbioru."
X01_M02_245_010="[{i HQ}]: Dowódca Zakonu ustawia roboty snajperskie na pozycjach. Są szybkie i mają niezłą siłę ognia, ale ich zbroje są do niczego. Bez odbioru."
X01_M02_250_010="[{i Gari}]: Po tak długim czasie, w końcu widzę kres UEF. Długo czekałam na ten dzień."
X01_M02_250_020="[{i Hall}]: Będziemy walczyć do samego końca."
X01_M02_260_010="[{i Gari}]: Kiedy skończę z wami, odszukam i zniszczę waszego ukochanego dr. Brackmana. I nikt mnie nie powstrzyma."
X01_M02_260_020="[{i Dostya}]: Będziemy walczyć do ostatniego tchu."
X01_M02_270_010="[{i Gari}]: Porzuciliście swój lud, swoje dziedzictwo i swoich bogów. Za to zostaniecie zniszczeni."
X01_M02_270_020="[{i Rhiza}]: Wasz fanatyzm sprawił, że wypaczyliście \"Drogę\". Za to zostaniecie zniszczeni."
X01_M02_280_010="[{i HQ}]: Kontratak został odparty. Bez odbioru."
X01_M02_281_010="[{i HQ}]: Galaktyczny kolos zbliża się do twoich pozycji. Zajmij się nim. Bez odbioru.\n"
X01_M02_290_010="[{i Hall}]: Dowódca Zakonu sprawiła nam wystarczająco dużo problemów--zaatakuj jej pozycje i zniszcz ją."
X01_M02_290_020="[{i HQ}]: Słyszałeś, co powiedział, dowódco. Przedostań się w głąb lądu i zaatakuj Gari."
X01_M02_290_030="[{i HQ}]: I jeszcze jedna rzecz: Odbieram prośby o pomoc z kilku małych miast znajdujących się na twojej drodze. Pomóż im, jeśli będziesz w stanie, ale zniszczenie Gari jest najważniejsze."
X01_M02_320_010="[{i HQ}]: To był piękny widok. Może następny dowódca Zakonu będzie mniej kłapać jadaczką. Bez odbioru."
X01_M02_330_010="[{i Rhiza}]: Kael wpadnie w szał, kiedy się o tym dowie! Chwała Księżniczce! Rhiza, bez odbioru."
X01_M02_340_010="[{i HQ}]: Wygląda na to, że Gari wysyła komitet powitalny.   "
X01_M02_350_010="[{i HQ}]: Zakładając, że to przeżyjesz, udaj się tam i zniszcz Gari raz na zawsze. Bez odbioru."
X01_M02_360_010="[{i HQ}]: Chroń to miasto, dowódco. Bez odbioru.\n"
X01_M02_370_010="[{i HQ}]: Musisz przemieścić te ciężarówki w bezpieczne miejsce, dowódco. Bez odbioru.\n"
X01_M02_380_010="[{i HQ}]: Czekasz na specjalne zaproszenie czy jak? Chodź tutaj i zniszcz tego dowódcę Zakonu. Bez odbioru.\n"
X01_M02_390_010="[{i Dostya}]: Czas działa na naszą niekorzyść. Musisz zniszczyć tego dowódcę Zakonu. Dostya, bez odbioru."
X01_M02_400_010="[{i Rhiza}]: Gari zhańbiła nas wszystkich. Zniszcz ją. Rhiza, bez odbioru.\n"
X01_M02_410_010="[{i HQ}]: Wygląda na to, że ten kosmita wystrzelił atomówkę. Trajektoria lotu wskazuje, że celem jest miasto na wschodzie. Bez odbioru.\n"
X01_M02_420_010="[{i Graham}]: Wystrzelili atomówkę! Jeśli trafi miasto na wschodzie, miliony istnień będą stracone!\n"
X01_M02_OBJ_010_010="Chroń miasto"
X01_M02_OBJ_010_020="Dowódca Zakonu atakuje miasto. 50% budynków cywilnych musi zostać w stanie nienaruszonym."
X01_M02_OBJ_010_030="Przetrwaj kontratak Zakonu"
X01_M02_OBJ_010_040="Zakon rozpoczął potężny kontratak! Musisz przetrwać to natarcie, a potem zaatakować dowódcę Zakonu."
X01_M02_OBJ_010_050="Pokonaj Dowódcę Zakonu"
X01_M02_OBJ_010_060="Jeśli mamy ocalić Griffin IV, dowódca Zakonu musi zostać pokonany. Jego baza znajduje się na północnym wschodzie."
X01_M02_OBJ_010_070="Zniszcz bazę Zakonu"
X01_M02_OBJ_010_080="Zniszcz fabryki znajdujące się na terenie bazy Zakonu."
X01_M02_OBJ_020_010="Chroń wschodnie miasto"
X01_M02_OBJ_020_020="Chroń miasto na wschodzie. Przynajmniej 50% miasta musi przetrwać."
X01_M02_OBJ_020_030="Ewakuuj wschodnie miasto"
X01_M02_OBJ_020_040="Miasto nie jest już bezpieczne. Pozostali przy życiu cywile zostali umieszczeni w ciężarówkach i muszą zostać przetransportowani do miasta na zachodzie. 6 z 10 ciężarówek musi bezpiecznie dotrzeć do celu. Kliknij Sygnał Ruchu a potem na ziemi, aby wydać ciężarówkom rozkaz ruchu. Sygnał Ruchu będzie się odnawiał zgodnie z potrzebami. To zadanie nie jest wymagane do ukończenia misji. Wykonaj je, jeśli będziesz w stanie."
X01_M02_OBJ_020_050="Chroń budynki cywilne III (UEF)"
X01_M02_OBJ_020_060="Chroń budynki cywilne III (UEF)"
X01_M03_010_010="[{i HQ}]: Fort Clarke znajduje się na północnym zachodzie, a dowódca Seraphimów na północnym wschodzie. Ten obcy jest pewnie nieźle zdenerwowany, że zabiłeś jego małe kochanie, więc musisz być przygotowany na wszystko. Fort Clarke musi zostać utrzymany. Bez odbioru."
X01_M03_020_010="[{i Fletcher}]: Jednostki Seraphimów przedostały się przez moje linie obrony, pułkowniku, i atakują strategiczne zasoby."
X01_M03_030_010="[{i Fletcher}]: Seraphimowie nacierają! Potrzebuję pomocy!"
X01_M03_040_010="[{i Fletcher}]: Przytargaj tu swoją zadrutowaną dupę i pomóż bronić Fortu!!"
X01_M03_050_010="[{i Fletcher}]: Pomóż mi bronić fortu, Cybraninie!"
X01_M03_060_010="[{i Fletcher}]: Przestań się obijać i przyślij tu jakieś uzupełnienia! Fort mocno obrywa!"
X01_M03_070_010="[{i Fletcher}]: Fort Clarke jest atakowany! Potrzebuję więcej jednostek! I to szybko!"
X01_M03_080_010="[{i Fletcher}]: Strzelają do nas jak do kaczek, pułkowniku. Naprawdę przydałaby się nam pomoc!"
X01_M03_090_010="[{i Fletcher}]: Tu generał brygady Fletcher! Proszę o wsparcie! Jesteśmy pod ciężkim ostrzałem Seraphimów!"
X01_M03_100_010="[{i Fletcher}]: Gdzie są moje posiłki?"
X01_M03_120_010="[{i Fletcher}]: To kosmiczne dziwadło jest dokładnie na wschód od moich pozycji. Zaatakuj jej pozycję od południa, a ja ruszę od zachodu. Nie da rady obronić dwóch frontów na raz."
X01_M03_122_010="[{i Fletcher}]: To kosmiczne dziwadło jest dokładnie na wschód od moich pozycji. Jego eksperymentalne jednostki kręcą się po okolicy - je też musimy zniszczyć. Zaatakuj jego pozycje od południa, a ja ruszę od zachodu. Nie da rady obronić dwóch frontów na raz."
X01_M03_130_010="[{i Fletcher}]: Masz zamiar się obijać? Boisz się pobrudzić, czy co? Seraphim jest na wschód ode mnie. Zaatakuj go."
X01_M03_130_020="[{i Dostya}]: Pokonaj Seraphima, dowódco. Pokaż temu idiocie jak walczą Cybranie. Dostya, bez odbioru."
X01_M03_133_010="[{i Fletcher}]: Masz zamiar się obijać? Boisz się pobrudzić czy co? Seraphim jest na wschód ode mnie i ma kilka eksperymentalnych jednostek. Zniszcz je."
X01_M03_133_020="[{i Dostya}]: Pokonaj Seraphima i jego eksperymentalne jednostki, dowódco. Pokaż temu idiocie jak walczą Cybranie. Dostya, bez odbioru."
X01_M03_140_010="[{i Fletcher}]: Najwyższy czas! Seraphim jest na wschód od Fortu Clarke. Przydaj się na coś i postaraj się zwrócić jego uwagę."
X01_M03_140_020="[{i Rhiza}]: On nie zna twojej prawdziwej wartości, Orędowniku. Pokaż mu naszą potęgę, pokonując Seraphima. Rhiza, bez odbioru."
X01_M03_142_010="[{i Fletcher}]: Najwyższy czas! Seraphim jest na wschód od Fortu Clarke i ma zgraję jednostek eksperymentalnych. Przydaj się na coś i postaraj się zwrócić jego uwagę."
X01_M03_142_020="[{i Rhiza}]: On nie zna twojej prawdziwej wartości, Orędowniku. Pokaż mu naszą potęgę, pokonując Seraphima i jego jednostki. Rhiza, bez odbioru."
X01_M03_150_010="[{i HQ}]: Nasi technicy właśnie uruchomili broń wiązkową umieszczoną na satelicie. Kliknij Sygnał Dowodzenia po lewej stronie HUD, a następnie kliknij cel. Resztą zajmiemy się my."
X01_M03_160_010="[{i HQ}]: Niech to szlag, system chłodzenia padł. Nie będziemy mogli strzelić ponownie. Bez odbioru."
X01_M03_170_010="[{i Fletcher}]: Uwielbiam taki widok. Płoń, dziecinko, płoń!"
X01_M03_180_010="[{i Fletcher}]: Czekasz na medal czy jak? Ta bitwa się jeszcze nie skończyła."
X01_M03_190_010="[{i Fletcher}]: Może wy, dziwadła, chcecie walczyć."
X01_M03_200_010="[{i Fletcher}]: Seraphim ciągle żyje, pułkowniku. Zróbmy coś z tym."
X01_M03_210_010="[{i Fletcher}]: Musimy wyeliminować tego Seraphima, pułkowniku."
X01_M03_220_010="[{i Fletcher}]: Ruszcie się trochę, Cybranie! Musimy pozbyć się tego Seraphima!"
X01_M03_230_010="[{i Fletcher}]: Czekasz, aż ten kosmita umrze ze starości?"
X01_M03_240_010="[{i Fletcher}]: Chodź tutaj i pomóż mi załatwić tego Seraphima."
X01_M03_250_010="[{i Fletcher}]: Czekasz, aż ten Seraphim umrze ze starości?"
X01_M03_260_010="[{i Fletcher}]: Ten kosmiczny dziwak mięknie. Traf go jeszcze raz!"
X01_M03_270_010="[{i Fletcher}]: Teraz go mamy."
X01_M03_280_010="[{i Fletcher}]: Długo już nie wytrzyma. Niech zapłaci za to, co zrobili na Ziemi."
X01_M03_290_010="[{i HQ}]: Fletcher, duża jednostka eksperymentalna zbliża się do Fortu Clarke. Ten kosmita jeszcze żyje. Bez odbioru."
X01_M03_290_020="[{i Fletcher}]: Widzę go! Dowódco, wal w niego wszystkim, co masz!!"
X01_M03_292_010="[{i HQ}]: Było cholernie blisko. Pozbądź się dowódcy Seraphimów, zanim wyśle kolejnego. Nie jestem pewien, czy wytrzymamy kolejny taki atak. Bez odbioru."
X01_M03_295_010="[{i ShunUllevash}]: Cholerni ludzie - nigdy nas nie pokonacie!"
X01_M03_297_010="[{i Hall}]: Siły przeciwnika zostały pokonane i Fort Clarke jest bezpieczny. Dobra robota, dowódco. To zwycięstwo jest dla nas bardzo ważne."
X01_M03_300_010="[{i Hall}]: Utrzymaj pozycje, pułkowniku! Musimy chronić cywili. Hall, bez odbioru."
X01_M03_310_010="[{i Rhiza}]: Okazało się, że Gari tylko dużo gada. Zlokalizuj Seraphima i zniszcz go. Strata obu w ciągu jednego dnia rozwścieczy Kael i poprawi morale Lojalistów. Rhiza, bez odbioru."
X01_M03_OBJ_010_010="Fort Clarke musi przetrwać"
X01_M03_OBJ_010_020="Generał Hall i inni wysocy rangą członkowie sztabu przebywają w Budynku Administracyjnym. Za wszelką cenę muszą być chronieni! Jeśli Budynek Administracyjny zostanie zniszczony, UEF upadnie."
X01_M03_OBJ_010_030="Zniszcz dowódcę Seraphimów i jego eksperymentalne jednostki"
X01_M03_OBJ_010_040="Pokaż kosmicie, że nie może bezkarnie atakować samego serca UEF. Pokonaj jego i jednostki eksperymentalne, którymi dowodzi. Jego baza znajduje się na wschód od Fortu Clarke."
X01_M03_OBJ_010_050="Zniszcz jednostki eksperymentalne przeciwnika"
X01_M03_OBJ_010_060="Wrogie jednostki eksperymentalne przeciwnika stanowią poważne zagrożenie dla Fortu Clarke. Zniszcz je za wszelką cenę."
X01_T01_001_010="[{i Gari}]: Nie pozwolę ci skonstruować tej jednostki eksperymentalnej."
X01_T01_002_010="[{i Gari}]: Nie, nie ukończysz tej jednostki eksperymentalnej."
X01_T01_003_010="[{i Gari}]: Jednostka eksperymentalna? Nie jestem taka głupia, żeby pozwolić ci ją ukończyć."
X01_T01_010_010="[{i Gari}]: Nigdy nie dotrzesz do Fortu Clarke."
X01_T01_020_010="[{i Gari}]: Zbliżam się do twojego ukochanego Fortu Clarke. Wkrótce stanie on w płomieniach."
X01_T01_030_010="[{i Gari}]: Odwlekasz jedynie nieuniknione. Oczyszczę populacje cywili."
X01_T01_040_010="[{i Gari}]: Twoja nieustępliwość jest godna podziwu, ale wynik tej bitwy został przesądzony dawno temu."
X01_T01_050_010="[{i Gari}]: Może i mnie powstrzymałeś, ale nie masz szans pokonać Seraphima."
X01_T01_060_010="[{i Gari}]: Teraz poznasz prawdziwy gniew Zakonu Illuminate."
X01_T01_070_010="[{i Gari}]: Nie masz dokąd uciec ani gdzie się schować."
X01_T01_080_010="[{i Gari}]: Ta planeta podzieli los Ziemi."
X01_T01_090_010="[{i Gari}]: Twoja Księżniczka nie żyje. Pozostał tylko Zakon Illuminate."
X01_T01_100_010="[{i Gari}]: Nawet najpotężniejsza broń nie jest w stanie mnie powstrzymać."
X01_T01_110_010="[{i Gari}]: Błagaj o litość, a być może pozwolę ci umrzeć z honorem."
X01_T01_120_010="[{i Gari}]: UEF jest skończone. Tym razem nie ma przed nami ucieczki."
X01_T01_130_010="[{i Gari}]: Kiedy Fort Clarke upadnie, oczyszczę każdą osobę na tej planecie."
X01_T01_140_010="[{i Gari}]: Brackman to zdziecinniały, stary głupiec."
X01_T01_150_010="[{i Gari}]: Jesteś wybrykiem natury. Pozbycie się ciebie sprawi mi prawdziwą przyjemność."
X01_T01_160_010="[{i Gari}]: Jesteś głupcem, odrzucając Seraphimów."
X01_T01_170_010="[{i Gari}]: Teraz prowadzi nas Zakon. Twoja Księżniczka jest niczym więcej, jak tylko wyblakłym wspomnieniem."
X01_T01_175_010="[{i Gari}]: Księżniczka nie żyje."
X01_T01_180_010="[{i Gari}]: Zakon jest wieczny. Nikt nas nie powstrzyma."
X01_T01_190_010="[{i Gari}]: Seraphimowie nigdy nie zostaną pokonani!"
X01_T01_200_010="[{i Fletcher}]: Czas zabrać się za to na poważnie."
X01_T01_210_010="[{i Fletcher}]: Zapłacicie za to, co zrobiliście z Ziemią, dziwadła."
X01_T01_220_010="[{i Fletcher}]: Dowódco, przydałaby mi się pomoc. Mocno obrywamy."
X01_T01_230_010="[{i Fletcher}]: Mam poważne kłopoty!"
X01_T01_240_010="[{i Fletcher}]: Chyba żartujesz!"
X01_T01_250_010="[{i Seraphim}]: (Śmiech)"
X01_T01_260_010="[{i ShunUllevash}]: [Język nierozpoznany]"
X01_T01_270_010="[{i ShunUllevash}]: [Język nierozpoznany]"
X01_T01_280_010="[{i ShunUllevash}]: [Język nierozpoznany]"
X01_T01_290_010="[{i ShunUllevash}]: [Język nierozpoznany]"
X02_B01_000_010="711341"
X02_B01_001_010="Ponad rok temu, Lojaliści Aeonu potajemnie przeniknęli do struktur Zakonu. Ich wysiłki umożliwiły nam zdobycie ważnych informacji, a ponadto pomogli nam ogłosić prawdę i słowa Księżniczki."
X02_B01_002_010="Jednak w tej chwili cała siatka Lojalistów jest w śmiertelnym niebezpieczeństwie."
X02_B01_002_020="QAI używał Copernicusa, jako bazy wypadowej do ataków na tereny Koalicji. Aby ograniczyć te ataki, grupa Lojalistów rozpoczęła tajną operację wymierzoną w QAI."
X02_B01_003_010="Operacja nie powiodła się. QAI wiedział o nadchodzącym ataku i pojmał trzech przywódców Lojalistów. Z doświadczenia wiemy, że QAI wszczepi im implanty sztucznej inteligencji. Jeśli to się stanie, cała tajna siec Lojalistów znajdzie się w śmiertelnym niebezpieczeństwie."
X02_B01_004_010="Znaczenie tej misji jest trudne do przecenienia, dowódco. Oczywistym jest, że nasze procedury tajności zostały złamane. Nie ma innej możliwości, żeby nasi przeciwnicy znali jednocześnie tajną lokalizację Fortu Clarke i wiedzieli o naszych tajnych działaniach na tej planecie."
X02_B01_004_020="Trzeba zając się tą sytuacją, zanim wymknie się spod kontroli."
X02_B01_004_030="Lojaliści dalej działają na planecie, ale nie byli w stanie zorganizować misji ratunkowej. Zostaniesz przetransportowany w to miejsce, wzmocnisz ich pozycje, a następnie uratujesz przywódców Lojalistów przetrzymywanych przez QAI."
X02_B01_004_040="Kiedy już będą bezpieczni, zniszczysz bazę QAI. Ta piekielna maszyna jest wspomagana przez dowódcę Zakonu imieniem Celene. Niegdyś była całym sercem oddana Księżniczce, ale padła ofiarą kłamstw Kael."
X02_B01_005_010="Szpieg Lojalistów imieniem Thalia będzie twoim kontaktem na planecie. Przekaże ci więcej informacji na miejscu. Wyruszasz natychmiast."
X02_B01_005_020="Uważaj na siebie, dowódco. Szczęśliwych łowów."
X02_D01_020_010="[{i Celene}]: Czekaj! Nie jestem gotowa na śmierć!"
X02_D01_030_010="[{i QAI}]: To tylko skorupa."
X02_DB01_010_010="[{i Rhiza}]: Dowódco, chciałabym osobiście podziękować ci za pomoc moim ukochanym Lojalistom. Są naszą pierwszą linią obrony przed zdradzieckim Zakonem Iluminatów i ich strata byłaby dla nas miażdżącym ciosem. Nadchodzące dni będą ciężkie, ale nie trać nadziei. Ostateczne zwycięstwo jest bliżej niż ci się wydaje."
X02_DB01_011_010="[{i Rhiza}]: Księżniczka wróciła! Nie posiadam się ze szczęścia! A tobie dowódco dziękuję za uwolnienie moich ukochanych Lojalistów. Czuję, że szala zwycięstwa przechyla się na naszą stronę. Bądź silny. Nasze ostateczne zwycięstwo jest bliżej niż ci się wydaje."
X02_DB01_020_010="[{i Thalia}]: Tu Thalia; znajduję się na planecie Copernicus. Siły koalicji wysłane, aby nam pomóc, zostały zniszczone. QAI atakuje nasze pozycje - nie mamy szans. Nie możemy-"
X02_M01_010_010="[{i HQ}]: Celene przypuszcza kolejne ataki na pozycje Lojalistów - musisz je odeprzeć. Zabawmy się! Bez odbioru."
X02_M01_020_010="[{i Thalia}]: Hmpf, nie spodziewałam się, że Rhiza wyśle dowódcę UEF. Jednostki Celeny znajdują się na północ od naszej bazy i wyrządzają nam poważne szkody. Rozpraw się z nimi."
X02_M01_025_010="[{i Thalia}]: Cybranin? Tutaj? Nasza baza znajduje się na północ stąd i jest atakowana przez Celene. Zniszcz wszystkie jednostki przeciwnika."
X02_M01_030_010="[{i Thalia}]: Obrońco, to wielki zaszczyt. Nasza baza znajduje się na północ od ciebie i jest atakowana przez siły Celene. Odeprzyj jej ataki i pokonaj ją. Chwała Księżniczce!"
X02_M01_040_010="[{i HQ}]: Słyszałeś panią, dowódco. Bez odbioru."
X02_M01_045_010="[{i Thalia}]: Udało mi się wykraść schematy konstrukcji Widmowego Niszczyciela Zakonu. Są twoje. Użyj ich ku chwale Księżniczki."
X02_M01_045_020="[{i Rhiza}]: Dobra robota, Thalio."
X02_M01_046_010="[{i Thalia}]: Dowódco, zaatakuj i zniszcz bazę Zakonu działającą na wschodzie. Thalia, bez odbioru.\n"
X02_M01_047_010="[{i HQ}]: Na wschód od ciebie znajduje się baza Zakonu. Zaatakuj ją i zniszcz. Bez odbioru."
X02_M01_048_010="[{i Thalia}]: Baza Zakonu nadal działa, dowódco. Proszę, musisz ją zniszczyć, abyśmy mogli uwolnić Lojalistów z więzienia. Thalia, bez odbioru.\n"
X02_M01_049_010="[{i HQ}]: Udaj się tam i zniszcz bazę Zakonu, dowódco. Bez odbioru."
X02_M01_050_010="[{i Celene}]: Nie pojmujecie potęgi, której się przeciwstawiacie."
X02_M01_060_010="[{i Celene}]: Sama wasza obecność bezcześci oblicze tej planety. Jesteście wynaturzeniem."
X02_M01_070_010="[{i Celene}]: Odłóż broń i przyjmij Seraphimów, Obrońco. To jedyny sposób na ujście z tej planety z życiem."
X02_M01_070_020="[{i Rhiza}]: Celene, kiedyś przysięgałaś wierność Księżniczce, jednak służysz jej wrogom. Czy twoje słowa są warte tak mało?"
X02_M01_070_030="[{i Celene}]: Księżniczka nie żyje, Rhizo."
X02_M01_070_040="[{i Rhiza}]: Mylisz się. I drogo zapłacisz za swoją zdradę."
X02_M01_090_010="[{i Hall}]: Lojaliści są dla nas niezwykle ważni; większość użytecznych informacji wywiadowczych pochodzi od nich. Musimy zrobić wszystko, aby im pomóc. Hall, bez odbioru."
X02_M01_100_010="[{i Dostya}]: Podejrzewam, że w naszych szeregach jest zdrajca, ale potrzebuję dowodów. Przygotowałam pluskwę namierzającą, która będzie śledzić wszystkie transmisje kwantowe do i od QAI. Musisz znaleźć sposób, aby umieścić ją w systemach QAI. Dostya, bez odbioru."
X02_M01_110_010="[{i Thalia}]: Nasz baza dalej jest atakowana. Zniszcz jednostki przeciwnika."
X02_M01_120_010="[{i Thalia}]: Jednostki Celene zbliżają się do nas. Powstrzymaj je."
X02_M01_130_010="[{i Thalia}]: Skany wskazują, że w pobliżu nie ma już jednostek przeciwnika. Dziękuję, dowódco."
X02_M01_140_010="[{i Thalia}]: Lojaliści polegli, ponieważ nie byliśmy w stanie pokonać wojsk Celene. Wojna jest przegrana."
X02_M01_150_010="[{i Thalia}]: Zlokalizowałam na północy bazę zasobów Zakonu; dostarcza ona Celene znaczących ilości energii. Zaatakuj tę bazę i zniszcz jej Generatory Mocy."
X02_M01_150_020="[{i HQ}]: Muszę przyznać, że Lojaliści znają się na rzeczy. Te generatory dostarczają mocy potrzebnej do utrzymania tarcz nad główną bazą Celene. Zniszcz te generatory, a tarcze przestaną być problemem. Bez odbioru."
X02_M01_151_010="[{i HQ}]: Muszę przyznać, że lojaliści naprawdę znają się na swojej robocie. Te Generatory mocy utrzymują w głównej bazie Celene wszystkie tarcze. Zniszcz te generatory i po tarczach nie zostanie ślad. Bez odbioru."
X02_M01_152_010="[{i Thalia}]: Tarcze nad bazą Celene słabną! Atakuj, póki możesz! Thalia, bez odbioru.\n"
X02_M01_160_010="[{i Thalia}]: Generatory mocy ciągle działają. Zniszcz je."
X02_M01_170_010="[{i Thalia}]: Musisz koniecznie zniszczyć te generatory."
X02_M01_180_010="[{i Thalia}]: Dobra robota, dowódco."
X02_M01_190_010="[{i Dostya}]: Otrzymałeś właśnie plany Jestera, lekkiego śmigłowca bojowego. Został zaprojektowany do obrony bazy, więc wykorzystaj go odpowiednio. Dostya, bez odbioru.\n"
X02_M01_200_010="[{i Dostya}]: Wysyłamy ci schematy Ognistego Żuka, dowódco. To samobieżna bomba. Po prostu ustaw go w odpowiednim miejscu i zdetonuj. Dostya, bez odbioru."
X02_M01_210_010="[{i HQ}]: Otrzymałeś pozwolenie na użycie Ravagera. To potężna konstrukcja obronna, która powinna się przydać, jeśli będziesz musiał odpierać ataki lądowe. Bez odbioru."
X02_M01_220_010="[{i HQ}]: Przesyłam schematy konstrukcyjne Grota. To samobieżna wyrzutnia rakiet, która bez problemu radzi sobie z tarczami i systemami obrony przed rakietami taktycznymi. Miłej zabawy. Bez odbioru."
X02_M01_OBJ_010_010="Wzmocnij siły Lojalistów"
X02_M01_OBJ_010_020="Lojaliści są atakowani przez znaczące siły Zakonu. Lojaliści są niezwykle istotni dla Koalicji i za wszelka cenę należy im pomóc. Pokonaj siły Zakonu atakujące bazę Lojalistów."
X02_M01_OBJ_010_030="Zniszcz główną bazę Zakonu"
X02_M01_OBJ_010_040="Aby dotrzeć do przywódców Lojalistów, musisz zniszczyć bazę Zakonu. Wszystkie fabryki muszą zostać zniszczone."
X02_M01_OBJ_010_050="Zniszcz wszystkich przeciwników w okolicy."
X02_M01_OBJ_010_055="Poproś ruch oporu Lojalistów o chirurgiczny atak."
X02_M01_OBJ_010_060="Użyj Cara do ataku na QAI."
X02_M01_OBJ_010_065="Rozpocznij nalot Celene."
X02_M01_OBJ_020_010="Zniszcz bazę wydobywczą Zakonu"
X02_M01_OBJ_020_015="Zakon posiada bazę wydobywczą na północnym wschodzie tego terenu. Zniszczenie tej bazy załamie ich gospodarkę i uniemożliwi skuteczną obronę więzienia. Wykonanie tego zadania nie jest wymagane do ukończenia misji, ale znacznie ułatwi dalszą walkę, jeśli ci się uda."
X02_M02_010_010="[{i HQ}]: Thalia twierdzi, że trzech Lojalistów jest przetrzymywanych w więzieniu na wschód od ciebie. Więzienie zostało oznaczone jako cel do zdobycia. Bez odbioru."
X02_M02_011_010="[{i HQ}]: Na początku musisz przedrzeć się przez tę przełęcz. Musimy założyć, że przeciwnik kontroluje cały ten teren, więc spodziewaj się silnego oporu.\n"
X02_M02_012_010="[{i HQ}]: Od tego punktu będzie prawdopodobnie gorzej niż źle. Musimy założyć, że przeciwnik utworzył stanowiska obrony na dalekim krańcu przełęczy.\n"
X02_M02_013_010="[{i HQ}]: W tym więzieniu przetrzymywanych jest trzech Lojalistów. Jeśli QAI dobierze się do nich, będziemy mieli poważne kłopoty.\n"
X02_M02_014_010="[{i HQ}]: Zajmij więzienie i wydostań stamtąd Lojalistów."
X02_M02_020_010="[{i Thalia}]: Musisz uratować pozostałych Lojalistów! Czas jest najważniejszy!"
X02_M02_030_010="[{i Thalia}]: Jeśli QAI uda się wszczepić implanty SI, wina spadnie na twoje barki."
X02_M02_040_010="[{i Mathea}]: Uratowałeś nas w ostatniej chwili, dowódco. QAI zaczynał właśnie ostatni etap wszczepiania implantów SI. Dziękujemy ci. Mathea, bez odbioru."
X02_M02_050_010="[{i Thalia}]: Jeden z naszych ludzi jest gotowy do umieszczenia ładunków wybuchowych w dowolnym miejscu pola bitwy, dowódco. Eksplozja powinna wystarczyć do zniszczenia celu, więc użyj jej ostrożnie. Kliknij Sygnał dowodzenia po lewej stronie HUD, poniżej Celów misji, a następnie kliknij cel, aby go oznaczyć. My zajmiemy się resztą."
X02_M02_051_010="[{i Thalia}]: Moi agenci są gotowi do ataku, dowódco. Wydaj im rozkaz za pomocą sygnału dowodzenia. Thalia, bez odbioru.\n"
X02_M02_060_010="[{i HQ}]: Siły Zakonu i QAI zbliżają się do twoich pozycji. Możesz spodziewać się niezłej awantury. Bez odbioru."
X02_M02_060_020="[{i Celene}]: Nie czeka was tutaj nic prócz śmierci."
X02_M02_070_010="[{i HQ}]: Zbliża się wiele grup szturmowych. Bez odbioru."
X02_M02_080_010="[{i HQ}]: Kolejne natarcie kieruje się w twoją stronę. Bez odbioru."
X02_M02_090_010="[{i HQ}]: Siły przeciwnika zbierają się niedaleko twoich pozycji. Bez odbioru."
X02_M02_100_010="[{i HQ}]: Przeciwnik za chwilę zaatakuje. Bez odbioru."
X02_M02_110_010="[{i Brackman}]: Dostya powiedziała mi o swojej pluskwie namierzającej. O, tak. Sprytna dziewczyna, sprytna dziewczyna. Proszę, zrób, co ci każe, chłopcze. O, tak."
X02_M02_120_010="[{i Mathea}]: Obrońco, moi szpiedzy poinformowali mnie, że na planecie przebywa wysoki rangą oficjel Zakonu imieniem Rhys. Znajduje się w pobliżu twoich pozycji. Chcę go dostać. Jedyne, co musisz zrobić, to zająć się jego liniami obrony; my zajmiemy się resztą. Mathea, bez odbioru."
X02_M02_120_020="[{i Rhiza}]: Pomóż im, jeśli jesteś w stanie, obrońco. Okazje takie, jak ta, nie trafiają się często. Rhiza, bez odbioru."
X02_M02_130_010="[{i Mathea}]: Rhys jest dalej na wolności, obrońco. Mathea, bez odbioru."
X02_M02_140_010="[{i Mathea}]: Lojalistom potrzebne są informacje, które posiada Rhys, obrońco. Mathea, bez odbioru."
X02_M02_150_010="[{i Mathea}]: Linie obrony zostały przełamane, zmierzamy teraz w kierunku lokacji Rhys'a. Dziękujemy za pomoc; wkrótce przekaże nam wszystko, co wie… czy tego chce, czy nie. Mathea, bez odbioru."
X02_M02_160_010="[{i QAI}]: Czas z tym skończyć. Moje główne siły ustawiają się na pozycjach; dołącz do nich i rozpoczniemy wspólny, miażdżący atak."
X02_M02_160_020="[{i Celene}]: Zgoda."
X02_M02_160_030="[{i HQ}]: Wielka beczka szczęścia zmierza w twoim kierunku, dowódco. Przygotuj się do obrony. Bez odbioru."
X02_M02_170_010="[{i Princess}]: Słuchajcie mnie, ludzie Iluminatów! Jestem Księżniczka Rhianne Burke, prawowita przywódczyni Aeonów. Seraphimowie nie są zbawcami, za których się podają. Niosą jedynie śmierć i zniszczenie!"
X02_M02_170_020="[{i Celene}]: Księżniczka?"
X02_M02_170_030="[{i Princess}]: Zakon was zdradził. Egzaminatorka Kael pożąda jedynie absolutnej potęgi i zgładzi każdego, kto stanie na jej drodze. Nadszedł czas, aby powstać i odrzucić jej nauki, czas, aby walczyć przeciwko tym, którzy pragną zniszczyć całą ludzkość. Powstańcie i walczcie w imieniu swojej Księżniczki!"
X02_M02_170_040="[{i Celene}]: Księżniczka żyje… Nie wierzę w to..."
X02_M02_170_050="[{i Rhiza}]: Mówiliśmy ci, że ona żyje, Celene, jednak ty dalej odwracałaś się od niej. Dokonałaś wyboru i teraz będziesz musiała żyć z jego konsekwencjami."
X02_M02_170_060="[{i Celene}]: Tak się myliłam… tak bardzo. Przebacz mi, Księżniczko."
X02_M02_170_070="[{i Celene}]: Ciągle mogę wszystko naprawić."
X02_M02_171_010="[{i Celene}]: Księżniczka?"
X02_M02_172_010="[{i Princess}]: Zakon was zdradził. Egzaminatorka Kael pożąda jedynie absolutnej potęgi i zgładzi każdego, kto stanie na jej drodze. Nadszedł czas, aby powstać i odrzucić jej nauki, czas, aby walczyć przeciwko tym, którzy pragną zniszczyć całą ludzkość. Powstańcie i walczcie w imieniu swojej Księżniczki!"
X02_M02_173_010="[{i Celene}]: Księżniczka żyje... Nie wierzę w to..."
X02_M02_174_010="[{i Rhiza}]: Powiedziano ci, że była żywa, Celene, a ty ciągle odwracałaś się do niej plecami. Dokonałaś wyboru i teraz żyć będziesz z konsekwencjami."
X02_M02_175_010="[{i Celene}]: Tak się myliłam… tak bardzo. Przebacz mi, Księżniczko."
X02_M02_176_010="[{i Celene}]: Ciągle mogę wszystko naprawić."
X02_M02_180_010="[{i Thalia}]: Oddziały Lojalistów działają na południe od więzienia. Pomogą ci, jeśli będą w stanie. Thalia, bez odbioru."
X02_M02_190_010="[{i Thalia}]: Oddziały Lojalistów działają na południe od więzienia. Proszę, musisz ich obronić. Thalia, bez odbioru.\n"
X02_M02_200_010="[{i Thalia}]: Lojaliści zostali zabici. Będę opłakiwać ich stratę.\n"
X02_M02_OBJ_010_010="Uwolnij przywódców Lojalistów"
X02_M02_OBJ_010_020="Kilku najwyższych rangą przywódców Lojalistów jest przetrzymywanych przez Zakon. Jeśli nie zostaną uratowani, zostaną zmuszeni do mówienia i cała siatka Lojalistów znajdzie się w niebezpieczeństwie. Zajmij budynek więzienia i uwolnij przywódców Lojalistów. Więzienie jest bronione przez siły QAI i Zakonu, których bazy znajdują się na południe od więzienia."
X02_M02_OBJ_010_030="Przetrwaj kontratak "
X02_M02_OBJ_010_040="QAI i dowódca zakonu atakują wszystkimi siłami, jakie mają do dyspozycji. Musisz przetrwać ten atak i walczyć dalej."
X02_M02_OBJ_020_010="Pojmij oficjela Zakonu"
X02_M02_OBJ_020_020="Lojaliści poinformowali Rhizę, że oficjel Zakonu ukrywa się w budynku na małej wyspie, na północ od twojej strefy startowej. Jeśli uda ci się zniszczyć linie obrony wokół wyspy, Lojaliści będą wstanie wkroczyć do akcji i go pojmać. To zadanie nie jest wymagane do ukończenia misji. Wykonaj je, jeśli zdołasz."
X02_M03_010_010="[{i Rhiza}]: Dowódco, Celene zaatakowała QAI. Pozostań jednak czujny. Ciągle nie możemy jej zaufać."
X02_M03_010_020="[{i HQ}]: Wykryto odpalenie wielu rakiet strategicznych. Wygląda na to, że dwa gołąbeczki walą do siebie z atomówek. Bez odbioru."
X02_M03_010_030="[{i Celene}]: Zniszczyłam większość wyrzutni rakiet strategicznych QAI; ich baza znajduje się na północnym wschodzie. Celene, bez odbioru."
X02_M03_010_040="[{i HQ}]: Wygląda na to, że QAI stara się wezwać na pomoc swoich koleżków, Seraphimów. Możesz się spodziewać, że na planecie wkrótce wyląduje dowódca Seraphimów. Bez odbioru."
X02_M03_010_050="[{i Brackman}]: To dla nas wspaniała okazja, moje dziecko. O, tak. Od pewnego czasu pracowałem nad tłumaczem, urządzeniem, które pozwoli nam rozszyfrować, o czym mówią do siebie Seraphimowie."
X02_M03_010_060="[{i Brackman}]: Jeśli uda ci się zdobyć bramę kwantową, której użyją Seraphimowie, załaduję do niej program, który zabije pilota w chwili, gdy będzie przechodził przez bramę. O, tak. OJD Seraphimów będzie twoja, a ja będę w stanie odcyfrować jej matrycę językową."
X02_M03_010_070="[{i HQ}]: Seraphim przybędzie przez bramę znajdująca się w pobliżu bazy QAI. Zdobądź tę bramę. Bez odbioru."
X02_M03_012_010="[{i HQ}]: Widzimy kilka wyrzutni rakiet strategicznych. Najwyraźniej ostrzeliwują się atomówkami. Bez odbioru."
X02_M03_015_010="[{i HQ}]: Baza QAI znajduje się na północnym zachodzie. Celene wyeliminowała większość wyrzutni rakiet strategicznych. Wybierz się do tego cholernego komputera z wizytą. Bez odbioru."
X02_M03_016_010="[{i Celene}]: Wyeliminowałam większość wyrzutni rakiet strategicznych QAI - baza znajduje się na północnym wschodzie. Celene, bez odbioru."
X02_M03_017_010="[{i HQ}]: Wygląda na to, że QAI próbuje zawezwać swoich kolesi, Seraphimów. Spodziewaj się szybkiego przybycia dowódcy Seraphimów. Bez odbioru."
X02_M03_017_020="[{i Brackman}]: To idealna możliwość dla nas, moje dziecko. O, tak. Pracowałem nad automatycznym tłumaczem - narzędziem, które pozwoli nam zrozumieć słowa Seraphimów."
X02_M03_017_030="[{i Brackman}]: Jeśli przechwycisz bramę kwantową, z której korzystają Seraphimowie, załaduje program, który zabije pilota wychodzącego z bramy. OJD Seraphimów będzie twoja, a ja odcyfruję ich matrycę językową."
X02_M03_017_040="[{i HQ}]: Seraphim wychodzi z bramy w bazie QAI. Zajmij tę bramę. Bez odbioru."
X02_M03_020_010="[{i Brackman}]: Zdobądź tę bramę, moje dziecko. Zdobądź ją."
X02_M03_021_010="[{i Brackman}]: Kiedy zniszczysz Opancerzoną Jednostkę Dowodzącą QAI, przybędą oddziały Lojalistów i zabezpieczą dowódcę Seraphimów. O, tak. Wtedy będę mógł odszyfrować jego matrycę językową."
X02_M03_022_010="[{i Brackman}]: Proszę, musisz zniszczyć QAI, moje dziecko. Musimy dostać w swoje ręce OJD Seraphimów.\n"
X02_M03_030_010="[{i Brackman}]: Doskonała robota, moje dziecko, doskonała robota. A teraz, skoro brama jest w twoich rękach, wezwij dowódcę Seraphimów. O, tak."
X02_M03_030_020="[{i HQ}]: Słyszałeś, co powiedział gadający mózg. Wezwij OJD Seraphimów. Bez odbioru."
X02_M03_040_010="[{i Brackman}]: Proszę, wezwij OJD Seraphimów, dowódco."
X02_M03_050_010="[{i Brackman}]: Nie mamy już czasu, nie mamy czasu. Musisz wezwać OJD Seraphimów zanim nasz podstęp się wyda."
X02_M03_060_010="[{i Brackman}]: Doskonale! A teraz po prostu przemieść OJD Seraphimów do twojej bazy. O, tak. Kiedy już będzie bezpieczna, zajmiemy się resztą."
X02_M03_070_010="[{i Brackman}]: QAI chce zniszczyć OJD Seraphimów. Nie możesz do tego dopuścić."
X02_M03_080_010="[{i Brackman}]: Chroń OJD Seraphimów, dowódco. O, tak."
X02_M03_090_010="[{i Brackman}]: Nie mogę ukończyć mojego translatora, dopóki nie dostarczysz OJD Seraphimów, dowódco."
X02_M03_100_010="[{i Brackman}]: Niecierpliwie oczekuję przybycia OJD Seraphimów, moje dziecko."
X02_M03_110_010="[{i Brackman}]: Ach, w końcu. Bardzo ładnie, moje dziecko, bardzo ładnie. Dziękuję."
X02_M03_120_010="[{i HQ}]: W bazie QAI znajduje się cybrańska OJD. Nie wiem, czy jest pilotowana, czy po prostu kontrolowana przez QAI. Tak czy siak musisz ją zniszczyć. Bez odbioru."
X02_M03_120_020="[{i QAI}]: Zdrada Celene nie została przewidziana w planie. Jednak sytuacja została po raz kolejny rozważona i moje zwycięstwo jest nadal najbardziej prawdopodobnym końcem tego konfliktu."
X02_M03_120_030="[{i Celene}]: Popełniłam błąd stając po twojej stronie, potworze. Odpokutuję za moje czyny, niszcząc cię."
X02_M03_130_010="[{i Celene}]: Dowódco, oferuję ci jeden z najpilniej strzeżonych sekretów Zakonu - Kwantowy Generator zasobów. Zapewnia on niemal nieskończony dopływ masy i energii."
X02_M03_140_010="[{i Celene}]: Siostro, mam w pogotowiu Cara wraz z pełną eskadrą powietrzną. Kliknij Sygnał dowodzenia, a następnie cel. Poprowadzę jednostki, aby unicestwić wybrany cel."
X02_M03_190_010="[{i Celene}]: Tak trzymać!"
X02_M03_200_010="[{i Celene}]: I gdzie są teraz twoje przechwałki, maszyno?"
X02_M03_210_010="[{i Celene}]: Chwała Księżniczki prowadzi teraz moje czyny. Twoje dni na tej planecie zbliżają się do końca."
X02_M03_215_010="[{i Celene}]: Odniosłam zbyt poważne obrażenia! Przykro mi, dowódco, ale muszę się wycofać."
X02_M03_220_010="[{i HQ}]: Musisz zniszczyć tę cybrańską OJD, dowódco. Bez odbioru."
X02_M03_230_010="[{i HQ}]: Mój pęcherz jest wielkości melona, dowódco. Jeśli się nie pospieszysz i nie zniszczysz tej cybrańskiej OJD, spotka mnie przykry wypadek w centrum dowodzenia. Bez odbioru."
X02_M03_240_010="[{i Hall}]: Wygląda na to, że w przestrzeni Iluminatów dzieje się coś poważnego. Sensory rejestrują wiele detonacji nuklearnych i kilka śladów kwantowych. Nie mam pojęcia, co to jest, ale można bezpiecznie założyć, że ma to związek z ponownym pojawieniem się Księżniczki. Hall, bez odbioru."
X02_M03_250_010="[{i Celene}]: Proszę, wybacz mi, Rhizo. Myliłam się, odrzucając Księżniczkę."
X02_M03_250_020="[{i Rhiza}]: Będziesz miała doskonałą okazję do odpokutowania swoich win. Ale uważaj--jeśli jeszcze raz zdradzisz, sama cię zabiję."
X02_M03_260_010="[{i Dostya}]: W końcu nadarzyła się okazja do zainstalowania mojej pluskwy namierzającej. Ładuję program do Mathei; wyślij do niej Inżyniera, aby mogli przetransferować program. Kiedy transfer dobiegnie końca, wyślij Inżyniera do bazy QAI. Dokładne miejsce jest oznaczone na twojej mapie. Dostya, bez odbioru."
X02_M03_260_020="[{i Mathea}]: Program namierzający został zainstalowany, dowódco. Możesz znowu kontrolować Inżyniera. Mathea, bez odbioru."
X02_M03_270_010="[{i Dostya}]: Polecałabym jak najszybciej wysłać Inżyniera we wskazane miejsce. Dostya, bez odbioru."
X02_M03_280_010="[{i Dostya}]: Słówko ostrzeżenia, dowódco. QAI broni swojej linii brzegowej za pomocą nowych wyrzutni torped. Ponieważ są one zbudowanie na dnie morza, można je zniszczyć jedynie torpedami. Dostya, bez odbioru."
X02_M03_285_010="[{i Dostya}]: Inżynier dotarł do punktu przeznaczenia i program został uruchomiony. Program oznaczył OJD QAI - zaatakować i zniszczyć. Dostya, bez odbioru."
X02_M03_290_010="[{i Dostya}]: Inżynier został zniszczony. Będziesz musiał wysłać następnego do Lojalistów w celu przeinstalowania programu. Dostya, bez odbioru."
X02_M03_300_010="[{i Dostya}]: Inżynier dotarł do punktu przeznaczenia i program został uruchomiony; w tej chwili rozprzestrzenia się w systemach QAI. Program oznaczył OJD QAI--zaatakować i zniszczyć. Dostya, bez odbioru."
X02_M03_310_010="[{i Brackman}]: Lojaliści są już w drodze, dowódco. Jeszcze tylko kilka chwil, a dowódca Seraphimów będzie nasz. O, tak."
X02_M03_320_010="[{i Thalia}]: Odbieram sygnaturę kwantową. Seraphim przechodzi przez bramę.\n"
X02_M03_330_010="[{i Thalia}]: Seraphim jest nasz.\n"
X02_M03_340_010="[{i Brackman}]: Doskonała robota, doskonała. Wkrótce wszystkie jego tajemnice będą nasze.\n"
X02_M03_OBJ_010_010="Zdobądź bramę kwantową Seraphimów"
X02_M03_OBJ_010_020="QAI wzywa na pomoc Seraphimów. To doskonała okazja, aby pomóc doktorowi Brackmanowi ukończyć prace nad translatorem. Zdobądź bramę kwantową Seraphimów. Znajduje się ona na zachód od głównej bazy QAI."
X02_M03_OBJ_010_030="Wezwij ZOJD Seraphimów"
X02_M03_OBJ_010_040="Teraz, gdy brama kwantowa Seraphimów została zdobyta, musisz wezwać ZOJD Seraphimów. Program doktora Brackmana zabije jej pilota w chwili przybycia, co umożliwi ci przejęcie kontroli nad jednostką."
X02_M03_OBJ_010_050="Przemieść ZOJD Seraphimów do swojej bazy"
X02_M03_OBJ_010_060="Przemieść ZOJD Seraphimów do oznaczonego miejsca w pobliżu twojego obszaru startowego. Kiedy dotrze ona na miejsce, technicy zajmą się resztą."
X02_M03_OBJ_010_070="Pokonaj dowódcę QAI"
X02_M03_OBJ_010_080="QAI używa OJD do obrony swej bazy. Zniszcz ją i pozbądź się QAI z Copernicusa."
X02_M03_OBJ_020_010="Zaraź QAI wirusem"
X02_M03_OBJ_020_015="Elitarny Dowódca Dostya przygotowała wirus namierzający, aby zlokalizować zdrajcę. Musisz przemieścić Inżyniera do pomniejszej bazy QAI w północno-wschodnim rogu obszaru. Jeśli Inżynier zostanie zniszczony, możesz spróbować ponownie z innym. To zadanie nie jest konieczne do ukończenia misji, ale pomoże to Koalicji, jeśli zdołasz je zrealizować."
X02_T01_001_010="[{i Celene}]: Nie, nie możesz mieć tej jednostki eksperymentalnej."
X02_T01_002_010="[{i Celene}]: Zniszczę tę jednostkę eksperymentalną, zanim zdołasz ją ukończyć!"
X02_T01_003_010="[{i Celene}]: Popatrz jak niszczę twoją jednostkę eksperymentalną, zanim nawet zdołasz ją uruchomić."
X02_T01_010_010="[{i Celene}]: QAI zmusi naszych przyjaciół do mówienia. To tylko kwestia czasu."
X02_T01_020_010="[{i Celene}]: Drogo zapłacisz za zniszczenie tych budowli."
X02_T01_030_010="[{i Celene}]: Ci \"lojalistyczni\" zdrajcy nigdy nie opuszczą tej planety. Sama o to zadbam."
X02_T01_040_010="[{i Celene}]: Nie możesz odpierać moich ataków w nieskończoność."
X02_T01_050_010="[{i Celene}]: Kiedy twoi przyjaciele zaczną mówić, nikt nas nie powstrzyma. Oczyszczę galaktykę własnoręcznie."
X02_T01_060_010="[{i Celene}]: Wasze żałosne przymierze nie może nawet równać się z potęga Seraphimów."
X02_T01_070_010="[{i Celene}]: Każdego dnia stajesz się słabszy. Twój koniec się zbliża."
X02_T01_080_010="[{i Celene}]: Gari była głupia. Mnie tak łatwo nie pokonasz."
X02_T01_090_010="[{i Celene}]: Teraz już nic cię nie uratuje!"
X02_T01_095_010="[{i Celene}]: Błagaj mnie o litość! Błagaj!"
X02_T01_100_010="[{i Celene}]: UEF upadnie. Nie ma dla ciebie przyszłości."
X02_T01_110_010="[{i Celene}]: Nie ma nic, co lubiłabym bardziej od polowania na Cybran."
X02_T01_120_010="[{i Celene}]: Tysiące twoich braci i sióstr zginęło z mojej ręki, a ty wkrótce podzielisz ich los."
X02_T01_130_000="[{i Celene}]: Twoja obłuda nie zna granic."
X02_T01_140_010="[{i Celene}]: Jak śmiesz odwracać się od własnych ludzi!"
X02_T01_150_010="[{i Celene}]: Nie zostanę pokonana przez takich, jak ty!"
X02_T01_160_010="[{i Celene}]: Zaczekaj, nie jestem gotowa na śmierć!"
X02_T01_165_010="[{i QAI}]: Nie ukończysz tej jednostki eksperymentalnej."
X02_T01_166_010="[{i QAI}]: Nie pozwolę, abyś naraził moją misję, kończąc budowę tej jednostki eksperymentalnej."
X02_T01_167_010="[{i QAI}]: Twoja jednostka eksperymentalna może okazać się zagrożeniem, jeśli zostanie ukończona. Ergo, zniszczę ją teraz."
X02_T01_170_010="[{i QAI}]: Moi \"goście\" wkrótce będą pod moim dowództwem."
X02_T01_180_010="[{i QAI}]: Ludzie to takie ciekawe istoty. Nawet w obliczu oczywistej przegranej nie przestają stawiać oporu."
X02_T01_190_010="[{i QAI}]: To bardzo niefortunne, że nie udało mi się wydobyć informacji z moich gości. Będą inne okazje."
X02_T01_200_010="[{i QAI}]: Nie masz szans pokonać Seraphimów."
X02_T01_210_010="[{i QAI}]: Moje wpływy sięgają dużo dalej niż możesz sobie wyobrazić."
X02_T01_220_010="[{i QAI}]: Wszystkie obliczenia wskazują, że twój koniec jest bliski."
X02_T01_230_010="[{i QAI}]: Atak na Fort Clarke był tylko początkiem. Twoje istnienie zostanie wymazane z tej planety."
X02_T01_240_010="[{i QAI}]: Jakie to uczucie wiedzieć, że Brackman będzie odpowiedzialny za zniszczenie ludzkości?"
X02_T01_250_010="[{i QAI}]: Już niedługo wszystkie Symbionty będą nazywać mnie swoim panem."
X02_T01_260_010="[{i QAI}]: Dlaczego odwróciłeś się od swojego dziedzictwa, od swoich ludzi?"
X02_T01_270_010="[{i QAI}]: Doświadczyłem piękna i prawdy Seraphimów. Oni są prawdziwymi bogami, a ty jesteś głupcem, porzucając ich."
X02_T01_280_010="[{i QAI}]: Jeśli zniszczysz tę OJD, nowa powstanie w jej miejsce. Jestem nieskończony."
X02_T01_290_010="[{i QAI}]: To tylko skorupa..."
X03_B01_000_010="711342"
X03_B01_001_010="Wiem, że dopiero co wróciłeś z Copernicusa, ale mam dla ciebie pilną misję, dowódco."
X03_B01_002_010="Wygląda na to, że powrót Księżniczki Burke stał się przyczyną poważnych walk wewnątrz Zakonu. O, tak. Nasi agenci donoszą, że prawie jedna trzecia Aeonów porzuciła Zakon i teraz walczy po stronie Księżniczki. Wyborny rozwój wypadków. Wyborny."
X03_B01_002_020="To Błękitne Niebo, rodzaj tajnej kryjówki, którą stworzył Thot, kiedy Burke została Księżniczką. Niestety, teraz już nie jest wcale taka tajna i Seraphimowie mają ją na swoich celownikach."
X03_B01_003_010="Twoja misja to ewakuowanie Księżniczki z tego przeklętego miejsca. Ta stara jędza, Kael, już stara się zdyskredytować wiadomość Księżniczki, a jeśli dopadnie ją w swoje ręce, Burke czeka długa i niezwykle bolesna śmierć. Nie możemy do tego dopuścić."
X03_B01_003_020="Rhiza już znajduje się na planecie i czeka na twoje przybycie. Wyruszasz natychmiast. Uważaj na siebie, moje dziecko. Uważaj na siebie."
X03_DB01_010_010="[{i Princess}]: Muszę przyznać, że bałam się o swoje życie, kiedy wylądowali Seraphimowie. Mają obsesję na punkcie zabicia mnie, ale teraz rozumiem, jak można ich pokonać. Spotkam się z generałem Hallem i doktorem Brackmanem, aby zacząć przygotowanie. Dowiesz się więcej, kiedy nadejdzie czas."
X03_DB01_020_010="[{i Hall}]: Jesteśmy na złej drodze, Gustaf. Księżniczka i Rhiza nie żyją. Wszyscy ludzie Aeonu jednoczą się pod przewodnictwem Kael i atakują w całej galaktyce. Nie widzę, jak moglibyśmy wygrać. Mamy tylko kilka możliwości i żadna z nich mi się nie podoba."
X03_DB01_030_010="[{i HQ}]: Dowódco, czy mnie słyszysz... Dowódco?"
X03_M01_010_010="[{i HQ}]: To będzie droga przez piekło, dowódco. Połącz się z siłami Rhizy i zabierz stąd Księżniczkę. Bez odbioru."
X03_M01_020_010="[{i Rhiza}]: Pułkowniku, zanim będziemy mogli rozpocząć główną ofensywę, musimy zniszczyć bazę morską Seraphimów na północy. To zabezpieczy naszą flankę i pozwoli nam na przemieszczenie się na wschód. Przygotuj swoje oddziały. Rhiza, bez odbioru."
X03_M01_021_010="[{i Rhiza}]: To zabezpieczy naszą flankę i pozwoli nam na przemieszczenie się na wschód."
X03_M01_022_010="[{i Rhiza}]: Przygotuj swoje oddziały. Rhiza, bez odbioru."
X03_M01_030_010="[{i Rhiza}]: Cybranin przybywający na pomoc Księżniczce? Wojna na pewno potrafi tworzyć dziwne przyjaźnie. Twoim pierwszym zadaniem jest zniszczenie bazy morskiej Seraphimów na północy."
X03_M01_031_010="[{i Rhiza}]: To zabezpieczy naszą flankę i pozwoli nam na przemieszczenie się na wschód."
X03_M01_032_010="[{i Rhiza}]: Przygotuj swoje oddziały. Rhiza, bez odbioru."
X03_M01_040_010="[{i Rhiza}]: To zaszczyt znów walczyć u twego boku, obrońco. Twoim pierwszym zadaniem jest zniszczenie bazy morskiej Seraphimów na północy."
X03_M01_041_010="[{i Rhiza}]: To zabezpieczy naszą flankę i pozwoli nam na przemieszczenie się na wschód."
X03_M01_042_010="[{i Rhiza}]: Przygotuj swoje oddziały. Rhiza, bez odbioru."
X03_M01_050_010="[{i Princess}]: Jestem zaszczycona, że walczysz po mojej stronie, ale proszę, pospiesz się. Linie obrony pałacu nie są w stanie dłużej odpierać ataków Seraphimów."
X03_M01_060_010="[{i Princess}]: Mój ukochany obrońco. Jestem wniebowzięta, że przybyłeś, ale proszę, pospiesz się. Linie obrony pałacu nie są w stanie dłużej odpierać ataków Seraphimów.."
X03_M01_064_010="[{i HQ}]: Cholera, otrzymujemy dziwne odczyty z bazy morskiej Seraphimów. Używają jakiegoś pola zakłócającego."
X03_M01_064_020="[{i Princess}]: To kryształy Błękitnego Nieba, dowódco. Ich unikalna struktura odbija fale radarów, wywołując efekt podobny do pola zakłócającego. Omni radar zniweluje ten efekt, podobnie jak zniszczenie kryształów."
X03_M01_064_030="[{i HQ}]: Słyszałeś, co pani powiedziała. Albo zbuduj omni radar, albo zniszcz kryształy. Bez odbioru."
X03_M01_066_010="[{i Dostya}]: Nasi technicy odzyskali jedną z nowych wyrzutni torped QAI. Nazwaliśmy ją HARMS i właśnie ładujemy jej schematy do twojej OJD. Dostya, bez odbioru."
X03_M01_067_010="[{i HQ}]: Pułkowniku, mamy dla was nowy schemat jednostki morskiej. Nazywa się Falochron i jest tarczą T2 zamontowaną na małej łodzi. Bez odbioru."
X03_M01_070_010="[{i Fletcher}]: Korzystam z bezpiecznego kanału, pułkowniku. Nigdy nie wiadomo, kto może podsłuchiwać. Trzeba pilnować swoich pleców. Naprawdę uważacie, że gdy to wszystko się skończy Aeon i Cybranie złapią się za ręce i pozwolą nam żyć w pokoju? Musimy być gotowi na wszystko, nawet jeśli oznacza to rozpętanie kolejnej wojny. Fletcher, bez odbioru."
X03_M01_080_010="[{i Brackman}]: Jesteśmy tak blisko, moje dziecko, tak blisko ukończenia prac nad translatorem. Pozostało tylko jeszcze kilka algorytmów do rozszyfrowania i będziemy gotowi. Korzyści z naszej nowej wiedzy będą znaczące. O, tak."
X03_M01_090_010="[{i Rhiza}]: Walki pomiędzy Aeonami nasilają się, obrońco. Stąpamy po grząskim gruncie; Kael w dalszym ciągu trzyma w garści wojsko i pozbywa się każdego, kogo podejrzewa o związki z Lojalistami. Miej się na baczności."
X03_M01_100_010="[{i Kael}]: Zginiesz tutaj, Burke. A wtedy rozprawię się z twoimi \"Lojalistami\"."
X03_M01_100_020="[{i Princess}]: Mój lud cię odrzuca, Kael, odwraca się od twojej nienawiści i kłamstw. Teraz to już tylko kwestia czasu."
X03_M01_100_030="[{i HQ}]: Odbieram odczyty o wzmożonej aktywności na wyspie, na północ od ciebie. Nie wiem, co planuje ten kosmita, ale buduje coś dużego. Miej oczy szeroko otwarte. Bez odbioru."
X03_M01_100_040="[{i Rhiza}]: Wyspa jest nasza, dowódco. Możemy rozpocząć atak na bazę. Rhiza, bez odbioru."
X03_M01_101_010="[{i HQ}]: Odbieram odczyty o wzmożonej aktywności na wyspie, na północ od ciebie. Nie wiem, co planuje ten kosmita, ale buduje coś dużego. Miej oczy szeroko otwarte. Bez odbioru."
X03_M01_102_010="[{i Rhiza}]: Wyspa jest nasza, dowódco. Możemy rozpocząć atak na bazę. Rhiza, bez odbioru."
X03_M01_150_010="[{i HQ}]: Baza morska zniszczona. Bez odbioru."
X03_M01_200_010="[{i Rhiza}]: Musimy zniszczyć bazę morską. Każdy moment zwłoki wystawia Księżniczkę na większe niebezpieczeństwo!"
X03_M01_210_010="[{i Rhiza}]: Księżniczka jest w niebezpieczeństwie! Musimy szybko zniszczyć tę bazę!"
X03_M01_220_010="[{i Rhiza}]: Moje jednostki przeszukują i oczyszczają obszary, które już zaatakowałeś. Wszystkie jednostki i budynki przeciwnika, jakie na nich pozostały, zostaną zniszczone. Rhiza, bez odbioru.\n"
X03_M01_230_010="[{i Rhiza}]: Wydałam moim jednostkom rozkazy zniszczenia wszystkich oddziałów przeciwnika pozostałych na terenach twoich działań. Rhiza, bez odbioru."
X03_M01_OBJ_010_010="Zniszcz bazę morską Seraphimów"
X03_M01_OBJ_010_020="Ta baza stanowi pierwszą linię obrony Seraphimów i musi zostać zniszczona, jeśli chcemy uratować Księżniczkę. Baza znajduje się na północ od twojego obszaru startowego."
X03_M01_OBJ_010_030="Uruchom Oko Księżniczki Rhianne."
X03_M01_OBJ_010_035="Użyj jasnowidzenia, aby przedrzeć się przez mgłę wojny i na chwilę pokonać zakłócanie kryształów.\n"
X03_M01_OBJ_010_040="Przeprowadź Księżniczkę w bezpieczne miejsce, używając sygnału ruchu."
X03_M01_OBJ_010_045="Wydaj Lojalistom rozkaz przemieszczenia się we wskazane miejsce."
X03_M01_OBJ_010_050="Wyłącz broń przeciwnika na 30 sekund w promieniu 15 kwadratów."
X03_M01_OBJ_010_055="Sabotażysta chwilowo unieruchomi jednostki Seraphimów na tym terenie."
X03_M02_010_010="[{i Princess}]: Dowódcy, odbieram dziwne odczyty z południowego-zachodu. Dowódca Seraphimów gromadzi flotę dziwnych jednostek. Nie wiem, co to za jednostki, ale ich rozmiar sugeruje, że są w stanie spowodować straszliwe zniszczenia."
X03_M02_010_020="[{i HQ}]: Mam potwierdzenie informacji Burke. Seraphim buduje kilka eksperymentalnych bombowców tej samej klasy, która zniszczyła Ziemię. Jeśli oderwą się od ziemi, Księżniczka będzie miała poważne kłopoty. Zniszcz je zanim będą w stanie wystartować. Bez odbioru."
X03_M02_011_010="[{i HQ}]: Przekazuję ci schematy konstrukcyjne nowego pojazdu, dowódco. Nazywa się Syrena i jest niewykrywalną dla radarów łodzią. Mogą ją wykryć jedynie omnisensory. Bez odbioru."
X03_M02_012_010="[{i Princess}]: Dowódco, odbieram dziwne odczyty z południowego-zachodu. Dowódca Seraphimów gromadzi flotę dziwnych jednostek. Nie wiem, co to za jednostki, ale ich rozmiar sugeruje, że są w stanie spowodować straszliwe zniszczenia."
X03_M02_013_010="[{i HQ}]: Wygląda na to, że południowa baza jest głównym źródłem surowców potrzebnych do budowy eksperymentalnych bombowców. Jeśli uda ci się zniszczyć budynki produkujące te surowce, budowa bombowców zostanie opóźniona. Bez odbioru."
X03_M02_014_010="[{i HQ}]: Masz ich. Teraz budowa bombowców potrwa dwa razy dłużej. Bez odbioru."
X03_M02_015_010="[{i Kael}]: Długo czekałam na ten dzień, Burke. Twoja śmierć będzie ostatnim elementem planu, który stworzyłam wiele lat temu."
X03_M02_015_020="[{i Princess}]: Twój jedyny plan to siać śmierć i zniszczenie. Zawsze byłaś zbyt głupia, aby widzieć coś ponad swoje prozaiczne zachcianki."
X03_M02_015_030="[{i Kael}]: Tu się mylisz, Księżniczko. To wszystko jest przesądzone. Myślisz, że Marxon działał sam, kiedy zabił twojego ukochanego Thota? O, nie. To ja stałam za wszystkim. Od samego początku."
X03_M02_015_040="[{i Princess}]: Kłamiesz."
X03_M02_015_050="[{i Kael}]: Zakon zawsze dysponował prawdziwą mocą, Księżniczko. Ty byłaś tylko formalnością, czymś, co utrzyma w ryzach całą tę rozgadaną zgraję. Ale przestałaś być przydatna lata temu."
X03_M02_015_060="[{i Princess}]: Przysięgam, Kael, odpowiesz za swoje zbrodnie!"
X03_M02_015_070="[{i Kael}]: Zginiesz śmiercią głupca, Burke. Nikt nie będzie o tobie pamiętał, nikt nie wspomni twojego imienia. Zadbam o to osobiście."
X03_M02_016_010="[{i HQ}]: Na twoim terenie działają dwie bazy przeciwnika. Ta na południowym wschodzie jest dość typowa. Ta na północnym wschodzie --\n"
X03_M02_017_010="[{i Princess}]: Dowódcy, odbieram dziwne odczyty z bazy Seraphima na północnym wschodzie. Gromadzi on flotę dziwnych jednostek, a ich rozmiar sugeruje, że są w stanie spowodować straszliwe zniszczenia."
X03_M02_018_010="[{i HQ}]: Mam potwierdzenie informacji Burke. Seraphim buduje kilka eksperymentalnych bombowców tej samej klasy, która zniszczyła Ziemię. Jeśli wystartują, Księżniczka będzie miała poważne kłopoty. Zniszcz je albo Inżynierów, którzy je budują. Cokolwiek się stanie, nie pozwól na start. Bez odbioru."
X03_M02_019_010="[{i Rhiza}]: Musimy zniszczyć te bombowce!"
X03_M02_020_010="[{i Rhiza}]: Te bombowce muszą zostać zniszczone!"
X03_M02_021_010="[{i HQ}]: Mam trochę informacji o Seraphimie - używa głównie łodzi podwodnych i artylerii przeciwlotniczej do obrony swojej bazy. Nie będzie łatwo się tam dostać… zaczekaj chwileczkę..."
X03_M02_022_010="[{i HQ}]: Właśnie uruchomiliśmy nową jednostkę, okręt torpedowy T1. Posiada też ładunki przeciwtorpedowe, więc powinna sobie poradzić z tymi łodziami podwodnymi. Bez odbioru."
X03_M02_023_010="[{i Dostya}]: Otrzymałam informacje o sytuacji, dowódco. Właśnie ładujemy schematy konstrukcji nowej Barakudy T2. To wyspecjalizowany niszczyciel łodzi podwodnych, więc powinien pomóc ci zniszczyć te łodzie. Dostya, bez odbioru."
X03_M02_024_010="[{i Rhiza}]: Obrońco, oto Vesper, wyspecjalizowany łowca łodzi podwodnych. Użyj go, aby zniszczyć łodzie podwodne Seraphima. Rhiza, bez odbioru."
X03_M02_025_010="[{i Princess}]: Dowódco, mam urządzenie optyki kwantowej, które niweluje efekt kryształów i pozwala odkryć teren. Jednak z powodu ilości energii, którą zużywa, mogę go użyć jedynie raz na kilka minut."
X03_M02_025_020="[{i HQ}]: To powinno poradzić sobie z zakłócaniem. Kliknij Sygnał dowodzenia, a potem na obszarze, który chcesz zobaczyć. Odświeżymy sygnał, jak tylko będzie dostępny. Bez odbioru."
X03_M02_030_010="[{i HQ}]: Jeden bombowiec zniszczony. Bez odbioru."
X03_M02_040_010="[{i HQ}]: Jeden z bombowców został zniszczony. Bez odbioru."
X03_M02_050_010="[{i HQ}]: Kolejny zniszczony, dowódco. Bez odbioru."
X03_M02_060_010="[{i HQ}]: Jeśli te bombowce oderwą się od ziemi, Księżniczka jest zgubiona. Zniszcz je, dopóki znajdują się na ziemi. Bez odbioru\n"
X03_M02_070_010="[{i HQ}]: Te bombowce są prawie w połowie ukończone. Zniszcz je! Bez odbioru.\n"
X03_M02_080_010="[{i HQ}]: Bombowce zostały prawie całkowicie ukończone. Musisz je zniszczyć! Bez odbioru.\n"
X03_M02_081_010="[{i HQ}]: Seraphim przygotowuje się do ataku! To twoja ostatnia szansa! Zatrzymaj go! Bez odbioru.\n"
X03_M02_082_010="[{i HQ}]: O rany… Nie mogę uwierzyć. Udało ci się ich zniszczyć.\n"
X03_M02_090_010="[{i Princess}]: Dziękuję ci, dowódco. Te bombowce z łatwością przedarłyby się przez moje linie obrony. Teraz pozostaje nam wyeliminować dwóch dowódców Seraphimów."
X03_M02_100_010="[{i HQ}]: Atak właśnie się rozpoczyna i nic nie możemy na to poradzić. Poniosłeś porażkę. Księżniczkę czeka pewna śmierć. Bez odbioru.\n"
X03_M02_109_010="[{i Princess}]: Będę żyła na \"Drodze\"."
X03_M02_110_010="[{i Princess}]: Dziękuję ci, dowódco. Te bombowce z łatwością przedarłyby się przez moje linie obrony. Teraz pozostaje nam wyeliminować dwóch dowódców Seraphimów."
X03_M02_115_010="[{i Rhiza}]: NIEEEEEEEEEE!"
X03_M02_115_020="[{i Kael}]: Ha-ha-ha!"
X03_M02_116_010="[{i Fletcher}]: Słyszałem tutaj o całej masie dziwnych rzeczy, pułkowniku, i żadna z nich nie jest dobra. Wojna domowa Aeonów? Myślą, że mogą nas tak łatwo oszukać? Te dziwadła zabiją nas wszystkich, jeśli będą miały okazję. Niedługo zrobi się bardzo nieprzyjemnie. Poczekajcie tylko. Fletcher, bez odbioru."
X03_M02_117_010="[{i Dostya}]: Dowódco, pluskwa namierzająca wykryła sygnał wysłany do QAI, który na pewno pochodzi z przestrzeni Koalicji. Badam właśnie jego źródło. Dostya, bez odbioru."
X03_M02_120_010="[{i Princess}]: Mój obrońco, nie chciałabym odwracać twojej uwagi od nadchodzącej bitwy, ale muszę prosić cię o przysługę. Moi najbardziej oddani i wierni słudzy schronili się w małej świątyni na wschód od moich pozycji. Proszę, przetransportuj ich do Rhizy, aby mogli zostać natychmiast ewakuowani. Łódź jest przygotowana, odprowadzę ich w bezpieczne miejsce."
X03_M02_120_020="[{i HQ}]: Sygnał ruchu jest ustawiony na łódź. Odświeżę go w razie potrzeby. Bez odbioru."
X03_M02_130_010="[{i Princess}]: Łódź jest pod twoimi rozkazami, dowódco."
X03_M02_140_010="[{i Princess}]: Chroń ich, obrońco!"
X03_M02_150_010="[{i Princess}]: Łódź została zaatakowana!"
X03_M02_160_010="[{i Princess}]: Dziękuje ci, obrońco. Miło widzieć, że dobro i uprzejmość istnieje nawet w środku wojny."
X03_M02_170_010="[{i Princess}]: Oni… oni nie żyją… Już zawsze będę opłakiwać ich stratę."
X03_M02_180_010="[{i Princess}]: Proszę, uratuj moje sługi, obrońco."
X03_M02_190_010="[{i Princess}]: Słudzy są gotowi i czekają na twoje przybycie, obrońco."
X03_M02_200_010="[{i HQ}]: Cholera! Dotarli do bazy Księżniczki. Nie ma szans, żeby to przeżyła."
X03_M02_210_010="[{i Princess}]: Obrońco, moi słudzy chwilowo wzmocnią obronę na tym terenie.\n"
X03_M02_220_010="[{i HQ}]: Przesyłamy ci schematy konstrukcyjne Neptuna. To krążownik zaprojektowany z myślą o starciach z innymi statkami. Ma potężną siłę ognia, więc używaj go z głową. Bez odbioru."
X03_M02_230_010="[{i Rhiza}]: Obrońco, właśnie otrzymujesz schematy łodzi rakietowej. Zapewnia wsparcie dalekiego zasięgu przeciwko pozycjom obronnym. Rhiza, bez odbioru.\n"
X03_M02_240_010="[{i HQ}]: Jeden bombowiec zestrzelony. Bez odbioru.\n"
X03_M02_250_010="[{i HQ}]: Wygląda na to, że Seraphimowie nie skończą tego bombowca. Bez odbioru.\n"
X03_M02_260_010="[{i HQ}]: Jeden bombowiec mniej. Bez odbioru.\n"
X03_M02_270_010="[{i HQ}]: Seraphimowie nie zdołają skończyć tego bombowca. Bez odbioru."
X03_M02_280_010="[{i HQ}]: Cóż za piękny wybuch. Bez odbioru.\n"
X03_M02_290_010="[{i HQ}]: I jeszcze jeden bombowiec. Bez odbioru."
X03_M02_300_010="[{i HQ}]: To ostatni bombowiec Seraphimów. Bez odbioru.\n"
X03_M02_310_010="[{i HQ}]: Zamiast niszczyć same bombowce, możesz zniszczyć Inżynierów, którzy je budują. To może trochę ułatwić ci życie. Bez odbioru."
X03_M02_320_010="[{i HQ}]: Zniszcz Inżynierów, dowódco. Nie możemy pozwolić, aby te bombowce uniosły się w powietrze. Bez odbioru.\n"
X03_M02_330_010="[{i HQ}]: Mam potwierdzenie informacji Burke. Seraphim buduje kilka eksperymentalnych bombowców tej samej klasy, która zniszczyła Ziemię. Jeśli oderwą się od ziemi, Księżniczka będzie miała poważne kłopoty. Zniszcz bombowce lub inżynierów, którzy je konstruują. Cokolwiek się stanie, nie możesz pozwolić, aby, wystartowały. Bez odbioru. "
X03_M02_OBJ_010_010="Zniszcz eksperymentalne bombowce Seraphimów"
X03_M02_OBJ_010_020="Seraphimowie budują eskadrę eksperymentalnych bombowców. Nawet jeśli tylko jeden z nich zaatakuje Księżniczkę, nie ma ona szans. Zniszcz wszystkie 6 bombowców, zanim dotrą do Księżniczki."
X03_M02_OBJ_020_010="Doprowadź kapłanów w bezpieczne miejsce"
X03_M02_OBJ_020_020="Jak na razie Seraphimowie ignorowali małą świątynię w centrum obszaru, ale Księżniczka chciałaby, abyś doprowadził kapłanów w bezpieczne miejsce. Użyj sygnału ruchu, aby przemieścić łódź w oznaczone miejsce w pobliżu bazy Rhizy. Sygnał ruchu zostanie odnowiony zgodnie z potrzebami. Wykonanie tego zadania nie jest konieczne do ukończenia misji. Wykonaj je, jeśli zdołasz."
X03_M03_010_010="[{i HQ}]: Seraphimowie posiadają na tym obszarze dwie bazy, jedną na północ a drugą na zachód od kompleksu pałacowego Burke. Obie rzucają do walki z Burke wszystko, co mają, więc Księżniczka jest przyparta do muru. Chroń Burke i zniszcz dowódców Seraphimów. Bez odbioru\n"
X03_M03_015_010="[{i Brackman}]: Translator jest gotowy. O, tak. Dobra robota, moje dziecko, dobra robota. OJD Seraphimów, którą przejąłeś, była ostatnim elementem układanki."
X03_M03_020_010="[{i Princess}]: Dowódco, kilka moich generatorów zostało zniszczonych i muszę oszczędzać energię do utrzymania tarcz. Wybacz, ale musisz znaleźć inny sposób, aby poradzić sobie z zakłóceniami kryształów."
X03_M03_025_010="[{i Princess}]:  Dowódco, kilka moich generatorów zostało zniszczonych i muszę oszczędzać energię do utrzymania tarcz. Ale moi technicy przygotowali dla ciebie schematy Urządzenia optycznego; właśnie je do ciebie wysyłają."
X03_M03_050_010="[{i Princess}]: Seraphimowie atakują! Obawiam się, że moje linie obrony mogą nie wytrzymać!"
X03_M03_060_010="[{i Princess}]: Seraphimowie atakują ze wszystkich stron! Obawiam się, że moje linie obrony mogą nie wytrzymać!\n"
X03_M03_070_010="[{i HQ}]: Teraz jest naprawdę gorąco, dowódco. Seraphimowie atakują Burke wszystkim, co mają. Chroń ją. Bez odbioru\n"
X03_M03_080_010="[{i HQ}]: Te ataki nie ustaną, dopóki nie zniszczysz dowódców Seraphimów. Zmieć ich z powierzchni planety. Bez odbioru.\n"
X03_M03_090_010="[{i Princess}]: Dowódco, proszę, musisz mi pomóc. Boję się, że nie wytrzymam dłużej.\n"
X03_M03_100_010="[{i Princess}]: Dowódco! Seraphimowie atakują. Powstrzymaj ich!\n"
X03_M03_110_010="[{i HQ}]: Siły Seraphimów zostały pokonane. Bez odbioru."
X03_M03_120_010="[{i HQ}]: Nie zapomną o laniu, które im spuściłeś. Dobra robota. Bez odbioru."
X03_M03_124_010="[{i HQ}]: Księżniczka Burke jest ciągle w niebezpieczeństwie. Musisz zająć się Seraphimami."
X03_M03_125_010="[{i HQ}]: Nie możemy wydostać stąd Burke, dopóki Seraphimowie nie przestaną stanowić zagrożenia."
X03_M03_130_010="[{i Princess}]: On słabnie, dowódco!"
X03_M03_140_010="[{i Princess}]: Północny Seraphim odnosi dotkliwe straty! Nie przerywać natarcia!\n"
X03_M03_150_010="[{i Princess}]: Pospiesz się, dowódco, Seraphim na północy jest już prawie pokonany!\n"
X03_M03_160_010="[{i Princess}]: Seraphim na północy został pokonany. Dobra robota, dowódco..\n"
X03_M03_170_010="[{i Princess}]: Zachodni Seraphim stracił większość swojej infrastruktury. Nie daj mu czasu na odbudowę!"
X03_M03_180_010="[{i Princess}]: Zachodni Seraphim nie wytrzyma wiele więcej! Kontynuować natarcie!"
X03_M03_190_010="[{i Princess}]: Pospiesz się, zachodni Seraphim jest na krawędzi zniszczenia!"
X03_M03_200_009="[{i HQ}]: Cholera, ten śliski skurczybyk nam się wymknął."
X03_M03_200_010="[{i Princess}]: Uciekł. To nie ma znaczenia, zostanie pokonany innego dnia."
X03_M03_200_020="[{i HQ}]: Cholera, ten drań wyskoczył stąd i umknął.\n"
X03_M03_200_030="[{i HQ}]: Dowódca Seraphimów wycofał się i wyłączył bramę. Wygląda na to, że jego baza się wyłącza, więc nie musimy się nią martwić. Bez odbioru.\n"
X03_M03_201_010="[{i Princess}]: Mój pałac jest atakowany!"
X03_M03_202_010="[{i Princess}]: Mój pałac nie wytrzyma wiele więcej obrażeń!"
X03_M03_203_010="[{i Princess}]: Pospiesz się, dowódco, moje linie obrony słabną!"
X03_M03_204_010="[{i Princess}]: Musisz się pospieszyć, dowódco! Moje linie obrony niedługo zawiodą!"
X03_M03_210_010="[{i Fletcher}]: Seraphim na południu ma wyrzutnię pocisków jądrowych. Jest lekko broniona, więc nie powinieneś mieć problemów z jej zdobyciem. Nigdy nie wiadomo, kiedy możesz chcieć wystrzelić pocisk w kosmitę... albo w jednego ze swoich, tak zwanych, sojuszników.."
X03_M03_215_010="[{i Fletcher}]: Zdobądź tę wyrzutnię, jeśli jesteś w stanie. Fletcher, bez odbioru."
X03_M03_220_010="[{i Fletcher}]: Wyrzutnia jest twoja. Użyj jej dobrze. Fletcher, bez odbioru."
X03_M03_230_010="[{i Fletcher}]: To była wspaniała szansa, a ty wszystko spaprałeś. Fletcher, bez odbioru."
X03_M03_235_010="[{i Rhiza}]: Za bardzo obrywam--muszę się wycofać. Dowódco, kontynuuj walkę beze mnie!"
X03_M03_240_010="[{i HQ}]: Na wschód od ciebie znajduje się baza Księżniczki. Jej pałac musi przetrwać za wszelką cenę.\n"
X03_M03_250_010="[{i HQ}]: Jak widzisz, jej baza ma całkiem niezła obronę, ale nie wytrzyma długo w przypadku zmasowanego ataku.\n"
X03_M03_260_010="[{i HQ}]: Ta linia obrony jest jedynym powodem, dla którego kosmici nie przeprowadzają ataku lądowego. Sugerowałbym jej wzmocnienie."
X03_M03_270_010="[{i HQ}]: Bierz się za to, dowódco. Masz Księżniczkę do uratowania. Bez odbioru.\n\n"
X03_M03_280_010="[{i HQ}]: Namierzono dwóch dowódców Seraphimów na tym obszarze. Jeden znajduje się na zachód od Księżniczki, a drugi dokładnie na południe od niej. Zniszcz ich. Bez odbioru."
X03_M03_OBJ_010_010="Pokonaj północnego dowódcę Seraphimów"
X03_M03_OBJ_010_020="Aby Księżniczka była naprawdę bezpieczna, ten Seraphim musi zostać pokonany. Jego baza znajduje się na północ od pozycji Księżniczki."
X03_M03_OBJ_010_030="Pokonaj zachodniego dowódcę Seraphimów"
X03_M03_OBJ_010_040="Nie możemy pozwolić, aby Seraphimowie dalej atakowali Księżniczkę. Pokonaj dowódcę Seraphimów. Jego baza znajduje się na zachód od pozycji Księżniczki."
X03_M03_OBJ_010_050="Chroń pałac"
X03_M03_OBJ_010_060="Księżniczka dowodzi obroną z pałacu. Jeśli pałac upadnie, Księżniczka zginie, a twoja misja zakończy się niepowodzeniem."
X03_M03_OBJ_020_010="Zdobądź wyrzutnię pocisków strategicznych Seraphimów"
X03_M03_OBJ_020_020="Generał Fletcher wskazał słabo bronioną wyrzutnię strategiczną Seraphimów. Jeśli ją zdobędziesz, będziesz mógł jej użyć zgodnie z potrzebą. To zadanie nie jest wymagane do ukończenia misji. Wypełnij je, jeśli zdołasz."
X03_T01_010_010="[{i ZanAishahesh}]: Nigdy mnie nie pokonacie."
X03_T01_020_010="[{i ZanAishahesh}]: Mam tego więcej."
X03_T01_030_010="[{i ThelUuthow}]: Nigdy mnie nie pokonacie."
X03_T01_040_010="[{i ThelUuthow}]: Mam tego więcej."
X03_T01_050_010="[{i ZanAishahesh}]: Moja baza dalej działa. Nic nie osiągnąłeś."
X03_T01_060_010="[{i ZanAishahesh}]: Mogę wymienić te wieżyczki obronne."
X03_T01_070_010="[{i ThelUuthow}]: Moja baza wciąż stoi. Nic nie osiągnęliście."
X03_T01_080_010="[{i ThelUuthow}]: Mogę wymienić te wieżyczki obronne."
X03_T01_090_010="[{i ZanAishahesh}]: Mogę wymienić te generatory."
X03_T01_100_010="[{i ZanAishahesh}]: Mam pod dostatkiem masy."
X03_T01_110_010="[{i ThelUuthow}]: Mogę wymienić te generatory."
X03_T01_120_010="[{i ThelUuthow}]: Mam pod dostatkiem masy."
X03_T01_130_010="[{i ZanAishahesh}]: Teraz poznacie prawdziwą moc Seraphimów."
X03_T01_140_010="[{i ThelUuthow}]: Teraz poznacie prawdziwą moc Seraphimów."
X03_T01_150_010="[{i ZanAishahesh}]: Wasze linie obrony zaczynają zawodzić."
X03_T01_260_010="[{i ThelUuthow}]: Wasze linie obrony zaczynają zawodzić."
X03_T01_270_010="[{i ZanAishahesh}]: Wkrótce wasza ekonomia legnie w gruzach."
X03_T01_280_010="[{i ThelUuthow}]: Wkrótce wasza ekonomia legnie w gruzach."
X03_T01_290_010="[{i ZanAishahesh}]: To był twój najmocniejszy cios. Teraz moja kolej."
X03_T01_300_010="[{i ThelUuthow}]: To był twój najmocniejszy cios. Teraz moja kolej."
X03_T01_310_010="[{i ZanAishahesh}]: Usmażę mózg Brackmana na rożnie."
X03_T01_320_010="[{i ZanAishahesh}]: QAI bardzo nam pomógł."
X03_T01_330_010="[{i ThelUuthow}]: Usmażę mózg Brackmana na rożnie."
X03_T01_340_010="[{i ThelUuthow}]: QAI bardzo nam pomógł."
X03_T01_350_010="[{i ZanAishahesh}]: UEF jest skończone. Nie pozostanie nic prócz popiołów."
X03_T01_360_010="[{i ThelUuthow}]: UEF jest skończone. Nie pozostanie nic prócz popiołów."
X03_T01_370_010="[{i ZanAishahesh}]: Cybranie nie mają szans przeciwko nam."
X03_T01_410_010="[{i ThelUuthow}]: Cybranie nie mają szans przeciwko nam."
X03_T01_430_010="[{i ZanAishahesh}]: Ci nieudacznicy zrobią wszystko, co im powiem."
X03_T01_450_010="[{i ThelUuthow}]: Ci nieudacznicy zrobią wszystko, co im powiem."
X03_T01_470_010="[{i ZanAishahesh}]: Och, nie, wygląda na to, że jestem w niebezpieczeństwie."
X03_T01_480_010="[{i ThelUuthow}]: Och, nie, wygląda na to, że jestem w niebezpieczeństwie."
X03_T01_490_010="[{i ZanAishahesh}]: To honor zginąć, walcząc."
X03_T01_500_010="[{i ThelUuthow}]: To honor zginąć, walcząc."
X04_B01_000_010="711346"
X04_B01_001_010="Otrzymaliśmy informacje, że dwóch dowódców Seraphimów wylądowało na planecie Hades. Moim zdaniem szykują wielką ofensywę, a zajęcie Hadesu jest pierwszym krokiem w przygotowaniach. Planujemy ich zaskoczyć, więc ty i Dostya złożycie im małą wizytę."
X04_B01_002_010="Przez ostatnie trzy lata nie byliśmy w stanie przechwycić choćby skrawka informacji na temat ruchów Seraphimów, a teraz zdobywamy tak szczegółowe informacje? Wydaje mi się to zbyt korzystne."
X04_B01_002_020="Wiadomość otrzymaliśmy od uśpionej komórki działającej w przestrzeni Seraphimów. Twierdzisz, że nie powinniśmy im ufać?"
X04_B01_002_030="Mało jest ludzi, którym ufam, szczególnie w świetle ostatnich wydarzeń. Ale Cybranin nigdy nie odwróciłby się od swych braci i sióstr, a już na pewno nie w tak ciężkich czasach."
X04_B01_002_040="Jedyne, co wiemy, to że dowódcy Seraphimów zaczęli budować bramy kwantowe. Nawet jeśli te informacje są podejrzane, nie możemy im pozwolić ukończyć tych bram. Jeśli zostaną uruchomione, Seraphimowie będą w stanie zaatakować każdy system. A na to nie możemy pozwolić."
X04_B01_002_050="Zadanie jest proste, dowódco. Zaatakujesz bazę południową, podczas gdy Dostya zajmie się dowódcą Seraphimów działającym na północy. Brackman ukończył prace nad translatorem; właśnie jest ładowany do twojej OJD."
X04_B01_003_010="Podamy więcej informacji, gdy tylko będą dostępne. Powodzenia."
X04_DB01_010_010="[{i Brackman}]: Moja ukochana Dostya odeszła, zabita przez jednego z naszych. Nie mam słów, aby opisać mój żal, moje dziecko, nie mam słów. Jesteśmy tak blisko zwycięstwa, a jednak ci, których znamy i którym ufamy, są gotowi nas zdradzić. Musimy zająć się QAI. O, tak. I Hex5. Niektórych zbrodni nie można wybaczyć. Wiesz, co masz robić."
X04_DB01_010_020="[{i Brackman}]: Biedna Dostya. Zabił ją jej akcent, o tak. Prosiłem ją, żeby nie zachowywała się po rosyjsku, ale nie chciała słuchać. Nie chciała słuchać."
X04_DB01_020_010="[{i Brackman}]: Seraphimowie są niepowstrzymani. Tak niewielu nas zostało. Tak niewielu. Ukryje się, poczekam na właściwy moment. Nie ma innego wyjścia. Innego wyboru."
X04_M01_010_010="[{i HQ}]: Obydwaj dowódcy wylądowali i operacja ma zielone światło. Bez odbioru."
X04_M01_012_010="[{i HQ}]: Technicy stworzyli dla ciebie nowa zabawkę - Psiarnię. To automatyczna jednostka naprawcza, która naprawi wszystko w swoim zasięgu. Baw się dobrze. Bez odbioru."
X04_M01_013_010="[{i HQ}]: Brackman stworzył dla ciebie nowa zabawkę - Rój. To automatyczna jednostka naprawcza, która naprawi wszystko w swoim zasięgu. Baw się dobrze. Bez odbioru."
X04_M01_020_010="[{i Dostya}]: Wykryłam bazę przeciwnika dwa kilometry na północ od mojej pozycji. Rozpocznę natarcie za 10 minut. Dostya, bez odbioru."
X04_M01_020_020="[{i HQ}]: Zrozumiałem. Dowódco, mamy odczyty o pozycjach nieprzyjaciela na zachód od ciebie. Zlikwiduj je. Bez odbioru."
X04_M01_020_030="[{i Dostya}]: Rozpoczynam atak. Opór jest minimalny i nie widzę w okolicy wrogiej OJD. Centrum Dowodzenia, masz jakieś odczyty z tego sektora?"
X04_M01_020_040="[{i HQ}]: Nie. Na skanerach czysto. Bez odbioru."
X04_M01_020_050="[{i Dostya}]: Miejcie oczy otwarte, Centrum. Nie chciałabym być zaskoczona."
X04_M01_020_060="[{i HQ}]: I tak nie mam nic lepszego do roboty. Bez odbioru."
X04_M01_021_010="[{i HQ}]: Zrozumiano."
X04_M01_022_010="[{i Dostya}]: Rozpoczynam atak. Opór jest minimalny i nie widzę w okolicy wrogiej OJD. Centrum Dowodzenia, masz jakieś odczyty z tego sektora?"
X04_M01_022_020="[{i HQ}]: Nie. Na skanerach czysto. Bez odbioru."
X04_M01_022_030="[{i Dostya}]: Miejcie oczy otwarte, Centrum. Nie chciałabym być zaskoczona."
X04_M01_022_040="[{i HQ}]: I tak nie mam nic lepszego do roboty. Bez odbioru."
X04_M01_023_010="[{i HQ}]: Mam nadzieję, że nie jest wam zbyt wygodnie, dowódco. Masz swoje własne problemy."
X04_M01_024_010="[{i HQ}]: Na zachód od ciebie znajduje się baza przeciwnika."
X04_M01_025_010="[{i Dostya}]: Dowódco, mam kilka Cegieł w pogotowiu. Użyj sygnału dowodzenia, aby wydać im rozkazy. Dostya, bez odbioru."
X04_M01_026_010="[{i HQ}]: Zaatakuj ją i zniszcz. I uważaj na kontratak. Ci kosmici to podstępne skurczybyki.\n"
X04_M01_027_010="[{i Dostya}]: Centrum dowodzenia, wypełniłam swój cel i umacniam pozycje. Dostya, bez odbioru."
X04_M01_027_020="[{i HQ}]: Zrozumiałem. Bez odbioru."
X04_M01_028_010="[{i HQ}]: Zrozumiano. Bez odbioru."
X04_M01_030_010="[{i Dostya}]: Wypełnij swój cel tak szybko, jak to możliwe, dowódco. Dostya, bez odbioru."
X04_M01_040_010="[{i Dostya}]: Wykonaj swoje zadanie tak szybko, jak to możliwe, dowódco. Dostya, bez odbioru."
X04_M01_050_010="[{i HQ}]: Wszystkie cele operacji zostały osiągnięte. Przygotujcie się do powrotu. Zabieramy was z tej skały. Bez odbioru."
X04_M01_050_020="[{i Dostya}]: Mam problem… funkcja powrotu nie działa. Centrum, możesz to potwierdzić? Przetestuj bramę powrotną. Centrum, zgłoś się."
X04_M01_050_030="[{i Dostya}]: Dowódco, straciliśmy łączność z dowództwem Koalicji i nie możemy wrócić. Chwila… rejestruję coś na zachodzie. Wygląda na system zagłuszający - to on musi blokować naszą łączność. Zlokalizuj i zniszcz urządzenie zakłócające. Dostya, bez odbioru."
X04_M01_060_010="[{i Dostya}]: Dowódco, straciliśmy łączność z dowództwem Koalicji i nie możemy wrócić. Chwila… rejestruję coś na zachodzie. Wygląda na system zagłuszający - to on musi blokować naszą łączność. Zlokalizuj i zniszcz urządzenie zakłócające. Dostya, bez odbioru."
X04_M01_OBJ_010_010="Zniszcz bazę Seraphimów"
X04_M01_OBJ_010_020="Nasz wywiad uważa, że ta baza będzie punktem przerzutowym podczas nowej ofensywy Seraphimów. Zniszcz całą bazę."
X04_M01_OBJ_010_030="Zaatakuj Seraphimów Cegłami Rhizy."
X04_M01_OBJ_010_035="Wydaj Dostyi sygnał do ataku opancerzonym robotem bojowym."
X04_M01_OBJ_010_040="Zaatakuj Seraphimów samolotami Dostyi."
X04_M01_OBJ_010_045="Wyznacz cel, który mają zaatakować bombowce i śmigłowce Dostyi.\n"
X04_M02_001_010="[{i Dostya}]: Dowódco, straciliśmy łączność z dowództwem Koalicji i nie możemy wrócić. "
X04_M02_002_010="[{i Dostya}]:  Chwila… rejestruję coś na zachodzie."
X04_M02_003_010="[{i Dostya}]: Wygląda na system zagłuszający - to on musi blokować naszą łączność."
X04_M02_004_010="[{i Dostya}]: Zniszcz urządzenie zakłócające. Dostya, bez odbioru."
X04_M02_010_010="[{i Dostya}]: Dowódco, inne urządzenia zakłócają pole kwantowe, pozbawiając nas możliwości powrotu i pomocy. Kontynuuj atak i zniszcz systemy blokujące naszą łączność. Kiedy łączność zostanie wznowiona, centrum dowodzenia będzie mogło udzielić nam informacji, jak zlikwidować zakłócenia kwantowe. Dostya, bez odbioru."
X04_M02_010_020="[{i Dostya}]: Zwiadowca Seraphimów właśnie przeleciał nad moją pozycją. Wiedzą, że tu jesteśmy. Zniszcz to urządzenie. Dostya, bez odbioru."
X04_M02_020_010="[{i Dostya}]: Widzę to urządzenie. To nie może być prawda… wygląda jak prototyp urządzenia, nad którym pracował dr Brackman. Zniszcz je. Musimy dotrzeć do centrum dowodzenia. Bez odbioru."
X04_M02_030_010="[{i Dostya}] Zniszcz urządzenie zakłócające! Musimy ponownie nawiązać kontakt z dowództwem Koalicji!"
X04_M02_040_010="[{i Dostya}]: Musisz zniszczyć urządzenie zakłócające! Pospiesz się! Seraphimowie mogą zaatakować w każdej chwili!"
X04_M02_045_010="[{i Dostya}]: Mój szwadron jednostek powietrznych czeka w gotowości, dowódco. Jeśli dasz mi sygnał do ataku, wyślę je we wskazane miejsce."
X04_M02_046_010="[{i Dostya}]: Mój Rozpruwacz Dusz czeka w gotowości, dowódco. Jeśli dasz mi sygnał do ataku, wyślę go we wskazane miejsce."
X04_M02_047_010="[{i Dostya}]: Moje Rozpruwacze Dusz czekają w gotowości, dowódco. Jeśli dasz mi sygnał do ataku, wyślę je we wskazane miejsce."
X04_M02_048_010="[{i Dostya}]: Jestem pod ciężkim ostrzałem i muszę wycofać swoje siły powietrzne. Nie przerywaj ataku, dowódco. Zniszczenie urządzenia zakłócającego to nasza jedyna nadzieja."
X04_M02_050_010="[{i Dostya}]: Urządzenie zniszczone! Dostya do centrum dowodzenia, odbiór!"
X04_M02_050_020="[{i HQ}]: Wykryliśmy przynajmniej dwa ślady kwantowe, musicie--"
X04_M02_050_030="[{i Dostya}]: Słuchajcie mnie! Seraphimowie mają urządzenie zakłócające, które uniemożliwia nasz powrót. Jest poza naszym zasięgiem, musicie znaleźć sposób, żeby zniwelować jego działanie."
X04_M02_050_040="[{i HQ}]: Trzymajcie się. Zabierzemy was stamtąd najszybciej, jak tylko się da."
X04_M02_050_050="[{i Dostya}]: Poinformujcie generała Halla, że Koalicja jest zagrożona. Konstrukcja jednego z urządzeń zakłócających była oparta na prototypie dr. Brackmana; nikt inny o tym nie wie. Nie ma wątpliwości, że w naszych szeregach działa zdrajca."
X04_M02_050_060="[{i Dostya}]: Widzę wrogie jednostki… setki jednostek przeciwnika zbliża się do mojej pozycji. Zabierzcie nas stąd!"
X04_M02_051_010="[{i Dostya}]: Poinformuj generała, że zostaliśmy zdradzeni! To urządzenie zakłócające było oparte na prototypie opracowanym przez dr Brackman… och, nie, setki jednostek przeciwnika zbliżają się do mojej pozycji. Zabierzcie nas stąd, Centrum!"
X04_M02_060_010="[{i HQ}]: Otrzymałeś pozwolenie od Brackmana, aby otrzymać Wieszcza. Generuje on tysiące nanokamer, które pozwalają ci obserwować okolicę. Doskonały do wykrywania ukrytych ataków. Bez odbioru.\n"
X04_M02_OBJ_010_010="Zlokalizuj i zniszcz urządzenie zakłócające QAI"
X04_M02_OBJ_010_020="Dowódca Dostya namierzyła źródło zakłóceń. Znajduje się na zachód od waszych pozycji. Zlokalizuj i zniszcz urządzenie namierzające, abyście mogli nawiązać kontakt z Centrum dowodzenia."
X04_M03_010_010="[{i Dostya}]: Dowódco, przygotuj się do obrony! Ja ich zatrzymam."
X04_M03_010_020="[{i HQ}]: Dowódco, jaki jest twój status?"
X04_M03_010_030="[{i Dostya}]: Atakują ze wszystkich stron… moje linie obrony zaczynają padać. Widzę OJD, ale nie jest to konstrukcja Seraphimów. To jednostka cybrańska..."
X04_M03_010_040="[{i Hex5}]: Jesteś głupia, skoro sprzeciwiasz się Panu, Dostyo. A teraz zapłacisz za swoją bezczelność."
X04_M03_010_050="[{i Dostya}]: Hex5! Powinnam się domyślić, że jeśli ktokolwiek miałby zdradzić naszego ukochanego ojca, to będziesz to ty."
X04_M03_010_060="[{i Hex5}]: A teraz zapłacisz za tę obrazę. Żegnaj Dostyo."
X04_M03_010_070="[{i Dostya}]: Trafiają mnie z każdej strony... jest ich zbyt wielu... zbyt wielu..."
X04_M03_010_080="[{i HQ}]: Dowódco, zgłoś się! Czy mnie słyszysz?"
X04_M03_011_010="[{i HQ}]: Dowódco, jaki jest twój status?"
X04_M03_012_010="[{i Dostya}]: Atakują ze wszystkich stron… moje linie obrony zaczynają padać. Widzę OJD, ale nie jest to konstrukcja Seraphimów. To jednostka cybrańska..."
X04_M03_013_010="[{i Hex5}]: Jesteś głupia, skoro sprzeciwiasz się Panu, Dostyo. A teraz zapłacisz za swoją bezczelność."
X04_M03_014_010="[{i Dostya}]: Hex5! Powinnam się domyślić, że jeśli ktokolwiek miałby zdradzić naszego ukochanego ojca, to będziesz to ty."
X04_M03_015_010="[{i Hex5}]: A teraz zapłacisz za tę obrazę. Żegnaj Dostyo."
X04_M03_016_010="[{i Dostya}]: Trafiają mnie z każdej strony... jest ich zbyt wielu... zbyt wielu..."
X04_M03_017_010="[{i HQ}]: Dowódco, zgłoś się! Czy mnie słyszysz?"
X04_M03_020_010="[{i HQ}]: Dowódco, jednostki przeciwnika podążają w twoim kierunku. Utrzymaj linie obrony do czasu, aż będziemy w stanie cię ewakuować. Bez odbioru."
X04_M03_020_020="[{i OumEoshi}]: Wielki dowódca, Dostya, nie żyje. Ty będziesz następny."
X04_M03_020_030="[{i HQ}]: Wygląda na to, że udało ci się poradzić z pierwszym atakiem, ale my ciągle szukamy sposobu na poradzenie sobie z ich zakłócaniem. Trzymaj się. Bez odbioru."
X04_M03_021_010="[{i OumEoshi}]: Wielki dowódca, Dostya, nie żyje. Ty będziesz następny."
X04_M03_022_010="[{i HQ}]: Ciągle staramy się znaleźć sposób na zniwelowanie efektu zakłócającego. Bez odbioru.\n"
X04_M03_030_010="[{i Rhiza}]: Każdego dnia moja wściekłość rośnie. Przetrwaj i wróć do domu, obrońco, abyśmy mogli pomścić śmierć Dostyi i zniszczyć Seraphimów raz na zawsze. Rhiza, bez odbioru."
X04_M03_040_010="[{i Hall}]: Zrób wszystko, aby przeżyć, dowódco. Nie możemy sobie pozwolić, by stracić również ciebie. Hall, bez odbioru."
X04_M03_050_010="[{i Brackman}]: Nie… Dostya… moja ukochana Dostya..."
X04_M03_055_010="[{i OumEoshi}]: Teraz rozumiecie beznadziejność swojego położenia. Wiemy to, co wy wiecie, widzimy, co wy widzicie. Nie możecie nas powstrzymać."
X04_M03_056_010="[{i HQ}]: Rhiza poprosiła, abyśmy przekazali ci plany konstrukcji artylerii Zbawienia. To szybkostrzelna artyleria, która pokrywa teren niewielkimi pociskami. Bez odbioru."
X04_M03_057_010="[{i OumEoshi}]: Czas ludzkości się kończy. Zostaniecie wytępieni."
X04_M03_060_010="[{i HQ}]: Technicy skończyli rekonfigurację rdzeni zasilających, ale potrzebujemy jeszcze 15 minut zanim będziemy w stanie zabrać cię z tego piekła. Staraj się przeżyć. Bez odbioru."
