X04_M03_090_010="[{i OumEoshi}]: Podzielisz los Riley i Clarke'a. Żegnaj pułkowniku."
X04_M03_100_010="[{i Kael}]: Strata ciebie i dowódcy Dostyi jednego dnia. To będzie więcej, niż Brackman będzie w stanie znieść."
