X04_M03_120_010="[{i HQ}]: Przygotuj torebkę na wypadek pawia, dowódco, będzie ostro. Powrót za 5, 4, 3, 2, 1."
X04_M03_130_010="[{i Brackman}]: Moja ukochana Dostya, ona musi wrócić do domu, moje dziecko. Musi wrócić do domu. Proszę, zlokalizuj jej szczątki. Nie mogę jej tam zostawić."
X04_M03_140_010="[{i Brackman}]: Dowódco, proszę odzyskać szczątki Ivanny."
X04_M03_150_010="[{i Brackman}]: Nie możemy zostawić Ivanny na tej planecie, dowódco. Znajdź ją. Sprowadź ją do domu."
X04_M03_160_010="[{i Brackman}]: Dziękuję ci, moje dziecko. Dziękuję ci."
X04_M03_170_010="[{i Rhiza}]: Obrońco, Lojalistom udało się przechwycić część kodów Seraphimów. Jeśli uda ci się zająć radar Seraphimów, będziemy mogli użyć tych kodów, aby przejąć kontrolę nad częścią ich budowli obronnych. Zaatakuj radar według uznania. Rhiza, bez odbioru."
X04_M03_175_010="[{i Rhiza}]: Obrońco, Lojalistom udało się przechwycić część kodów Seraphimów. Jeśli uda ci się zająć radar Seraphimów, będziemy mogli użyć tych kodów, aby wydać rozkaz autodestrukcji jednostkom obronnym. Zaatakuj radar według uznania. Rhiza, bez odbioru."
X04_M03_180_010="[{i Rhiza}]: Zajmij radar, jeśli zdołasz. Rhiza, bez odbioru."
X04_M03_190_010="[{i Rhiza}]: Zajęcie radaru złagodzi nieco ataki, Obrońco. Rhiza, bez odbioru."
X04_M03_200_010="[{i Rhiza}]: Cudownie! Zaatakuj, kiedy ich obrona jest pogrążona w chaosie. Rhiza, bez odbioru."
X04_M03_210_010="[{i HQ}]: Cholera, nieźle sobie poradziłeś. Transportujemy cię z powrotem. Bez odbioru.\n"
X04_M03_220_010="[{i HQ}]: Dowódco, pozostań w pobliżu swojej bazy. Jeśli zbytnio się oddalisz, nie będziemy mogli cię namierzyć i przetransportować. Bez odbioru.\n"
X04_M03_230_010="[{i HQ}]: Wracaj do bazy, dowódco. Nie możemy cię namierzyć. Bez odbioru.\n"
X04_M03_240_010="[{i HQ}]: Zostań w obrębie swojej bazy, dowódco. Musimy namierzyć twoją pozycję, żeby cię stąd zabrać. Bez odbioru.\n"
X04_M03_250_010="[{i HQ}]: Namierzyliśmy twoją OJD. Już prawie cię mamy.\n"
X04_M03_260_010="[{i Brackman}]: Cześć, tu Jamison, głos dr. Brackmana. Twoje umiejętności robią takie wrażenie, że przez ciebie wypadłem z roli i będę musiał nagrywać mój VO od początku! Daj mi chwilę, muszę znowu wpisać hasło... o, tak... teraz lepiej, dużo lepiej. Dużo lepiej."
X04_M03_270_010="[{i HQ}]: Było cholernie blisko, dowódco. Cieszę się, że wróciłeś do nas w jednym kawałku."
X04_M03_OBJ_010_010="Przetrwaj do momentu powrotu"
X04_M03_OBJ_010_020="Seraphimowie mają dodatkowe urządzenia zakłócające rozmieszczone na planecie, które uniemożliwiają twój powrót. Przetrwaj do momentu, gdy Centrum dowodzenia zwalczy zakłócenia i będzie mogło przenieść twoją OJD."
X04_M03_OBJ_010_030="Odzyskaj szczątki Dostyi (Cybranie)"
X04_M03_OBJ_010_040="Dr Brackman chciałby, abyś odzyskał szczątki Ivanny Dostya, aby mogła zostać godnie pochowana na ziemi Cybran."
X04_M03_OBJ_010_050="Zajmij radar Seraphimów (Aeonowie)"
X04_M03_OBJ_010_060="Rhiza ma kody, które Lojaliści wykradli Seraphimom. Jeśli uda ci się zdobyć radar dalekiego zasięgu, kody zostaną rozesłane po znacznym obszarze, co spowoduje, że niektóre wieżyczki obronne Seraphimów zmienią strony i zaczną strzelać do własnych jednostek i budynków."
X04_T01_001_010="[{i OumEoshi}]: Twoje jednostki eksperymentalne są rzeczywiście kłopotliwe. Zostaną zniszczone zanim je ukończysz."
X04_T01_002_010="[{i OumEoshi}]: Podziwiam twój upór, ale nie pozwolę ci ukończyć tej jednostki eksperymentalnej."
X04_T01_003_010="[{i OumEoshi}]: Twoja zagłada jest nieunikniona, jednak nie mogę pozwolić ci ukończyć tej jednostki eksperymentalnej."
X04_T01_010_010="[{i OumEoshi}]: Wasza galaktyka wkrótce będzie nasza."
X04_T01_020_010="[{i OumEoshi}]: Tylko jeden gatunek może osiągnąć perfekcję."
X04_T01_030_010="[{i OumEoshi}]: Nie przejmuj się. Śmierć z mojej ręki jest największym zaszczytem."
X04_T01_040_010="[{i OumEoshi}]: Wkrótce będzie nas więcej niż kiedykolwiek mógłbyś pokonać."
X04_T01_050_010="[{i Hex5}]: Nigdy nie zapominam obrazy, nieważne jak małej. Dlatego Dostya zapłaciła najwyższą cenę."
X04_T01_060_010="[{i Hex5}]: Pan kontroluje wszystko, co widzi. Jest nieskończony i wieczny."
X04_T01_070_010="[{i Hex5}]: Wkrótce Pan będzie kontrolował wszystkich Cybran, a oni pokłonią się przed nim."
X05_B01_000_010="711349"
X05_B01_001_010="Szczelina kwantowa, przez którą Seraphimowie pierwotnie przedostali się do naszej galaktyki, jest niestabilna, co uniemożliwia im wezwanie posiłków. Dowiedzieliśmy się jednak, że konstruują oni Łuk kwantowy, który ma ustabilizować szczelinę. Kiedy Łuk zostanie ukończony, Seraphimowie będą w stanie wezwać niezliczone ilości jednostek."
X05_B01_001_020="Nie możemy na to pozwolić."
X05_B01_002_010="Rozpoczęliśmy ataki na Węzeł Siódmej Ręki, gromadząc wszelkie informacje, które mogą się okazać przydatne. O, tak. Podczas jednego z tych ataków dowiedzieliśmy się, że główna jednostka centralna QAI znajduje się na Pearl II."
X05_B01_002_020="QAI musi zostać zniszczona, moje dziecko, musi zostać zniszczona. Udam się z tobą na Pearl II i wyłączę ją osobiście. O, tak. Potem użyjemy jej kodów do bram, aby udać się bezpośrednio na Ziemię, omijając wszystkie systemy po drodze."
X05_B01_002_030="To nasza jedyna szansa, aby zniszczyć Łuk zanim zacznie on funkcjonować. Jeśli nie uda nam się zdobyć tych kodów, nie mamy szans na dotarcie na Ziemię. Okoliczne systemy są po prostu zbyt silnie bronione."
X05_B01_002_040="QAI jest wynaturzeniem. Myliłem się, decydując się ją stworzyć. Tak bardzo się myliłem. O, tak. Tyle błędów, które trzeba pokonać. Ale ten jeden mogę naprawić. Ten jeden naprawię. Nieważne za jaką cenę."
X05_B01_002_050="Dowódco, zostaniesz przetransportowany i utworzysz przyczółek. Kiedy teren będzie bezpieczny, dołączy do ciebie generał Fletcher a po nim dr Brackman."
X05_B01_002_060="Niedługo się zobaczymy, moje dziecko. Juz niedługo."
X05_DB01_010_010="[{i Brackman}]: Zanim QAI została zniszczona wydobyłem z niej kody do bram. Droga na Ziemię stoi otworem. O, tak. Modlę się, aby inwazja była skuteczna. To jedyna nadzieja, aby zmazać dawne winy, zacząć od początku. Musisz zwyciężyć, moje dziecko, zwyciężyć dla nas wszystkich. "
X05_DB01_020_010="[{i Hall}]: Gustaf nie żyje, a QAI bez wątpienia rozprzestrzenia się po wielu systemach. Wszystko poszło w diabły. Cybranie poszli w rozsypkę, a Łuk Seraphimów jest już pewnie na ukończeniu. Ogłaszam masową ewakuację. Nie mamy innego wyjścia, jak tylko się ukryć."
X05_DB01_030_010="[{i HQ}]: Operacja zakończyła się porażką. Wszystko stracone.\n"
X05_DB01_040_010="[{i HQ}]: Dowódco, czy mnie słyszysz? Cholera, myślę, że dowódca nie ży --\n"
X05_M01_010_010="[{i HQ}]: Twoim pierwszym zadaniem jest oczyszczenie terenu z jednostek przeciwnika, tak, aby Fletcher mógł zostać przetransportowany i założyć bazę."
X05_M01_010_020="[{i Hex5}]: Przykro mi z powodu Dostyi. Pan czuł, że była bardzo obiecująca. Byłaby doskonałym uczniem."
