X05_M01_110_010="[{i Fletcher}]: Co za bałagan. Cybranie walczą między sobą? Aeonowie zmieniają strony tylko dlatego, że pokazała się jakaś księżniczka? Nie możemy już nikomu ufać. Liczy się tylko błękit UEF. Fletcher, bez odbioru."
