X05_M01_OBJ_010_010="Oczyść teren dla dowódcy brygady Fletchera."
X05_M01_OBJ_010_020="Oczyść teren lądowania, żeby Fletcher mógł jak najszybciej rozpocząć rozbudowę."
X05_M01_OBJ_010_030="Zniszcz bazy ogniowe Hex5"
X05_M01_OBJ_010_040="Na całym terenie rozproszone są bazy Hex5. Wyeliminowanie ich pomoże w redukcji mocy Hex5 i zapobiegnie przyszłym atakom."
X05_M01_OBJ_010_050="Uratuj dowódcę Lojalistów"
X05_M01_OBJ_010_060="W czasie misji wróg przechwycił lojalistkę. Jeśli uda ci się ją uratować, może okazać się pomocna."
