X05_M01_OBJ_010_075="Wydaj dr Brackmanowi sygnał do przemieszczenia się we wskazane miejsce."
X05_M02_010_010="[{i Hex5}]: Nie jesteś w stanie pojąć naszej potęgi. Pan jest nieskończony, a jego mądrość nieprzebrana. Nigdy nas nie pokonasz."
