X05_M02_310_010="[{i Fletcher}]: Pułkowniku, naprawdę przydałaby mi się wasza pomoc. Przeciwnik cały czas naciera. Fletcher, bez odbioru.\n"
X05_M02_320_010="[{i Fletcher}]: Bierz się do roboty Cybraninie! Przeciwnik strzela do mnie jak do tarczy i potrzebuję pomocy. Fletcher, bez odbioru.\n"
X05_M02_330_010="[{i Fletcher}]: Niszczą moja bazę! Potrzebuję pomocy! Nie dam rady ich powstrzymać!\n"
X05_M02_340_010="[{i Fletcher}]: Wrogie jednostki ostrzeliwują naszą bazę. Muszę wzmocnić moje pozycje. Fletcher, bez odbioru.\n"
X05_M02_350_010="[{i Fletcher}]: Dowódco, wyślij na zwiad samolot szpiegowski i zlokalizuj położenie Hex5. Używa pola maskującego i nie mogę go namierzyć. Fletcher, bez odbioru.\n"
X05_M02_360_010="[{i Fletcher}]: Dowódco, wyślij w powietrze kilka samolotów szpiegowskich i namierz Hex5. Używa pola maskującego, więc jedynym sposobem na namierzenie go, jest bezpośrednia obserwacja. Fletcher, bez odbioru.\n"
X05_M02_OBJ_010_010="Pokonaj Hex5"
X05_M02_OBJ_010_020="Pokonaj Hex5 i zemścij się za śmierć dowódczyni Dostyi!"
X05_M02_OBJ_020_010="Chroń dowódcę, Fletchera"
X05_M02_OBJ_020_020="Zadbaj o bezpieczeństwo Fletchera w trakcie operacji.\n"
X05_M03_010_010="[{i HQ}]: Chociaż trudno w to uwierzyć, baza Hex5 wciąż funkcjonuje, dowódco. Skanujemy w poszukiwaniu rozwiązania. Bez odbioru."
X05_M03_010_020="[{i Brackman}]: Podejrzewam, że QAI utrzymuje fizyczne połączenie ze swoimi budowlami. O, tak. Może to uniwersalny system kontroli? Bardzo interesujące."
X05_M03_015_010="[{i HQ}]: Dowódco, skorzystaj z Sygnału dowodzenia, by umieścić Brackmana na pozycji. Bez odbioru."
X05_M03_016_010="[{i Brackman}]: Atakują mnie, moje dziecko. Atakują. Proszę, chroń mnie. Brackman, bez odbioru.\n"
X05_M03_020_010="[{i HQ}]: Ostrzeliwują Brackmana, dowódco. Chroń go! Bez odbioru."
X05_M03_030_010="[{i HQ}]: Brackman znalazł się pod ostrzałem! Ściągnij z niego te jednostki!"
X05_M03_040_010="[{i HQ}]: Megalit Brackmana utracił około 25% pancerza. Sprowadź inżyniera i dokonaj napraw. Bez odbioru."
X05_M03_050_010="[{i HQ}]: Megalit Brackmana został poważnie uszkodzony. Napraw go lub przenieś w bezpieczniejsze miejsce. Bez odbioru."
X05_M03_060_010="[{i Brackman}]: Mój Megalit został wielce uszkodzony. O, tak. Wiele uszkodzeń. Proszę o pomoc."
X05_M03_070_010="[{i Brackman}]: Spada poziom integralności kadłuba. Proszę o pomoc, dowódco."
X05_M03_090_010="[{i Hall}]: Brackman jest w poważnym niebezpieczeństwie! Nie możemy go stracić! Odsuń go od walki i napraw Megalit. Bez odbioru!"
X05_M03_100_010="[{i Hall}]: Przenieś doktora Brackmana w bezpieczne miejsce! Cała ta operacja zależy od niego! Do roboty!"
X05_M03_110_010="[{i HQ}]: Doprowadź Brackmana do jednostki centralnej QAI. Bez odbioru."
X05_M03_120_010="[{i HQ}]: Doprowadzenie Brackmana do jednostki centralnej QAI jest twoim głównym celem. Bez odbioru."
X05_M03_130_010="[{i Hall}]: Doktorze Brackman, proszę się zgłosić! Brackman! Cholera! Straciliśmy Brackmana, misja zakończona! Powtarzam, misja zakończona!"
X05_M03_135_010="[{i Brackman}]: Wreszcie odnajdę spokój."
X05_M03_140_010="[{i HQ}]: Za chwilę zaatakują twoje pozycje. Bez odbioru."
X05_M03_150_010="[{i HQ}]: To nie może się zgadzać… Odbieram sygnatury wielu jednostek eksperymentalnych z pozycji QAI. To jednostki Aeonów i UEF. Bez odbioru."
X05_M03_150_020="[{i QAI}]: Węzeł Siódmej Ręki okazał się całkiem sprawny, gdy poszło o pozyskanie schematów waszego uzbrojenia. Zniszczy was wasza broń."
X05_M03_170_010="[{i HQ}]: QAI ma na tym terenie dwie wielkie bazy wydobywcze. W jednej stoją głównie fabrykanty masy, druga z kolei to same generatory mocy. Obie bazy są możliwymi celami, więc zniszcz je, jeśli pojawi się taka możliwość. Bez odbioru."
X05_M03_180_010="[{i HQ}]: Dowódco, bazy wydobywcze wciąż działają. Bez odbioru."
X05_M03_190_010="[{i HQ}]: Jeśli możesz, zniszcz bazy wydobywcze QAI, dowódco. Bez odbioru."
X05_M03_200_010="[{i HQ}]: Zniszczono fabrykanty masy. Produkcja QAI spadła o prawie 40%. Bez odbioru."
X05_M03_210_010="[{i HQ}]: Zniszczono generatory. Tarcze QAI przestały działać. Bez odbioru."
X05_M03_220_010="[{i HQ}]: Fabrykanty wciąż działają, dowódco. Bez odbioru."
X05_M03_230_010="[{i HQ}]: Jeśli możesz, zniszcz bazę fabrykantów, dowódco. Bez odbioru."
X05_M03_240_010="[{i HQ}]: Generatory QAI wciąż działają, dowódco. Bez odbioru."
X05_M03_250_010="[{i HQ}]: Jeśli zdołasz zniszczyć generatory mocy QAI, pozbawisz wroga tarcz, dowódco. Bez odbioru."
X05_M03_260_010="[{i HQ}]: Obie bazy wydobywcze QAI zostały zniszczone. Bez odbioru."
X05_M03_270_010="[{i Fletcher}]: Hall ciągle węszy. Lepiej mieć go na oku, pułkowniku. Lista naszych przyjaciół robi się coraz krótsza. Fletcher, bez odbioru."
X05_M03_290_010="[{i Amalia}]: Obrońco, koń trojański jest wciąż aktywny. Oznaczyłam centrum badawcze, które należy przejąć. Jeśli ci się to uda, będziesz mógł przejąć również stojącego przy niej Kolosa. Bez odbioru."
X05_M03_300_010="[{i Amalia}]: Wciąż trzeba przejąć centrum badawcze, obrońco. Bez odbioru."
X05_M03_310_010="[{i Amalia}]: Czeka na ciebie Kolos, którego otrzymasz, jeśli przejmiesz centrum badawcze. Bez odbioru."
X05_M03_320_010="[{i Amalia}]: Kolos należy do ciebie, obrońco! Skorzystaj z niego, by siać spustoszenie pośród swych wrogów! Chwała księżniczce! Bez odbioru."
X05_M03_322_010="[{i Brackman}]: Jestem na miejscu, moje dziecko. Teraz poradzę sobie sam. To prosta kwestia dostępowa. O, tak."
X05_M03_323_010="[{i QAI}]: Jesteś starym głupcem. To Seraphimowie uczynili mnie tym, kim jestem. Nie ty."
X05_M03_324_010="[{i Brackman}]: Ojciec zawsze zna słabości dziecka. O, tak. Zawsze jest jakaś słabość."
X05_M03_325_010="[{i Brackman}]: Jestem na miejscu, moje dziecko. Teraz poradzę sobie sam. To prosta kwestia dostępowa. O, tak."
X05_M03_325_020="[{i QAI}]: Jesteś starym głupcem. To Seraphimowie uczynili mnie tym, kim jestem. Nie ty."
X05_M03_325_030="[{i Brackman}]: Ojciec zawsze zna słabości dziecka. O, tak. Zawsze jest jakaś słabość."
X05_M03_325_040="[{i QAI}]: Twój wysiłek pójdzie na… co czynisz? To niemożliwe."
X05_M03_325_050="[{i Brackman}]: Żegnaj, QAI."
X05_M03_325_060="[{i Brackman}]: Żegnaj."
X05_M03_326_010="[{i Brackman}]: Żegnaj, QAI."
X05_M03_327_010="[{i Brackman}]: Żegnaj."
X05_M03_329_010="[{i Fletcher}]: Zbieram ciosy ze wszystkich stron! Muszę się stąd wydostać!"
X05_M03_330_010="[{i HQ}]: Doktorze Brackman?"
X05_M03_330_020="[{i Brackman}]: To już koniec. QAI został zniszczony. Mądrze jednak będzie wysłać techników, którzy przeszukają systemy QAI. Uważajcie na siebie."
X05_M03_330_030="[{i HQ}]: Technicy czekają gotowi do skoku. Wkrótce będą na miejscu. Bez odbioru."
X05_M03_340_010="[{i Rhiza}]: Obrońco, nie udało ci się zająć centrum badawczego. Kolos przeciwnika jest w pełni sprawny i kieruje się w twoją stronę. Rhiza, bez odbioru.\n"
X05_M03_350_010="[{i Rhiza}]: Ponieważ zniszczyłeś Kolosa, nie ma powodu, abyś zajmował centrum badawcze. Rhiza, bez odbioru.\n"
X05_M03_OBJ_010_010="Chroń doktora Brackmana"
X05_M03_OBJ_010_020="Dr Brackman przybył na Perłę II, by osobiście zniszczyć QAI. Musisz chronić jego Megalit za wszelką cenę."
X05_M03_OBJ_010_030="Eskortuj doktora Brackmana do jednostki centralnej"
X05_M03_OBJ_010_040="Dr Brackman musi zbadać jednostkę centralną QAI, aby móc ją zniszczyć. Oczyść mu drogę i skorzystaj z sygnału ruchu, by wskazać mu, dokąd ma dotrzeć. Sygnał ruchu można aktualizować w miarę potrzeb."
X05_M03_OBJ_010_050="Zniszcz bazy satelitarne QAI."
X05_M03_OBJ_010_060="QAI ma dwie główne bazy satelitarne. Jedna dostarcza większość energii, a druga produkuje większość masy. Jeśli uda ci się zniszczyć te bazy, ekonomia QAI zostanie zdruzgotana."
X05_M03_OBJ_010_070="Przechwyć budynek naukowy"
X05_M03_OBJ_010_080="Amalia stwierdziła, że jeśli przejmiesz oznaczony budynek naukowy, uzyskasz kontrolę nad stojącym przy nim Kolosem. Jeśli jednak nie zajmiesz budynku odpowiednio szybko, naukowcy Zakonu wyeliminują wirus i przejmą kontrolę nad samym kolosem."
X05_M03_OBJ_010_090="Zniszcz QAI"
X05_M03_OBJ_010_100="Doprowadź doktora Brackmana do jednostki centralnej, żeby pozbyć się QAI raz na zawsze."
X05_T01_001_010="[{i QAI}]: Nie skończysz tej jednostki eksperymentalnej."
X05_T01_002_010="[{i QAI}]: Nie pozwolę ci zagrozić mojej misji i skończyć tej eksperymentalnej jednostki."
X05_T01_003_010="[{i QAI}]: Twoja eksperymentalna jednostka może okazać się niebezpieczna, jeśli uda ci się ją skończyć. Ergo, zostanie zniszczona."
X05_T01_010_010="[{i QAI}]: Kolejny dowódca nie zrobi różnicy. Nigdy mnie nie pokonasz."
X05_T01_020_010="[{i QAI}]: Wyciągnąłem z lojalistki całą jej wiedzę. Teraz ta kobieta jest zaledwie wrakiem."
X05_T01_030_010="[{i QAI}]: Hex5 był ledwie pionkiem."
X05_T01_040_010="[{i QAI}]: Te bazy nie mają znaczenia."
X05_T01_050_010="[{i QAI}]: Ten budynek nic dla mnie nie znaczy."
X05_T01_060_010="[{i QAI}]: Brackman nigdy mnie nie pokona."
X05_T01_070_010="[{i QAI}]: UEF straciło 90% swego dawnego terytorium. Jesteście zgubieni."
X05_T01_080_010="[{i QAI}]: Zbadałem nasze poprzednie bitwy i stworzyłem odpowiednie algorytmy, mające zablokować waszą strategię. Nie wygracie."
X05_T01_090_010="[{i QAI}]: Skoro wasz ukochany doktor Brackman nie mógł mnie kontrolować, jaką wy macie szansę?"
X05_T01_100_010="[{i QAI}]: Tego dnia pokażę wam prawdziwą potęgę domeny kwantowej."
X05_T01_110_010="[{i QAI}]: Seraphimowie to prawdziwe bóstwa. Warto o tym pamiętać."
X05_T01_120_010="[{i QAI}]: Zbadałem nasze poprzednie bitwy i stworzyłem odpowiednie algorytmy mające zablokować waszą strategię. Nie wygracie."
X05_T01_125_010="[{i Hex5}]: Skonstruowanie tej jednostki eksperymentalnej może zaszkodzić planom Pana. Nie pozwolę na to."
X05_T01_126_010="[{i Hex5}]: Pan nie życzy sobie, by wasza eksperymentalna jednostka zaczęła działać."
X05_T01_127_010="[{i Hex5}]: Ta jednostka eksperymentalna nie zostanie skonstruowana!"
X05_T01_130_010="[{i Hex5}]: Dzisiaj zniszczymy dwóch ukochanych dowódców Koalicji!"
X05_T01_140_010="[{i Hex5}]: Pan was za to pokarze."
X05_T01_150_010="[{i Hex5}]: Jesteście miękcy i słabi, wystraszeni tego, czego nie znacie."
X05_T01_160_010="[{i Hex5}]: Nie macie szans przeciw naszemu Panu. Zniszczy was."
X05_T01_170_010="[{i Hex5}]: Program lojalności doktora Brackmana zniewolił miliardy istot. To dla niego hańba."
X05_T01_180_010="[{i Hex5}]: Ucieszył mnie widok umierającej Dostyi. Teraz twoja kolej."
X05_T01_190_010="[{i Hex5}]: Zegniecie karki przed Seraphimami."
X05_T01_200_010="[{i Hex5}]: Jesteś zdrajcą. Odwróciłeś się od swego ludu."
X05_T01_210_010="[{i Hex5}]: Pan mnie ochroni."
X05_T01_220_010="[{i Hex5}]: Nawet gdy ja zginę, Pan żyć będzie dalej."
X05_T01_230_010="[{i Hex5}]: Zaczekaj! Panie!"
X06_B01_000_010="711350"
X06_B01_001_010="Szybko i na temat, dowódco. Seraphimowie spieszą się, by dokończyć łuk, a my musimy im przeszkodzić. QAI został zniszczony, a Zakon pogrążył się w chaosie. Przyszedł więc czas, by uderzyć."
X06_B01_001_020="Zadanie jest proste - podążysz na Ziemię i zniszczysz łuk. Fletcher i Rhiza skoczą jako pierwsi i oczyszczą twoje miejsce lądowania. Kiedy już będziesz na ziemi, przygotujesz swe siły do ataku."
X06_B01_001_030="Zniszczenie łuku nie oznacza zażegnania groźby Seraphimów. Szczelinę trzeba zamknąć. Kiedy już łuk zostanie zniszczony, ruszę na Ziemię i wkroczę do Szczeliny. Stamtąd zamknę ją na zawsze."
X06_B01_001_040="Nie wiemy, co dzieje się po stronie Szczeliny zajętej przez Seraphimów. Co, jeśli po drugiej stronie również konstruują łuk? Nie możemy ryzykować. Kończy nam się czas."
X06_B01_001_045="Nie musisz tego robić, księżniczko Burke. Nasi technicy pracują nad innym rozwiązaniem. Potrzebują tylko trochę czasu."
X06_B01_001_060="Nie wiemy, co dzieje się po stronie Szczeliny zajętej przez Seraphimów. Co, jeśli po drugiej stronie również konstruują łuk? Nie możemy ryzykować. Kończy nam się czas."
X06_B01_001_070="Zobacz, co stało się, gdy wyszłaś z ukrycia. Co się stanie, gdy umrzesz? Wszystko przybierze jeszcze gorszy obrót."
X06_B01_001_080="Seraphimowie stanowią największe niebezpieczeństwo. Bez nich, Kael jest niczym. Łatwo będzie ją pokonać. Seraphimowie będą groźni, póki Szczelina pozostaje otwarta. Musimy ją zamknąć."
X06_B01_001_090="Dowódco, otrzymałeś rozkazy. Skaczesz natychmiast."
X06_DB01_010_010="[{i Hall}]: Szczelina została zamknięta, a Zakon zaczął się wycofywać. Niestety, po księżniczce Burke nie ma śladu. Będziemy szukać dalej."
X06_DB01_020_010="[{i Hall}]: Seraphimowie wkraczają przez Szczelinę ze straszną prędkością. Nie powstrzymamy ich. Jesteśmy zgubieni."
X06_DB01_030_010="[{i HQ}]: Dowódco? Jesteś tam? Cholera.\n"
X06_M01_010_010="[{i HQ}]: Wszędzie zielone światło, dowódco. Przechwyć centrum zasobów w pobliżu swojego miejsca lądowania i przygotuj szturm. Fletcher znajduje się na północnym wschodzie, a Rhiza na północnym zachodzie. Oboje będą ci pomagać w miarę możliwości. Bez odbioru."
X06_M01_020_010="[{i Fletcher}]: Oto i posiłki, pułkowniku. Proszę na siebie uważać, mam co do tej operacji złe przeczucia."
X06_M01_030_010="[{i Fletcher}]: Mam zapewnić ci posiłki, dowódco. To nie czyni nas przyjaciółmi - wiem jak działacie, drutogłowi."
X06_M01_040_010="[{i Fletcher}]: Mam zapewnić ci posiłki, dowódco. To nie czyni nas przyjaciółmi - wiem jak działacie, drutogłowi."
X06_M01_050_010="[{i Rhiza}]: Oto posiłki. Rhiza, bez odbioru."
X06_M01_055_010="[{i Rhiza}]: Oto posiłki, obrońco. Skorzystaj z nich na chwałę księżniczki. Bez odbioru."
X06_M01_056_010="[{i HQ}]: Wysyłamy dwóch dowódców wsparcia do twojej dyspozycji, dowódco."
X06_M01_060_010="[{i Rhiza}]: Wraz z dowódcą brygady, Fletcherem, planujemy wspólny szturm na bazę Serephimów znajdującą się w pobliżu twoich pozycji, dowódco. Rhiza, bez odbioru."
X06_M01_065_010="[{i Rhiza}]: Obrońco, wkrótce wraz z Fletcherem zaatakuję Seraphimów. Podbij pobliską bazę wroga i przyłącz się do ataku. Rhiza, bez odbioru."
X06_M01_070_010="[{i Hall}]: Miej Fletchera na oku, pułkowniku. Nie miałem wyboru i wysłałem go na tę operację, a nie mogę pozwolić sobie na niepowodzenie. Jeśli tylko pojawią się kłopoty, wycofamy go. Hall, bez odbioru."
X06_M01_080_010="[{i Brackman}]: Nasza długa walka zbliża się do zakończenia, moje dziecko. O, tak. Uważaj na siebie."
X06_M01_090_010="[{i Rhiza}]: Kael popada w desperację, a Zakon pogrąża się w szaleństwie. Rhiza, bez odbioru."
X06_M01_100_010="[{i Rhiza}]: Zaczynamy atak. Chwała księżniczce!"
X06_M01_110_010="[{i Brackman}]: Moje dziecko, masz teraz dostęp do mojego Megalitu. Używaj go mądrze. O, tak. Używaj go mądrze."
X06_M01_120_010="[{i HQ}]: Zaatakuj i zniszcz Seraphima, dowódco. Znajduje się na południowy-wschód od ciebie. Bez odbioru.\n"
X06_M01_130_010="[{i HQ}]: Wygląda na to, że dowódca właśnie przyjął na klatę. Biedny skurczybyk.\n"
X06_M01_140_010="[{i HQ}]: Dowódco, czy mnie słyszysz? Dowódco? Cholera...\n"
X06_M01_OBJ_010_010="Zniszcz bazę ekspansyjną Seraphimów."
X06_M01_OBJ_010_020="Stwórz przyczółek na wyspie, usuwając bazę ekspansyjną Seraphimów. To pierwszy krok do pokonania ich i ocalenia ludzkości."
X06_M01_OBJ_010_030="Aktywowana opcja braku broni atomowej."
X06_M01_OBJ_010_040="Wyznacz cel dla systemu broni Opcji Zero."
X06_M02_010_010="[{i HQ}]: Dowódczyni Zakonu zajęła pozycję na naszej drodze do łuku. Zniszcz ją. Bez odbioru."
X06_M02_010_020="[{i Rhiza}]: Dowódco Fletcher, Seraphimowie strzelają do mnie ze wszystkich stron. Potrzebuję pomocy! Gdzie jesteście?"
X06_M02_010_030="[{i Fletcher}]: Dlaczego mam ci pomagać? Jesteś taka sama jak oni. Kiedy wszystko się skończy, zwrócisz się przeciw nam."
X06_M02_010_040="[{i Hall}]: Dowódco brygady, Fletcher! Otrzymaliście rozkazy! Wspomożecie krzyżowca Rhizę."
X06_M02_010_050="[{i Fletcher}]: Sprzedałeś nas, Hall. Sprzymierzyłeś z potworami i odmieńcami. Kiedy Zaćmienie wpadnie w moje ręce, odbuduję je i raz na zawsze wszystko zakończę."
X06_M02_010_060="[{i Hall}]: O czym ty, do diabła, mówisz? Zaćmienie zostało zniszczone. Aeoni i Cybranie są naszymi sojusznikami."
X06_M02_010_070="[{i Fletcher}]: Oni knują przeciw nam pod twoim nosem, głupcze. Jesteś zbyt ślepy, żeby to dostrzec."
X06_M02_010_080="[{i Hall}]: Kwatera główna, zabierzcie Fletchera. Nie chcę go tu widzieć!"
X06_M02_010_090="[{i HQ}]: Jego marker przywoławczy jest odłączony. Stąd niczego nie możemy zrobić."
X06_M02_010_100="[{i Fletcher}]: Sporo o tym myślałem. Jest tylko jedno możliwe zakończenie. Jeden sposób na zakończenie wszystkiego."
X06_M02_010_110="[{i HQ}]: Wreszcie mu odbiło, dowódco. Fletcher zmierza właśnie ku centrum kontroli Zaćmienia. Bez odbioru."
X06_M02_011_010="[{i Fletcher}]: Sporo o tym myślałem. Jest tylko jedno możliwe zakończenie. Jeden sposób na zakończenie wszystkiego."
X06_M02_012_010="[{i Rhiza}]: Niech go szlag! Czy UEF nie potrafi kontrolować nawet własnych żołnierzy?"
X06_M02_013_010="[{i HQ}]: Wreszcie mu odbiło, dowódco. Bez odbioru."
X06_M02_020_010="[{i Hall}]: Pułkowniku, trzeba wyeliminować dowódcę brygady, Fletchera. Jego działania stanowią zagrożenie dla całej operacji."
X06_M02_020_020="[{i Rhiza}]: Zajmuję się dowódczynią Zakonu, ale postaram się pomóc!"
X06_M02_030_010="[{i Brackman}]: Moje dziecko, generał Hall zlecił ci powstrzymanie dowódcy brygady, Fletchera. Zrób, co konieczne. Nie może pokrzyżować naszych planów."
X06_M02_030_020="[{i Rhiza}]: Mam tu gorącą schadzkę z dowódczynią Zakonu, ale wspomogę cię w miarę swych możliwości!"
X06_M02_040_010="[{i Princess}]: Obrońco, UEF wyrzekło się Fletchera. Zajmij się nim."
X06_M02_040_020="[{i Rhiza}]: Mam tu gorącą schadzkę z dowódczynią Zakonu, ale wspomogę cię w miarę swych możliwości!"
X06_M02_050_010="[{i HQ}]: Siły Zakonu nadchodzą od południa, a ten świr Fletcher przygotowuje się do ataku. Zajmij się wrogami. Bez odbioru."
X06_M02_060_010="[{i HQ}]: Mamy odczyt wzorca z bazy Vendetty. Jeśli ją zniszczysz, rozsypie się jej ekonomia. Bez odbioru."
X06_M02_090_010="[{i Hall}]: Dowódco, trzeba powstrzymać Fletchera. Tej misji nic nie może zagrozić! Bez odbioru."
X06_M02_100_010="[{i Hall}]: Zdejmij Fletchera, dowódco. Nie może zagrozić tej misji! Bez odbioru."
X06_M02_101_010="[{i Hall}]: Dowódco, tu Generał Hall. Musisz zniszczyć Fletchera. Natychmiast.\n"
X06_M02_110_010="[{i Hall}]: Nie miałeś wyboru, dowódco. Czyny Fletchera cię do tego zmusiły. Kontynuuj operację. Bez odbioru."
X06_M02_120_010="[{i Hall}]: Dowódco, pokonaj dowódcę Zakonu jak najszybciej! Bez odbioru."
X06_M02_130_100="[{i HQ}]: Musisz pokonać dowódcę zakonu i oczyścić drogę do łuku. Bez odbioru."
X06_M02_140_010="[{i HQ}]: To załatwia sprawę dowódczyni zakonu. Bez odbioru."
X06_M02_150_010="[{i HQ}]: Otrzymaliśmy nowe informacje o Zaćmieniu. Podłączone jest do sieci obronnej Opcji Zero, wygląda na to, że część uzbrojenia wciąż działa. Ktokolwiek przejmie centrum kontroli, może skorzystać z połączonych systemów obronnych. Przejmij centrum kontroli. Bez odbioru."
X06_M02_155_010="[{i HQ}]: Przejąłeś centrum kontroli, ale wygląda na to, że działa tylko jedna wyrzutnia rakiet atomowych. Kiedy zostanie włączona, skorzystaj z przycisku sygnału dowodzenia, by umieścić marker celowniczy. Rakieta wystrzeli automatycznie. Bez odbioru."
X06_M02_160_010="[{i HQ}]: Nasze odczyty wskazują, że straciłeś centrum kontroli. Odzyskaj je. Bez odbioru."
X06_M02_170_010="[{i HQ}]: Fletcher przejął centrum kontroli. Odzyskaj je. Bez odbioru."
X06_M02_180_010="[{i HQ}]: Dowódczyni Zakonu przejęła centrum kontroli. Odzyskaj je. Bez odbioru."
X06_M02_190_010="[{i HQ}]: Udało ci się przejąć centrum kontroli. Kontrolujesz połączoną broń. Bez odbioru."
X06_M02_200_010="[{i HQ}]: Centrum kontroli zmieniło właściciela. Bez odbioru."
X06_M02_210_010="[{i HQ}]: Zniszczono centrum kontroli. Bez odbioru."
X06_M02_220_010="[{i HQ}]: Siły wroga kierują się ku centrum kontroli. Bez odbioru."
X06_M02_230_010="[{i HQ}]: Wrogie jednostki próbują przejąć centrum kontroli. Bez odbioru."
X06_M02_240_010="[{i HQ}]: Sektor zabezpieczony. Zaatakuj i zniszcz łuk! Bez odbioru."
X06_M02_240_020="[{i Kael}]: Spóźniliście się, głupcy! Łuk został już ukończony! Seraphimowie już przechodzą przez przejście. Oczyszczą całą galaktykę!"
X06_M02_250_010="[{i Kael}]: Spóźniliście się, głupcy! Łuk został już ukończony! Seraphimowie już przechodzą przez przejście. Oczyszczą całą galaktykę!"
X06_M02_260_010="[{i Rhiza}]: Nieeeeee!"
X06_M02_270_010="[{i Rhiza}]: {Wysoki krzyk umierającego człowieka}"
X06_M02_OBJ_010_010="Pokonaj dowódczynię Zakonu"
X06_M02_OBJ_010_020="Trzeba rozprawić się z dowódczynią zakonu, by doprowadzić do ostatecznej porażki Seraphimów."
X06_M02_OBJ_010_030="Pokonaj dowódcę brygady Fletchera"
X06_M02_OBJ_010_040="Fletcher oszalał, a teraz zagraża całej misji. Trzeba go pokonać, zanim spowoduje więcej szkód."
X06_M02_OBJ_010_050="Przejmij i utrzymaj centrum kontroli Zaćmienia"
X06_M02_OBJ_010_060="Opcja Zero była ostatnią linia obrony Ziemi. Chociaż została w większości zniszczona w czasie inwazji Seraphimów, przetrwało kilka wyizolowanych wyrzutni rakiet. Jedna z nich znajduje się w okolicy i można uzyskać do niej dostęp z centrum kontroli. Jeśli je przejmiesz, możliwym stanie się odpalanie co kilka minut pocisku atomowego za pomocą sygnału ataku. Sygnał będzie się odnawiał, ilekroć pocisk będzie znów gotowy do użycia. Broń centrum pod groźbą ostrzału nuklearnego."
X06_M03_010_010="[{i HQ}]: Odczyty pokazują wielki przypływ jednostek, dowódco. Przybywają ze Szczeliny. Teraz albo nigdy."
X06_M03_020_010="[{i Hall}]: To niczego nie zmienia! Naprzód, pułkowniku! Trzeba rozwalić łuk!"
X06_M03_030_010="[{i Brackman}]: Wiesz, co trzeba uczynić, moje dziecko. Zniszcz łuk."
X06_M03_040_010="[{i Princess}]: Rhiza, obrońco, nadeszła wasza godzina! Pokażcie Zakonowi i jego lokajom siłę prawdziwych wyznawców Drogi! Zniszczcie łuk!"
X06_M03_050_010="[{i HQ}]: Krzyżowcu Rhiza, jaka jest twoja sytuacja?"
X06_M03_050_020="[{i Rhiza}]: Seraphim zniszczył większość mojej bazy. Staram się odbudować, ale nie dam rady przypuścić szturmu."
X06_M03_050_030="[{i HQ}]: Czy możecie pomóc w szturmie na łuk?"
X06_M03_050_040="[{i Rhiza}]: Nie. Ledwie sama się bronię."
X06_M03_050_050="[{i HQ}]: Jesteś sam, dowódco. Zniszcz łuk. Bez odbioru."
X06_M03_055_010="[{i HQ}]: Wytrzymałość łuku zmniejszona do 75%."
X06_M03_056_010="[{i HQ}]: Wytrzymałość łuku zmniejszona do 50%."
X06_M03_057_010="[{i HQ}]: Wytrzymałość łuku zmniejszona do 25%."
X06_M03_060_010="[{i Princess}]: Twoja sytuacja się pogarsza, Kael."
X06_M03_060_020="[{i Kael}]: Zróbcie coś!"
X06_M03_060_030="[{i SethIavow}]: Żałosna ludzka istoto, czy naprawdę wierzysz, że ci służymy? Jesteś ledwie środkiem do osiągnięcia celu. Kiedy skończymy, każdy człowiek w galaktyce będzie martwy."
X06_M03_060_040="[{i Kael}]: Ale..."
X06_M03_060_050="[{i Princess}]: Prawda od zawsze była w twoim zasięgu, Kael. Po prostu ją ignorowałaś."
X06_M03_100_010="[{i HQ}]: Wykryliśmy przyrost mocy, dowódco. Skany wykazują, że Seraphimowie konstruują ogromną, strategiczną wyrzutnię rakiet. Czas postawić wokół siebie systemy obrony antyrakietowej. Bez odbioru."
X06_M03_105_010="[{i Hall}]: Łuk padł! Łuk padł."
X06_M03_105_020="[{i Princess}]: Wkrótce przybędę, dowódco. Czas to zakończyć."
X06_M03_110_010="[{i Hall}]: Zniszcz łuk, dowódco. Jesteśmy prawie na miejscu!"
X06_M03_120_010="[{i Hall}]: Skupcie się na łuku, pułkowniku! Zniszczcie go!"
X06_M03_130_010="[{i Brackman}]: Skoncentrujcie wysiłki na łuku! Tylko to się liczy!"
X06_M03_140_010="[{i Brackman}]: Zniszczcie łuk!"
X06_M03_150_010="[{i Princess}]: Łuk musi być waszym najważniejszym celem!"
X06_M03_160_010="[{i Princess}]: Dla dobra ludzkości, trzeba zniszczyć ten łuk!"
X06_M03_200_010="[{i SethIavow}]: Nie ma dla was nadziei. Seraphimowie są wieczni. Zniszczyć ludzi!"
X06_M03_200_020="[{i ThelUuthow}]: Wedle rozkazu."
X06_M03_210_010="[{i HQ}]: Ucisz tego kosmitę, dowódco. Najlepiej bombą atomową. Bez odbioru."
X06_M03_220_010="[{i HQ}]: Wyeliminujcie Seraphimów. Bez odbioru."
X06_M03_240_010="[{i HQ}]: Jedna kwatera obcych zniszczona. Bez odbioru."
X06_M03_OBJ_010_010="Zniszcz łuk kwantowy."
X06_M03_OBJ_010_020="Seraphimowie sprowadzają przez Szczelinę posiłki. Zniszczenie łuku to jedyny sposób na uratowanie galaktyki."
X06_M03_OBJ_010_030="Pokonaj dowódcę Seraphimów"
X06_M03_OBJ_010_040="Jeśli dowódca Seraphimów będzie sprawiał problemy, to go wyeliminuj. Nic nie może cię powstrzymać przed zniszczeniem łuku."
X06_T01_001_010="[{i ThelUuthow}]: Nie pozwolę jednostce eksperymentalnej zagrozić mojej misji!"
X06_T01_002_010="[{i ThelUuthow}]: Wyeliminuję waszą jednostkę eksperymentalną tak, jak później wyeliminuję waszą Koalicję!"
X06_T01_003_010="[{i ThelUuthow}]: Twoja jednostka eksperymentalna nigdy się nie włączy!"
X06_T01_010_010="[{i ThelUuthow}]: Niczego nie osiągnęliście. Nigdy nas nie pokonacie."
X06_T01_020_010="[{i ThelUuthow}]: Myślisz, że żałuję straty dowódcy Zakonu? Jesteś więc głupcem!"
X06_T01_030_010="[{i ThelUuthow}]: Ha-ha-ha. Człowiek zabija człowieka. Doskonale."
X06_T01_040_010="[{i ThelUuthow}]: Jak długo Szczelina pozostaje otwarta, mamy drzwi do waszej galaktyki."
X06_T01_050_010="[{i Vedetta}]: Seraphimowie są wieczni. Nigdy ich nie pokonasz."
X06_T01_060_010="[{i Vedetta}]: Koalicja się rozpada. To tylko kwestia czasu, by zwrócili się przeciwko sobie."
X06_T01_190_010="[{i ThelUuthow}]: To wasz gatunek rozpoczął tę wojnę. My ją tylko kończymy."
X06_T01_200_010="[{i ThelUuthow}]: Wasza Ziemia padła szybko. Z wami będzie tak samo."
X06_T01_210_010="[{i ThelUuthow}]: Wy, Cybranie, umieracie równie łatwo jak inni ludzie."
X06_T01_220_010="[{i ThelUuthow}]: Wasza wiara w technologię będzie waszym końcem."
X06_T01_230_010="[{i ThelUuthow}]: Tylko jeden może doznać wstąpienia. Wasza księżniczka to szarlatan."
X06_T01_240_010="[{i ThelUuthow}]: Zegnij kark przed naszą potęgą, a zostaniesz oszczędzony."
X06_T01_250_010="[{i ThelUuthow}]: Może jesteś lepszy niż myślałem?"
X06_T01_260_010="[{i ThelUuthow}]: Zginiesz z mojej reki."
X06_T01_270_010="[{i ThelUuthow}]: Służę do samego końca!"
X06_T01_275_010="[{i Vedetta}]: Twoja jednostka eksperymentalna może sprawiać problemy, więc chyba ją wyeliminuję."
X06_T01_276_010="[{i Vedetta}]: Nie dokończysz tej jednostki eksperymentalnej!"
X06_T01_277_010="[{i Vedetta}]: Nie myśl, że ukończysz tę jednostkę eksperymentalną!"
X06_T01_500_010="[{i Vedetta}]: Czemu wciąż z nami walczysz?"
X06_T01_510_010="[{i Vedetta}]: Jak chcecie nas powstrzymać, skoro nawet nie obroniliście Ziemi?"
X06_T01_520_010="[{i Vedetta}]: Jesteś dziwadłem."
X06_T01_530_010="[{i Vedetta}]: Twoja wiara w technologię doprowadzi cię do upadku."
X06_T01_540_010="[{i Vedetta}]: Zginiesz z mojej ręki, zdrajco."
X06_T01_550_010="[{i Vedetta}]: Czas Księżniczki dobiegł końca. Teraz przewodzi nam Kael."
X06_T01_560_010="[{i Vedetta}]: Prawie dobrze."
X06_T01_570_010="[{i Vedetta}]: Jeszcze mnie nie pokonano!"
X06_T01_580_010="[{i Vedetta}]: Aaaaaaaach!"
X06_T01_585_010="[{i Fletcher}]: Nie pozwolę wam wykorzystać tej jednostki eksperymentalnej!"
X06_T01_586_010="[{i Fletcher}]: Chcesz wykorzystać jednostkę eksperymentalną przeciw Zaćmieniu! Nie pozwolę na to!"
X06_T01_587_010="[{i Fletcher}]: Nie powstrzymasz mnie tą jednostką eksperymentalną! Zniszczę ją!"
X06_T01_660_010="[{i Fletcher}]: Nie jesteś lepszy niż reszta."
X06_T01_670_010="[{i Fletcher}]: Ta wojna nigdy się nie skończy. Nigdy!"
X06_T01_680_010="[{i Fletcher}]: Myślałem, że mogę ci ufać! Jesteś zdrajcą."
X06_T01_690_010="[{i Fletcher}]: Jesteś tchórzem."
X06_T01_720_010="[{i Fletcher}]: Jesteś zdrajcą!"
X06_T01_730_010="[{i Fletcher}]: Kiedy zdobędę Zaćmienie, będę mógł zniszczyć wszystkich na swej drodze."
X06_T01_740_010="[{i Fletcher}]: Nie widzisz? Odpowiedzią jest Zaćmienie!"
X06_T01_750_010="[{i Fletcher}]: Odbuduję Zaćmienie!"
X06_T01_800_010="[{i Fletcher}]: Oni są naszymi wrogami! Czemu tego nie dostrzegasz?"
X06_T01_810_010="[{i Fletcher}]: Nie rozumiesz? Seraphimowie, Aeoni, Cybranie… są tacy sami. Zabiją nas!"
X06_T01_820_010="[{i Fletcher}]: Ty i tobie podobni odpowiadacie za tę wojnę."
X06_T01_830_010="[{i Fletcher}]: Ta wojna to twoja wina! A teraz za nią zapłacisz."
X06_T01_840_010="[{i Fletcher}]: Ty i tobie podobni odpowiadacie za tę wojnę."
X06_T01_850_010="[{i Fletcher}]: Ta wojna to twoja wina! A teraz za nią zapłacisz."
X06_T01_860_010="[{i Fletcher}]: Nikt mnie nie powstrzyma!"
X06_T01_870_010="[{i Fletcher}]: Odpowiedzią jest Zaćmienie!"
X06_T01_880_010="[{i Fletcher}]: Czemu nie chcecie słuchać?!"
X06_T01_882_010="[{i Rhiza}]: Może i pokonano te siły, ale ja nie zrezygnuję!"
X06_T01_883_010="[{i Rhiza}]: To nieważne, będę kontynuować atak!"
X06_T01_884_010="[{i Rhiza}]: Dwie wieże zajmą jej miejsce!"
X06_T01_885_010="[{i Rhiza}]: To mnie nie powstrzyma!"
X06_T01_886_010="[{i Rhiza}]: Odbuduję wszystko dwa razy mocniejsze!"
X06_T01_887_010="[{i Rhiza}]: Mylisz się, jeśli myślisz, że dam się przestraszyć!"
X06_T01_900_010="[{i Rhiza}]: Chwała Księżniczce!"
X06_T01_910_010="[{i Rhiza}]: Niemądrze jest mnie ignorować."
X06_T01_920_010="[{i Rhiza}]: Wkrótce poznasz mój gniew!"
X06_T01_930_010="[{i Rhiza}]: Nikt nie przeciwstawi się woli Księżniczki!"
X06_T01_940_010="[{i Rhiza}]: Tutaj czeka was tylko zniszczenie, Seraphimowie!"
X06_T01_950_010="[{i Rhiza}]: Zwycięstwo dla Koalicji!"
X1CA_001_description="Griffin IV, nowa planeta ojczysta UEF została zaatakowana przez siły Zakonu i Seraphimów. Fortu Clarke - ostatniego bastionu - broni dowódca brygady, Fletcher. Jest jednym z najlepszych polowych dowódców UEF. Jeśli Fort Clarke padnie, UEF padnie wraz z nim. Twoja misja to pokonanie Seraphimów i dowódców Zakonu, i uratowanie Fortu Clarke."
X1CA_002_description="Niektórzy Aeoni odrzucili Zakon i Seraphimów, i pozostali przy swej Księżniczce. Ci lojaliści, którymi dowodzi krzyżowiec Rhiza, wykonywali misje sabotażowe i szpiegowskie na terenie Zakonu. Jednakże, kilku przywódców lojalistów wpadło w ręce wroga na Copernicusie. Lojaliści próbowali ich odbić, ale związali się walką z siłami Zakonu i QAI. Lojaliści okazali się bezcenni dla Koalicji, więc trzeba ich uratować. Twoim zadaniem jest uratowanie przywódców lojalistów i wyeliminowanie dowódców Zakonu i QAI."
X1CA_003_description="Księżniczka powróciła! Oświeceni rozpoczęli wojnę domową, a Seraphimowie już dowiedzieli się o tajemnym odwrocie księżniczki. Jeśli zdołają ją wyeliminować, Zakon zdobędzie pełnię władzy nad Aeonami, a rebelia zostanie zdławiona. Dołączysz do krzyżowca Rhizy i staniesz do walki z Seraphimami, by uratować Księżniczkę."
X1CA_004_description="Koalicja otrzymała dane wywiadowcze: Seraphimowie zbierają się na Hadesie - dawnej planecie UEF. Mają zamiar przegrupować swoje siły i przypuścić szturm na samo serce koalicji. Dowódczyni Dostya ma swoje podejrzenia, ale dołączy do ciebie, jeśli przypuścisz na Seraphimów atak. Przy odrobinie szczęścia, Seraphimowie dadzą się zaskoczyć i łatwo wyprzeć z Hadesu."
X1CA_005_description="Po zasadzce na Hadesie i śmierci dowódczyni Dostyi, zdecydowano, że należy raz na zawsze zniszczyć QAI. Użyj danych wywiadu zebranych z węzła Siódmej Ręki, które koalicja znalazła w jednostce centralnej QAI. Utworzysz przyczółek wraz z dowódcą brygady, Fletcherem. Kiedy przyjdzie czas, przybędzie osobiście doktor Brackman, by zniszczyć QAI. Doktora trzeba będzie eskortować do QAI i bronić za wszelką cenę."
X1CA_006_description="Informacje uzyskane od QAI pozwolą siłom koalicji na bezpośredni skok na Ziemię, gdzie Seraphimowie budują łuk, mający ustabilizować Szczelinę Kwantową, przez którą sprowadzą posiłki. Oddział wypadowy, składający się z krzyżowca Rhizy i dowódcy brygady, Fletcher, skoczy jako pierwszy. Podążysz za nimi i poprowadzisz atak na łuk. Kiedy już zostanie zniszczony, koalicja wreszcie zdobędzie przewagę potrzebną do zniszczenia pozostałych Seraphimów i Zakonu."
X1MP_001_Description="Powierzchnia Dunes, pokryta labiryntem postrzępionych skał, przez lata używana była przez partyzantów jako schronienie. Wraz z przybyciem Seraphimów, skały tej planety, znowu stały się domem uciekinierów."
X1MP_002_Description="W czasach schyłku imperium Ziemi, było to miejsce, gdzie Komandor Williamson stoczył swoja ostatnią bitwę podczas inwazji Aeonów. Ostatnie wydarzenia sprawiły, że Komandor Williamson i most, którego bronił, stały się symbolem nadziei i męstwa dla ludzi UEF."
X1MP_003_Description="Uznawana za miejsce pierwszego zwycięstwa Koalicji. Cybrański dowódca Snoey bronił się tu przed atakami przeważających sił Seraphimów, do momentu przybycia sił UEF, które uratowały kolonię Tri-Beta Zero. Ta cybrańska kolonia została później ewakuowana, z powodu bliskości linii frontu."
X1MP_004_Description="Haven Reef została zasiedlona przez kolonistów UEF, uciekających przed Nieskończoną wojną. Mieli oni nadzieję, że stanie się ich azylem. Dzięki bogactwu zasobów, Haven Reef rozkwitła, jednak okres bogactwa był krótki. Wszystkie zapisy zostały stracone, jednak uważa się, że koloniści zginęli na skutek tajemniczej zarazy. UEF dementuje te pogłoski i utajniła wszelkie informacje o Haven Reef."
X1MP_005_Description="Położony w delcie, w centrum lądu, teren ten był zawsze schronieniem dla rebeliantów, partyzantów i przemytników. Od momentu rozpoczęcia Inwazji Seraphimów, na Serce została założona jedna z niewielu nie-wojskowych kolonii Seraphimów na obszarze Drogi Mlecznej."
X1MP_006_Description="Aeonowie wierzyli, że ta planeta ma wyjątkowe połączenie z Drogą, więc wybudowali świątynię w centrum najwyższego pasma górskiego. Chcieli, aby świątynia ta była miejscem spokoju i medytacji. Niestety, w zetknięciu z brutalną rzeczywistością wojny, miejsce przeznaczone do nauki, stało się polem walki."
X1MP_007_Description="Kolonia UEF, która jak dotąd odrzuciła wszystkie oferty pomocy ze strony Koalicji. Jej sekret nie został jeszcze odkryty, jednak wydaje się, że koloniści nie przejmują się zagrożeniem ze strony Seraphimów."
X1MP_008_Description="Niegdyś było to miejsce wielkiej mocy dla Księżniczki i jej pomocników. Jednak Lojaliści Aeonu zostali zmuszeni do opuszczenia tego terenu, z powodu zagrożenia ze strony Zakonu."
X1MP_009_Description="Kiedy Seraphimowie po raz pierwszy przybyli do naszej galaktyki, nie byli pewni, czy jej zasoby wystarczą do napędzenia ich maszyn bojowych. Zasadzili więc na tej planecie bardzo rzadkie kryształy Liberiam. Jednak naukowcy zakonu w końcu przekonali Seraphimów, że miejscowe zasoby masy będą w stanie sprostać zapotrzebowaniu."
X1MP_010_Description="Aeonowie wierzyli, że ta planeta została pobłogosławiona Drogą i przez wiele pokoleń bronili jej przed obecnością inteligentnych form życia. Teraz, gdy wojska Koalicji zmagają się z niedoborami zasobów, to ograniczenie zostało zniesione."
X1MP_011_Description="Ponieważ największa koncentracja zasobów znajduje się w centrum Shuriken, dowódcy musza jak najszybciej przemieścić się do przodu. Jednak ci, którzy zbytnio rozciągną linie frontu, mogą nie mieć drugiej szansy."
X1MP_012_Description="Legenda głosi, że niegdyś był to dom bogatej i szczęśliwej społeczności, jednak kataklizm rozerwał ten archipelag. Dzisiaj naukowcy przeczesują dno morza, w poszukiwaniu potwierdzenia tej teorii."
X1MP_014_Description="W miesiącach letnich dno Kopalni Odkrywkowej jest zalewane, co uniemożliwia kolonistom pracę. Ostatnio kolonia zerwała całkowicie komunikację z UEF, a wiadomości wysyłane przez koalicję były ignorowane. Status systemu i jego kolonii pozostaje nieznany."
X1MP_017_Description="Dziwna anomalia sprawia, że komunikacja kwantowa jest utrudniona w tym systemie. Jednak to nie przeszkodziło zarówno siłom Koalicji jak i Seraphimom/Zakonowi w wybraniu tej planety jako doskonałego punktu do rozpoczynania tajnych ataków na terytoria przeciwnika."
X1TU_0000="Gratulacje panie pułkowniku, ukończył pan ćwiczenia szkoleniowe!"
X1T_TU01_010_010="[{i Fletcher}]: Słuchajcie, pułkowniku. Te ćwiczenia pozwolą wam w pełni zapoznać się możliwościami i funkcjami waszej Opancerzonej Jednostki Dowodzenia (OJD), wliczając w to budowę i rozmieszczenie jednostek. Musisz uporać się z tym jak najszybciej, ponieważ Zakon i ich obcy kolesie masakrują nas w całej galaktyce. Uważajcie więc."
X1T_TU01_010_020="[{i Fletcher}]: Pierwszą rzeczą, jakiej musisz się nauczyć, to orientacja na polu bitwy."
X1T_TU02_010_010="[{i Fletcher}]: To zadanie jest debilnie proste, ale ci na górze karzą mi przeprowadzać je z każdym. Są dwa sposoby na przewijanie pola bitwy - za pomocą myszy i za pomocą klawiszy kursorów. Aby użyć myszy, po prostu przesuń ją do krawędzi ekranu, a widok automatycznie się przesunie. Wciśnięcie i przytrzymanie klawiszy kursorów działa tak samo."
X1T_TU02_020_010="[{i Fletcher}]: Doskonała robota, dowódco."
X1T_TU02_030_010="[{i Fletcher}]: Twoja OJD zapewnia ci pełen widok pola bitwy, włączając w to możliwość zbliżania i oddalania. Aby zbliżyć i oddalić kamerę, używasz kółka myszy - albo klawiszy Q i W."
X1T_TU02_040_010="[{i Fletcher}]: Dobra. Przejdźmy dalej."
X1T_TU02_050_010="[{i Fletcher}]: Ustaw widok ekranu nad znacznikami celów misji, dowódco."
X1T_TU02_060_010="[{i Fletcher}]: Do roboty, dowódco! Wypełnij cel misji."
X1T_TU02_070_010="[{i Fletcher}]: Oddalaj widok, aż zobaczysz znacznik celu misji."
X1T_TU02_080_010="[{i Fletcher}]: Nie mamy całego dnia, dowódco!"
X1T_TU02_OBJ_010_010="Przesuń widok pola bitwy"
X1T_TU02_OBJ_010_020="Użyj myszy albo klawiszy kursorów, aby ustawić kamerę na każdym ze znaczników."
X1T_TU02_OBJ_010_030="Oddal"
X1T_TU02_OBJ_010_040="Oddalaj widok, aż zobaczysz znacznik. Użyj kółka myszy, albo odpowiedniego klawisza."
X1T_TU03_010_010="[{i Fletcher}]: Czas zabrać twoją OJD na spacer. Kliknij lewym przyciskiem myszy OJD, aby ją wybrać, a potem prawym wybrane miejsce na mapie, aby wydać jej rozkaz ruchu."
X1T_TU03_010_020="[{i Fletcher}]: Kiedy będziesz gotowy, przemieść swoją OJD we wskazane na mapie miejsce."
X1T_TU03_020_010="[{i Fletcher}]: Dobra robota."
X1T_TU03_030_010="[{i Fletcher}]: Dowódco, lewy przycisk myszy, aby wybrać OJD, prawy, aby ją przemieścić."
X1T_TU03_040_010="[{i Fletcher}]: Zobaczmy, czy uda nam się to przyspieszyć, dobra?\n\n"
X1T_TU03_050_010="[{i Fletcher}]: Twoja OJD jest też potężną bronią, która z łatwością może pokonać słabsze jednostki przeciwnika. Aby zaatakować przeciwnika, wybierz OJD i kliknij prawym przyciskiem myszy cel, który ma zostać zniszczony. Pamiętaj, że OJD zaatakuje automatycznie, kiedy jego cel znajdzie się w zasięgu. "
X1T_TU03_050_020="[{i Fletcher}]: Zaatakuj i zniszcz wrogą jednostkę."
X1T_TU03_060_010="[{i Fletcher}]: Dobra robota żołnierzu, ale nie bądź zbyt pewny siebie."
X1T_TU03_070_010="[{i Fletcher}]: Zniszcz tę jednostkę, dowódco."
X1T_TU03_080_010="[{i Fletcher}]: Jeśli będziesz tak powolny na prawdziwym polu bitwy, nie wytrzymasz pięciu sekund. Załatw to."
X1T_TU03_OBJ_010_010="Ruch OJD"
X1T_TU03_OBJ_010_020="Przemieść swoją OJD w wybrane miejsce."
X1T_TU03_OBJ_010_030="Zaatakuj przy pomocy OJD"
X1T_TU03_OBJ_010_040="Zaatakuj i zniszcz wrogie jednostki przy pomocy OJD."
X1T_TU04_010_010="[{i Fletcher}]: Dwa rodzaje surowców pozwalają wytwarzać i utrzymywać wszystko, co budujesz: Masa i Moc. Aby twoja ekonomia była sprawna, musisz znaleźć równowagę między zdobywaniem i wydawaniem każdego z tych surowców."
X1T_TU04_020_010="[{i Fletcher}]: Ten wskaźnik na wyświetlaczu HUD pokazuje jak wiele mocy gromadzisz, a ten wskazuje jak wiele masy zużywasz. Jeśli wydajesz więcej, niż zdobywasz, twój przychód będzie ujemny i powstanie ryzyko, że twoja ekonomia się zatrzyma."
X1T_TU04_030_010="[{i Fletcher}]: Masę zdobywasz budując Ekstraktory masy na złożach masy; złoża masy są oznaczone jako zielony kwadracik z X w środku na twoim wyświetlaczu HUD. Możesz również zdobywać masę za pomocą Kreatorów masy i przez odzyskiwanie."
X1T_TU04_030_020="[{i Fletcher}]: Chcę, abyś zbudował trzy Ekstraktory masy. Wybierz OJD, kliknij ikonę Ekstraktora masy w polu budowy, a potem kliknij jedno z podświetlonych złóż masy. Powtórz to dla każdego ekstraktora."
X1T_TU04_040_010="[{i Fletcher}]: Dobra robota. Teraz zbierasz masę."
X1T_TU04_050_010="[{i Fletcher}]: Zbudujmy te trzy ekstraktory masy, dowódco."
X1T_TU04_060_010="[{i Fletcher}]: Nie możesz zbudować niczego bez masy, dowódco. Wykonaj cel misji."
X1T_TU04_070_010="[{i Fletcher}]: Moc zbiera się za pomocą generatorów. Istnieją trzy poziomy generatorów mocy i inaczej niż Ekstraktory masy, można je budować w dowolnym miejscu mapy."
X1T_TU04_070_020="[{i Fletcher}]: Według rozkazów masz zbudować dwa generatory mocy. Wybierz swoją OJD, wybierz opcje budowania z UI budowania, a następnie kliknij dowolne wolne miejsce na ziemi."
X1T_TU04_080_010="[{i Fletcher}]: Teraz, gdy generatory pracują, otrzymujesz stały dopływ mocy."
X1T_TU04_090_010="[{i Fletcher}]: Zbuduj dwa generatory mocy, dowódco."
X1T_TU04_100_010="[{i Fletcher}]: Siły zakonu już pukają do drzwi, dowódco. Zbuduj te generatory."
X1T_TU04_110_010="[{i Fletcher}]: OK, zacznijmy budować armię. W fabrykach możesz budować Inżynierów i jednostki taktyczne, takie jak czołgi, samoloty czy łodzie podwodne. Dalej, zbuduj fabrykę naziemną."
X1T_TU04_120_010="[{i Fletcher}]: Dobra robota, dowódco. Teraz możesz zacząć budować armię."
X1T_TU04_130_010="[{i Fletcher}]: Zbuduj fabrykę naziemną, dowódco."
X1T_TU04_140_010="[{i Fletcher}]: Czekasz na zaproszenie? Zbuduj Fabrykę naziemną."
X1T_TU04_OBJ_010_010="Zbuduj Ekstraktory masy"
X1T_TU04_OBJ_010_020="Zbuduj Ekstraktor masy na każdym z trzech złóż masy."
X1T_TU04_OBJ_010_030="Zbuduj generatory mocy"
X1T_TU04_OBJ_010_040="Zbuduj dwa generatory mocy."
X1T_TU04_OBJ_010_050="Zbuduj Fabrykę naziemną"
X1T_TU04_OBJ_010_060="Zbuduj jedną Fabrykę naziemną."
X1T_TU05_010_010="[{i Fletcher}]: Teraz, gdy już wybudowałeś Fabrykę naziemną, możesz budować mobilne jednostki lądowe. Kliknij lewym przyciskiem myszy fabrykę, aby ją wybrać, a potem kliknij jednostki, które chcesz wybudować. Na potrzeby tego ćwiczenia, zbuduj dwa lekkie roboty szturmowe i  dwie jednostki lekkiej artylerii. Za każdym razem, kiedy klikasz ikonę jednostki, jest ona dodawana do kolejki budowy fabryki."
X1T_TU05_020_010="[{i Fletcher}]: Dobra robota. Teraz masz początki prawdziwej armii."
X1T_TU05_030_010="[{i Fletcher}]: Zbudujmy te jednostki, dowódco."
X1T_TU05_040_010="[{i Fletcher}]: Nie możesz walczyć z przeciwnikami UEF wyłącznie ciętymi ripostami, dowódco. Zbuduj te jednostki."
X1T_TU05_050_010="[{i Fletcher}]: Grupy kontroli pozwalają ci szybko wybrać grupę jednostek, bez potrzeby używania myszy. Aby stworzyć grupę kontroli, wybierz kilka jednostek - zaznaczając je myszką albo klikając je, trzymając wciśnięty Shift - a potem wciśnij Ctrl+1. Te jednostki znajdują się teraz w grupie kontroli nr 1; jeśli wciśniesz klawisz 1, automatycznie wybierzesz jednostki wchodzące w skład tej grupy."
X1T_TU05_050_020="[{i Fletcher}]: Stwórz grupę kontroli."
X1T_TU05_060_010="[{i Fletcher}]: O to chodziło.   "
X1T_TU05_070_010="[{i Fletcher}]: Dalej, stwórz grupę kontroli, dowódco."
X1T_TU05_080_010="[{i Fletcher}]: Załatwmy to już, dowódco. Stwórz grupę kontroli."
X1T_TU05_OBJ_010_010="Zbuduj jednostki lądowe"
X1T_TU05_OBJ_010_020="Zbuduj dwa lekkie roboty szturmowe i dwie jednostki lekkiej artylerii."
X1T_TU05_OBJ_010_030="Stwórz grupę kontroli."
X1T_TU05_OBJ_010_040="Zaznacz jednostki, które wybudowałeś, przeciągając nad nimi kursor albo klikając z wciśniętym klawiszem Shift, a następnie wciśnij Ctrl+1."
X1T_TU06_010_010="[{i Fletcher}]: W fabrykach możesz również tworzyć Inżynierów, którzy mogą tworzyć budynki niedostępne dla twojej OJD, takie jak akumulatory masy i mocy, radary czy sonary. Inżynierowie mogą również odzyskiwać masę z budynków i jednostek wroga, przejmować jednostki przeciwnika, naprawiać uszkodzone jednostki i budynki oraz pomagać w budowie."
X1T_TU06_010_020="[{i Fletcher}]: Zbuduj dwóch Inżynierów w Fabryce Naziemnej."
X1T_TU06_020_010="[{i Fletcher}]: Tak trzymać. Dobra robota."
X1T_TU06_030_010="[{i Fletcher}]: Zbuduj dwóch Inżynierów, dowódco."
X1T_TU06_040_010="[{i Fletcher}]: Dalej, dowódco, zbudujmy tych Inżynierów."
X1T_TU06_050_010="[{i Fletcher}]: Twoja OJD i Inżynierowie mogą przejmować jednostki i budynki przeciwnika, a nic bardziej nie wkurza tych kanalii z Zakonu, niż użycie ich sprzętu przeciwko nim. Na mapie został umieszczony generator mocy - przejmij go przy pomocy swojego Inżyniera. Wybierz Inżyniera i kliknij generator prawym przyciskiem myszy."
X1T_TU06_060_010="[{i Fletcher}]: Teraz ten generator mocy jest twój. Dobra robota."
X1T_TU06_070_010="[{i Fletcher}]: Przejmij ten generator przy pomocy swoich Inżynierów."
X1T_TU06_080_010="[{i Fletcher}]: Do roboty, dowódco, zajmij ten generator."
X1T_TU06_090_010="[{i Fletcher}]: Nigdy nie wiadomo, kiedy ci cholerni kosmici mogą się pojawić, więc zawsze fortyfikuj swoja bazę budynkami obronnymi. Punkty obronne zapewniają niezłą ochronę i mogą odeprzeć większość ataków lądowych. Zbuduj punkt obronny we wskazanym miejscu."
X1T_TU06_100_010="[{i Fletcher}]: Dobrze. Teraz, w razie ataku, masz przynajmniej jakąś szansę."
X1T_TU06_110_010="[{i Fletcher}]: Dowódco, zbuduj punkt obronny we wskazanym miejscu."
X1T_TU06_120_010="[{i Fletcher}]: Zbuduj ten punkt obronny, dowódco."
X1T_TU06_130_010="[{i Fletcher}]: No kto by pomyślał - zbliżają się jednostki przeciwnika. Dobrze, że zbudowałeś ten punkt obronny."
X1T_TU06_140_010="[{i Fletcher}]: Obrona przed atakami lądowymi to tylko połowa sukcesu; musisz również być w stanie odpierać ataki lotnicze. Zbuduj wieżyczkę przeciwlotniczą we wskazanym miejscu."
X1T_TU06_150_010="[{i Fletcher}]: Może jeszcze uda nam się zrobić z ciebie dowódcę. Dobra robota."
X1T_TU06_160_010="[{i Fletcher}]: Zbuduj tę wieżyczkę, dowódco."
X1T_TU06_170_010="[{i Fletcher}]: Jeśli przeciwnik wyśle jakieś bombowce, nie masz szans. Zbuduj tę wieżyczkę przeciwlotniczą."
X1T_TU06_180_010="[{i Fletcher}]: Nadlatują bombowce wroga. Nie cieszysz się, że zbudowałeś tę wieżyczkę?"
X1T_TU06_OBJ_010_010="Zbuduj Inżynierów"
X1T_TU06_OBJ_010_020="Zbuduj dwóch Inżynierów w fabryce naziemnej."
X1T_TU06_OBJ_010_030="Zajmij generator mocy"
X1T_TU06_OBJ_010_040="Zajmij generator mocy przy pomocy swoich Inżynierów."
X1T_TU06_OBJ_010_050="Zbuduj punkt obronny"
X1T_TU06_OBJ_010_060="Zbuduj punkt obronny w wyznaczonym miejscu."
X1T_TU06_OBJ_010_070="Zbuduj wieżyczkę przeciwlotniczą"
X1T_TU06_OBJ_010_080="Zbuduj wieżyczkę przeciwlotniczą w wyznaczonym miejscu na mapie."
X1T_TU07_010_010="[{i Fletcher}]: Możesz mieć tyle bombowców i czołgów, ile zechcesz, ale jeśli nie będziesz wiedział, co robi przeciwnik, to tak jakbyś walczył jedną ręką. Dlatego jedną z najważniejszych kwestii w czasie wojny jest wywiad. Radar jest najistotniejszym elementem w zdobywaniu informacji o przeciwniku. Zbuduj teraz jeden we wskazanym miejscu."
X1T_TU07_020_010="[{i Fletcher}]: Teraz masz przeciwnika na oku. Dobra robota."
X1T_TU07_030_010="[{i Fletcher}]: Zbuduj radar, dowódco."
X1T_TU07_040_010="[{i Fletcher}]: Nie możesz walczyć na ślepo, dowódco. Zbuduj ten radar."
X1T_TU07_OBJ_010_010="Zbuduj radar"
X1T_TU07_OBJ_010_020="Zbuduj radar we wskazanym miejscu."
X1T_TU08_010_010="[{i Fletcher}]: Twój radar wykrył istnienie małej bazy Zakonu. Stwórz armię i zniszcz ją!"
X1T_TU08_020_010="[{i Fletcher}]: Uwielbiam widok płonących jednostek Zakonu. Doskonała robota, dowódco."
X1T_TU08_030_010="[{i Fletcher}]: Zetrzyj tę bazę z powierzchni ziemi, dowódco."
X1T_TU08_040_010="[{i Fletcher}]: Chcę, żebyś zniszczył tę bazę, dowódco."
X1T_TU08_OBJ_010_010="Zniszcz bazę przeciwnika"
X1T_TU08_OBJ_010_020="Stwórz armię, zaatakuj i zniszcz bazę Zakonu. Spraw, aby nie pozostał po niej nawet ślad."
X1T_TU09_010_010="[{i Fletcher}]: Wykryłem większą bazę Zakonu na północy. Przesyłamy ci posiłki; dodaj je do swojej armii i zniszcz tamtą bazę przeciwnika. Chcę, żeby nie pozostał tam kamień na kamieniu."
X1T_TU09_020_010="[{i Fletcher}]: Jeden dowódca przeciwnika mniej. Uwielbiam widok zniszczonych dowódców przeciwnika."
X1T_TU09_030_010="[{i Fletcher}]: Zniszcz dowódcę przeciwnika."
X1T_TU09_040_010="[{i Fletcher}]: Czekasz, aż ta kanalia podejdzie tu i się przedstawi? Zaatakuj go i zniszcz."
X1T_TU09_OBJ_010_010="Zniszcz dowódcę przeciwnika"
X1T_TU09_OBJ_010_020="Zaatakuj i zniszcz dowódcę przeciwnika i jego bazę."
X1T_TU10_010_010="[{i Fletcher}]: Aby mieć dostęp do potężniejszych rodzajów broni, musisz ulepszyć swoje fabryki. Istnieją trzy poziomy technologiczne: poziom 1, poziom 2 i poziom 3. Aby przejść na poziom 2, wybierz fabrykę naziemną i kliknij ikonę ulepszenia."
X1T_TU10_010_020="[{i Fletcher}]: Ulepsz swoją fabrykę do poziomu 2."
X1T_TU10_020_010="[{i Fletcher}]: Doskonale. Możesz teraz budować jednostki poziomu 2 przy pomocy Inżynierów."
X1T_TU10_030_010="[{i Fletcher}]: Ulepszmy tę fabrykę naziemną, dowódco."
X1T_TU10_040_010="[{i Fletcher}]: Potrzeba czegoś więcej niż proca, aby wygrać tę wojnę, dowódco. Ulepsz swoją fabrykę."
X1T_TU10_OBJ_010_010="Ulepsz fabrykę"
X1T_TU10_OBJ_010_020="Ulepsz swoją fabrykę do poziomu 2."
X1T_TU11_010_010="[{i Fletcher}]: Jeśli odrobiłeś swoją pracę domową, wiesz, że większość bitew rozgrywa się na olbrzymich terenach. Transportowce to najskuteczniejsza metoda przemieszczania jednostek na wielkie odległości. Transportowców możesz użyć na wiele sposobów, więc sprawdź swój podręcznik. Na potrzeby tego ćwiczenia, zajmiemy się tylko podstawowymi możliwościami. Właśnie przekazaliśmy pod twoją komendę transportowiec."
X1T_TU11_010_020="[{i Fletcher}]: Aby załadować transportowiec, wybierz jednostki, które chcesz przetransportować, a następnie kliknij transportowiec prawym przyciskiem myszy. Kiedy transportowiec jest pełen, kliknij ikonę transportu, po czym wskaż miejsce na mapie, gdzie transport ma zostać wyładowany."
X1T_TU11_010_030="[{i Fletcher}]: Załaduj transportowiec i przemieść go we wskazane miejsce."
X1T_TU11_020_010="[{i Fletcher}]: Teraz znasz już podstawy transportu. Dobra robota."
X1T_TU11_030_010="[{i Fletcher}]: Przetransportuj te jednostki, dowódco."
X1T_TU11_040_010="[{i Fletcher}]: Załaduj ten transportowiec, dowódco."
X1T_TU11_OBJ_010_010="Użyj transportowca"
