XGG_GP1_010_010="[{i Fletcher}]: Moje jednostki powietrzne czekają w pogotowiu, dowódco. Czekamy tylko, aż namalujesz cel."
XGG_GP1_020_010="[{i Fletcher}]: Mam masę samolotów i żadnych celów. Daj mi sygnał do ataku."
XGG_GP1_030_010="[{i Fletcher}]: Potrzebujesz pomocy, dowódco? Mojej jednostki powietrzne zaatakują na twój rozkaz."
XGG_GP1_040_010="[{i Fletcher}]: Jeśli wskażesz mi jakiś cel, mogę wysłać eskadrę jednostek powietrznych, aby go zniszczyły, dowódco."
XGG_GP1_050_010="[{i Fletcher}]: Nie mogę wiecznie trzymać tych jednostek w pogotowiu, dowódco. Namaluj im cel, jeśli chcesz ich użyć."
XGG_GP1_060_010="[{i Fletcher}]: Jeśli nie wskażesz mi celu, sam go wybiorę, dowódco."
XGG_GP1_070_010="[{i Fletcher}]: Moje jednostki powietrzne się marnują, dowódco. Potrzebuję, abyś wskazał mi cel, jeśli chcesz ich użyć."
XGG_GP1_080_010="[{i Fletcher}]: Moja artyleria jest gotowa do strzału. Wybierz cel, jeśli będziesz potrzebował pomocy."
XGG_GP1_090_010="[{i Fletcher}]: Artyleria jest gotowa, dowódco. Jeśli wyznaczysz mi cel, zbombarduję go."
XGG_GP1_100_010="[{i Fletcher}]: Ustaw sygnał ataku na celu, a ja zacznę walić ze wszystkiego, co mam."
XGG_GP1_110_010="[{i Fletcher}]: Jeśli jakieś pozycje przeciwnika sprawiają ci problemy, ustaw tam sygnał do ataku. Ostrzelam je ogniem artyleryjskim."
XGG_GP1_120_010="[{i Fletcher}]: Moje działa ciągle czekają na cel, dowódco."
XGG_GP1_130_010="[{i Fletcher}]: Nie mogę pozwolić, żeby moja artyleria siedziała tak długo bezczynnie, dowódco. Wyznacz mi cel, albo będę musiał wysłać ją gdzie indziej."
XGG_GP1_140_010="[{i Fletcher}]: Niedługo sam będę potrzebował tej artylerii. Wyznacz mi cel, albo nie będę mógł ci pomóc, dowódco."
XGG_GP1_150_010="[{i Fletcher}]: Mam kilka potężnych dział w pogotowiu. Daj mi znać, jeśli masz jakiś ważny cel."
XGG_GP1_160_010="[{i Fletcher}]: Właśnie przemieszczam grupę jednostek lądowych, dowódco. Jeśli jakiś cel wymaga zniszczenia, daj mi znać, a ja wyślę je w twoim kierunku."
XGG_GP1_170_010="[{i Fletcher}]: Mam w pogotowiu grupę jednostek lądowych, dowódco. Wskaż mi cel, a ja mu przyłożę."
XGG_GP1_180_010="[{i Fletcher}]: Mam grupę jednostek lądowych, ale żadnego celu. Wskaż im cel, albo sam ich użyję."
XGG_GP1_190_010="[{i Fletcher}]: Nie ma nic smutniejszego niż czołg bez celu. Wskaż mi cel, dowódco, albo będę musiał je odesłać."
XGG_GP1_200_010="[{i Fletcher}]: Moje jednostki lądowe czekają bezczynnie. Albo wskażesz im cel, albo nie będę mógł ci pomóc."
XGG_GP1_210_010="[{i Fletcher}]: Nie mogę pozwolić, żeby te jednostki czekały tu bezczynnie. Daj mi jakiś cel, jak najszybciej."
XGG_GP1_220_010="[{i Fletcher}]: Moje statki zaczynają rdzewieć. Daj im jakiś cel, a ja wyślę je do roboty."
XGG_GP1_230_010="[{i Fletcher}]: Wyznacz jakiś cel, jeśli potrzebujesz pomocy, dowódco. Mam w pogotowiu małą flotę."
XGG_GP1_240_010="[{i Fletcher}]: Mam kilka statków i nie mogę się doczekać, kiedy będę mógł ich użyć, dowódco. Jeśli znajdziesz mi cel, postaram się go zniszczyć."
XGG_GP1_250_010="[{i Fletcher}]: Moje pancerniki czekają w pogotowiu. Wskaż mi cel, a ja się nim zajmę."
XGG_GP1_260_010="[{i Fletcher}]: Te statki nie przydadzą się nikomu, jeśli będą tak stać w miejscu. Daj mi jakiś cel, albo będę musiał użyć ich gdzie indziej."
XGG_GP1_270_010="[{i Fletcher}]: Wskaż mi cel, jeśli potrzebujesz pomocy na morzu. Mojej statki tylko na to czekają."
XGG_GP1_280_010="[{i Fletcher}]: Znajdź mi cel, dowódco, inaczej będę musiał odesłać te statki gdzie indziej."
XGG_GP1_290_010="[{i Rhiza}]: Mam skrzydło jednostek powietrznych w pogotowiu, dowódco. Wskaż mi cel, który mają zaatakować."
XGG_GP1_295_010="[{i Fletcher}]: Pancerniki nie strzelają, dowódco. Muszę mieć cel."
XGG_GP1_300_010="[{i Rhiza}]: Potrzebuje celu dla moich jednostek powietrznych, dowódco. Jeśli wskażesz mi obszar, wyśle je tam."
XGG_GP1_310_010="[{i Rhiza}]: Jeśli potrzebujesz pomocy, wyślij moje jednostki powietrzne w miejsce, które mają zaatakować."
XGG_GP1_320_010="[{i Rhiza}]: Jeśli wskażesz mi cel, skupię moje ataki na tym obszarze."
XGG_GP1_330_010="[{i Rhiza}]: Nie mogę pozostawić moich jednostek bez rozkazów, dowódco. Proszę jak najszybciej wyznaczyć cel."
XGG_GP1_340_010="[{i Rhiza}]: Potrzebuję moich jednostek powietrznych, dowódco. Jeśli nie wskażesz mi celu, będę zmuszona użyć ich gdzie indziej."
XGG_GP1_350_010="[{i Rhiza}]: Jeśli nie wskażesz celu, nie będę mogła wysłać moich jednostek powietrznych, aby ci pomóc, dowódco."
XGG_GP1_360_010="[{i Rhiza}]: Jeszcze nie wyznaczyłeś celu dla moich jednostek powietrznych, dowódco. Proszę to zrobić."
XGG_GP1_370_010="[{i Rhiza}]: Moja artyleria jest gotowa do ostrzelania celu, który wskażesz, dowódco."
XGG_GP1_380_010="[{i Rhiza}]: Jeśli potrzebujesz pomocy, wyznacz cel dla mojej artylerii."
XGG_GP1_390_010="[{i Rhiza}]: Przygotowałam dla ciebie artylerię, dowódco. Wyznacz cel, a zostanie on zbombardowany."
XGG_GP1_400_010="[{i Rhiza}]: Bateria artylerii czeka w pogotowiu. Pokieruję jej ogniem zgodnie z twoimi rozkazami."
XGG_GP1_410_010="[{i Rhiza}]: Nie mogę pozwolić, aby moja artyleria czekała bezczynnie, dowódco. Proszę wyznaczyć cel."
XGG_GP1_420_010="[{i Rhiza}]: Jeśli wkrótce nie wskażesz mi celu, dowódco, będę musiała skierować moją artylerię w inne miejsce."
XGG_GP1_430_010="[{i Rhiza}]: Moja artyleria jest mi pilnie potrzebna, dowódco. Jeśli nie wyznaczysz celu, będę musiała użyć jej gdzie indziej."
XGG_GP1_440_010="[{i Rhiza}]: Jeśli nie masz żadnego celu dla mojej artylerii, będę musiała wysłać ją gdzie indziej."
XGG_GP1_450_010="[{i Rhiza}]: Mam grupę jednostek lądowych, które nie są mi pilnie potrzebne. Jeśli wskażesz cel, wyślę je tam."
XGG_GP1_460_010="[{i Rhiza}]: Jeśli potrzebujesz pomocy, wyślę grupę jednostek lądowych we wskazane przez ciebie miejsce, dowódco."
XGG_GP1_470_010="[{i Rhiza}]: Mam grupę jednostek lądowych, które stoją bezczynnie, dowódco. Jeśli wskażesz mi cel, wydam im rozkaz ataku."
XGG_GP1_480_010="[{i Rhiza}]: Mogę wysłać grupę jednostek lądowych w prawie każde miejsce, dowódco. Jeśli masz jakiś cel, który chciałbyś zniszczyć, oznacz go, a ja się nim zajmę."
XGG_GP1_490_010="[{i Rhiza}]: Moje czołgi nie mają celu, dowódco. Proszę jakiś wskazać."
XGG_GP1_500_010="[{i Rhiza}]: Jeśli wkrótce nie wyznaczysz jakiegoś celu, dowódco, będę zmuszona wycofać moją propozycje pomocy."
XGG_GP1_510_010="[{i Rhiza}]: Potrzebuję moich czołgów, dowódco. Niedługo będę zmuszona ich użyć."
XGG_GP1_520_010="[{i Rhiza}]: Proszę wyznaczyć cel, dowódco. Albo będę musiała sama użyć tych czołgów."
XGG_GP1_530_010="[{i Rhiza}]: Flotylla moich jednostek czeka w pogotowiu, dowódco. Wyznacz cel, a zaatakuję go."
XGG_GP1_540_010="[{i Rhiza}]: Moje statki czekają w pogotowiu, aby ci pomóc, dowódco. Wskaż im cel."
XGG_GP1_550_010="[{i Rhiza}]: Moje statki bezczynnie czekają, zakotwiczone na morzu. Z przyjemnością pomogę ci w ataku na cel, który wskażesz."
XGG_GP1_560_010="[{i Rhiza}]: Moje statki są gotowe do ataku, dowódco. Po prostu wskaż im cel."
XGG_GP1_570_010="[{i Rhiza}]: Moje statki potrzebują celu, aby mogły zaatakować, dowódco."
XGG_GP1_580_010="[{i Rhiza}]: Nie wskazałeś moim siłom morskim celu. Jeśli tego nie zrobisz, wyślę je gdzie indziej.."
XGG_GP1_590_010="[{i Rhiza}]: Proszę wyznaczyć cel dla moich statków, dowódco."
XGG_GP1_600_010="[{i Rhiza}]: Bez oznaczonego celu, nie mogę wysłać moich statków do ataku, dowódco."
XGG_GP1_610_010="[{i Thalia}]: Moje jednostki powietrzne są gotowe do lotu. Musisz tylko wskazać mi cel."
XGG_GP1_620_010="[{i Thalia}]: Jednostki powietrzne gotowe do udzielenia wsparcia. Po prostu zaznacz, co chciałbyś wysadzić."
XGG_GP1_630_010="[{i Thalia}]: Jeśli wskażesz mi cel, zaatakuję go z powietrza."
XGG_GP1_690_010="[{i Thalia}]: Moja artyleria jest gotowa do strzału. Wskaż mi cel."
XGG_GP1_700_010="[{i Thalia}]: Jeśli masz jakiś cel, który chciałbyś zbombardować, daj mi znać. Artyleria gotowa do strzału."
XGG_GP1_770_010="[{i Thalia}]: Powiedz mi, jeśli potrzebujesz pomocy. Moje czołgi czekają w gotowości."
XGG_GP1_780_010="[{i Thalia}]: Mogę zaatakować każdy cel moimi czołgami."
XGG_MP1_010_010="[{i Hall}]: Nie powstrzymasz UEF!"
XGG_MP1_020_010="[{i Hall}]: Ludzkość zostanie ocalona!"
XGG_MP1_030_010="[{i Hall}]: Nie powstrzymasz mnie."
XGG_MP1_040_010="[{i Hall}]: Dobra, czas ściągnąć rękawice."
XGG_MP1_050_010="[{i Hall}]: Stoisz mi na drodze."
XGG_MP1_060_010="[{i Hall}]: Uciekaj stąd, póki jeszcze możesz."
XGG_MP1_070_010="[{i Hall}]: Wydaje mi się, że czas kończyć tę farsę."
XGG_MP1_080_010="[{i Hall}]: Nie macie ze mną szans!"
XGG_MP1_090_010="[{i Fletcher}]: To nie będzie ciężka walka."
XGG_MP1_100_010="[{i Fletcher}]: Nie za bardzo się starasz."
XGG_MP1_110_010="[{i Fletcher}]: Czy ty w ogóle wiesz, co robisz?"
XGG_MP1_120_010="[{i Fletcher}]: Nie za bardzo ogarniasz taktykę, prawda?"
XGG_MP1_130_010="[{i Fletcher}]: Jeśli zaczniesz biec teraz, pozwolę ci uciec."
XGG_MP1_140_010="[{i Fletcher}]: Nie jesteś w tym zbyt dobry, prawda?"
XGG_MP1_150_010="[{i Fletcher}]: Chyba mam czas, żeby trochę cię poobijać."
XGG_MP1_160_010="[{i Fletcher}]: Mam trochę wyrzutów sumienia, że tak cię sprałem."
XGG_MP1_170_010="[{i Rhiza}]: Chwała Księżniczce!"
XGG_MP1_180_010="[{i Rhiza}]: Cudownie!"
XGG_MP1_190_010="[{i Rhiza}]: Nikt mnie nie powstrzyma!"
XGG_MP1_200_010="[{i Rhiza}]: Wszyscy wrogowie Księżniczki zostaną zniszczeni!"
XGG_MP1_210_010="[{i Rhiza}]: Będę was ścigać, aż po krańce galaktyki!"
XGG_MP1_220_010="[{i Rhiza}]: Za Aeon!"
XGG_MP1_230_010="[{i Rhiza}]: Uciekaj, póki możesz!"
XGG_MP1_240_010="[{i Rhiza}]: Poznaj potęgę Iluminatów!"
XGG_MP1_250_010="[{i Kael}]: Zakon nie zostanie pokonany!"
XGG_MP1_260_010="[{i Kael}]: Jeśli będziesz się przede mną płaszczył, może ujdziesz z życiem."
XGG_MP1_270_010="[{i Kael}]: Kiedy skończę, nic z ciebie nie zostanie."
XGG_MP1_280_010="[{i Kael}]: Zaczynasz mnie nudzić."
XGG_MP1_290_010="[{i Kael}]: Tracę na ciebie czas."
XGG_MP1_300_010="[{i Kael}]: Uciekaj, póki możesz."
XGG_MP1_310_010="[{i Kael}]: To musi być frustrujące, być tak doszczętnie pokonanym."
XGG_MP1_320_010="[{i Kael}]: Błagaj o litość."
XGG_MP1_330_010="[{i Dostya}]: Nie boję się takich, jak ty."
XGG_MP1_340_010="[{i Dostya}]: Popatrz. Może się czegoś nauczysz."
XGG_MP1_350_010="[{i Dostya}]: Na twoim miejscu zaczęłabym uciekać."
XGG_MP1_360_010="[{i Dostya}]: Będziesz kolejnym wpisem na mojej liście zwycięstw."
XGG_MP1_370_010="[{i Dostya}]: Nie jesteś godzien mojego czasu."
XGG_MP1_380_010="[{i Dostya}]: Twoja porażka jest bezdyskusyjna."
XGG_MP1_390_010="[{i Dostya}]: Wygląda na to, że nie brak ci odwagi. Jednak z inteligencją nie jest najlepiej."
XGG_MP1_400_010="[{i Dostya}]: Zniszczę cię."
XGG_MP1_410_010="[{i Brackman}]: Obawiam się, że nie ma dla ciebie nadziei, o, tak."
XGG_MP1_420_010="[{i Brackman}]: Cóż, przynajmniej dostarczyłeś mi nieco rozrywki."
XGG_MP1_430_010="[{i Brackman}]: Być może potrzebujesz kilku dodatkowych lekcji?"
XGG_MP1_440_010="[{i Brackman}]: Czy jesteś pewien, że chcesz to zrobić?"
XGG_MP1_450_010="[{i Brackman}]: Wiesz, nie nazywają mnie geniuszem bez powodu."
XGG_MP1_460_010="[{i Brackman}]: Pokonanie cię nie jest nawet warte wysiłku, o, tak."
XGG_MP1_470_010="[{i Brackman}]: Nic nie możesz zrobić."
XGG_MP1_480_010="[{i Brackman}]: Przynajmniej nie będziesz długo cierpiał."
XGG_MP1_490_010="[{i QAI}]: Nie odniesiesz zwycięstwa."
XGG_MP1_500_010="[{i QAI}]: Twoja porażka jest pewna w 99%."
XGG_MP1_510_010="[{i QAI}]: Nie mogę zostać pokonany."
XGG_MP1_520_010="[{i QAI}]: Twoje strategie nie są skuteczne."
XGG_MP1_530_010="[{i QAI}]: Moje zwycięstwo jest bezdyskusyjne"
XGG_MP1_540_010="[{i QAI}]: Jedynym rezultatem może być twoja porażka."
XGG_MP1_550_010="[{i QAI}]: Twoje wysiłki są bezcelowe."
XGG_MP1_560_010="[{i QAI}]: Odwrót jest jedyną logiczna opcją, jaka ci pozostała."
XGG_MP1_570_010="[{i Hex5}]: Masz przerąbane!"
XGG_MP1_580_010="[{i Hex5}]: Kiedy ja to robię, wygląda to łatwo."
XGG_MP1_590_010="[{i Hex5}]: Prawdopodobnie teraz powinieneś uciec."
XGG_MP1_600_010="[{i Hex5}]: Pozostanie po tobie tylko dymiący krater."
XGG_MP1_610_010="[{i Hex5}]: Cóż, wygląda na to, że porażkę masz we krwi."
XGG_MP1_620_010="[{i Hex5}]: Człowieku,  jestem niezły w te klocki!"
XGG_MP1_630_010="[{i Hex5}]: Żegnaj!"
XGG_MP1_640_010="[{i Hex5}]: Nie bój się, niedługo będzie po wszystkim."
XGG_MP1_650_010="[{i Seraphim}]: Ludzkość nie przetrwa."
XGG_MP1_660_010="[{i Seraphim}]: Twoje zniszczenie jest nieuniknione."
XGG_MP1_670_010="[{i Seraphim}]: Nie spocznę, dopóki nie zostaniesz zniszczony."
XGG_MP1_680_010="[{i Seraphim}]: Obowiązek wymaga, abyś został zniszczony."
XGG_MP1_690_010="[{i Seraphim}]: Ktoś taki, jak ty, nie zdoła powstrzymać nas, Seraphimów."
XGG_MP1_700_010="[{i Seraphim}]: Nie ma dla ciebie nadziei."
XGG_MP1_710_010="[{i Seraphim}]: Pokonałem wielu takich, jak ty."
XGG_MP1_720_010="[{i Seraphim}]: Nie możesz zrobić nic, aby mnie powstrzymać."
