fmv_timeline_0000="Supreme Commander: Chronologia inwazji Seraphimów"
fmv_timeline_0001="3844.9 (Dzień X)"
fmv_timeline_0002="Uruchomienie Black Sun tworzy \"miękki\" punkt w domenie kwantowej. Wykorzystują to Seraphimowie do stworzenia pełnej szczeliny kwantowej. Rozpoczyna się inwazja Seraphimów. "
fmv_timeline_0003="3844.9 (Dzień X)"
fmv_timeline_0004="Prezydent UEF Riley zostaje zabity, a Ziemia zostaje starta w pył. Seraphimowie natychmiast rozprzestrzeniają się w galaktyce, mordując wszystkich ziemian, jakich spotkają na swojej drodze."
fmv_timeline_0005="3844.9 (Dzień X)"
fmv_timeline_0006="Pod kontrolą Seraphimów, QAI niszczy sieć bram kwantowych."
fmv_timeline_0007="3844.9 (X+2)"
fmv_timeline_0008="Księżniczka Rhianne Burke, która uczyniła pierwszy krok w kierunku wstąpienia, znika. Jej los pozostaje nieznany."
fmv_timeline_0009="3844.9 (X+4)"
fmv_timeline_0010="Większość ludzi Aeonu uważa Seraphimów za bogów. Rhiza stara się ich ostrzec, że Seraphimowie są zagrożeniem dla całej ludzkości, jednak jej głos zostaje zignorowany."
fmv_timeline_0011="3844.10 (X+12)"
fmv_timeline_0012="Egzaminatorka Kael przejmuje kontrolę nad Oświeconymi Aeonu. Zostaje utworzony Zakon Oświeconych i oficjalnie sprzymierza się z Seraphimami. Rhiza i Księżniczka Burke zostają uznane za heretyczki."
fmv_timeline_0013="3844.10 (X+22)"
fmv_timeline_0014="Rhiza, wraz z garstką dowódców Aeonu wiernych Księżniczce, rozpoczyna wojnę partyzancką przeciwko Zakonowi i Seraphimom."
fmv_timeline_0015="3844.11 (X+45)"
fmv_timeline_0016="Po serii miażdżących ataków, QAI dziesiątkuje siły wojskowe Cybran."
fmv_timeline_0017="3844.11 (X+47)"
fmv_timeline_0018="Z powodu strat zadanych przez QAI Brackman zmuszony jest do ucieczki na krańce wszechświata."
fmv_timeline_0019="3845.3 (X+128)"
fmv_timeline_0020="UEF ponosi ciężkie straty. Gdy struktury wojskowe zaczynają się walić, dowodzenie przejmuje generał Hall."
fmv_timeline_0021="3845.4 (X+136)"
fmv_timeline_0022="UEF i Cybranie zawiązują Kolonialną Koalicje Obronną (Koalicję). Struktury wojskowe obu nacji zostają połączone pod wspólnym dowództwem."
fmv_timeline_0023="3845.7 (X+220)"
fmv_timeline_0024="Mimo oporów Brackmanna, Rhiza i Lojaliści zostają przyjęci do Koalicji."
fmv_timeline_0025="3846.3 (X+442)"
fmv_timeline_0026="Siły Koalicji rozpoczynają pierwszą ofensywę przeciwko Seraphimom. Mimo, iż straty są duże, Koalicja osiąga pierwsze zwycięstwo."
fmv_timeline_0027="3847.2 (X+768)"
fmv_timeline_0028="Rozpoczyna się budowa Fortu Clarke, nowej bazy operacyjnej UEF na planecie Griffin IV."
fmv_timeline_0029="3846.9 (X+716)"
fmv_timeline_0030="Pani generał Samantha Clarke zostaje zabita w walce."
